VALUES
	(1, 'Star Wars: Bloodline', 'Claudia Gray', 352, 'IaXSCQAAQBAJ', 'NEW YORK TIMES BESTSELLER • From the author of Star Wars: Lost Stars comes a thrilling novel set in the years before the events of Star Wars: The Force Awakens. “Unmissable . . . Bloodline’s tense politics, vivid new characters, and perfectly characterized Leia make it feel as central to the Star Wars universe as one of the films.”—Tor.com WITNESS THE BIRTH OF THE RESISTANCE When the Rebellion defeated the Empire in the skies above Endor, Leia Organa believed it was the beginning to a lasting peace. But after decades of vicious infighting and partisan gridlock in the New Republic Senate, that hope seems like a distant memory. Now a respected senator, Leia must grapple with the dangers that threaten to cripple the fledgling democracy—from both within and without. Underworld kingpins, treacherous politicians, and Imperial loyalists are sowing chaos in the galaxy. Desperate to take action, senators are calling for the election of a First Senator. It is their hope that this influential post will bring strong leadership to a divided galaxy. As the daughter of Darth Vader, Leia faces with distrust the prospect of any one person holding such a powerful position—even when supporters suggest Leia herself for the job. But a new enemy may make this path Leia’s only option. For at the edges of the galaxy, a mysterious threat is growing. . . . Praise for Bloodline “[Claudia] Gray paints a much more complete galaxy than we often get to see on the big screen. . . . Knowing that Rian Johnson (writer, director of Star Wars: Episode VIII) had some creative input on the novel provides hope that we haven’t seen the last of all of these wonderful characters. . . . Star Wars: Bloodline isn’t just a great Star Wars book, or a great Leia book, or a great book; it’s a great introduction into the larger world of Star Wars in general.”—ComicBook.com “Bloodline is a nonstop page-turner that grabs at heartstrings that you weren’t aware of and yanks down on every one of them. The story is loaded with context for The Force Awakens that plants the seeds for The First Order in perfectly haunting ways, and leaves the reader grasping for more details on newly discovered favorite characters.”—Inverse From the Hardcover edition.', 'http://books.google.com/books/content?id=IaXSCQAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 12:54:41', '2017-04-15 12:54:41'),
	(2, 'Inkheart', 'Cornelia Funke', 576, 'LXiTj_nGurgC', 'From internationally acclaimed storyteller Cornelia Funke, this bestselling, magical epic is now out in paperback! One cruel night, Meggie\'s father reads aloud from a book called INKHEART-- and an evil ruler escapes the boundaries of fiction and lands in their living room. Suddenly, Meggie is smack in the middle of the kind of adventure she has only read about in books. Meggie must learn to harness the magic that has conjured this nightmare. For only she can change the course of the story that has changed her life forever. This is INKHEART--a timeless tale about books, about imagination, about life. Dare to read it aloud.', 'http://books.google.com/books/content?id=LXiTj_nGurgC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 12:59:20', '2016-05-23 08:34:45'),
	(3, 'I Remember Nothing', 'Nora Ephron', 160, 'wP22JQd-IjkC', 'Nora Ephron returns with her first book since the astounding success of I Feel Bad About My Neck, taking a cool, hard, hilarious look at the past, the present, and the future, bemoaning the vicissitudes of modern life, and recalling with her signature clarity and wisdom everything she hasn’t (yet) forgotten. Ephron writes about falling hard for a way of life (“Journalism: A Love Story”) and about breaking up even harder with the men in her life (“The D Word”); lists “Twenty-five Things People Have a Shocking Capacity to Be Surprised by Over and Over Again” (“There is no explaining the stock market but people try”; “You can never know the truth of anyone’s marriage, including your own”; “Cary Grant was Jewish”; “Men cheat”); reveals the alarming evolution, a decade after she wrote and directed You’ve Got Mail, of her relationship with her in-box (“The Six Stages of E-Mail”); and asks the age-old question, which came first, the chicken soup or the cold? All the while, she gives candid, edgy voice to everything women who have reached a certain age have been thinking . . . but rarely acknowledging. Filled with insights and observations that instantly ring true—and could have come only from Nora Ephron—I Remember Nothing is pure joy.', 'http://books.google.com/books/content?id=wP22JQd-IjkC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 12:54:43', '2017-04-15 12:54:43'),
	(4, 'Cinder', 'Marissa Meyer', 400, 'Afmx_Es3oJwC', 'A forbidden romance. A deadly plague. Earth\'s fate hinges on one girl . . . CINDER, a gifted mechanic in New Beijing, is also a cyborg. She\'s reviled by her stepmother and blamed for her stepsister\'s sudden illness. But when her life becomes entwined with the handsome Prince Kai\'s, she finds herself at the centre of a violent struggle between the desires of an evil queen - and a dangerous temptation. Cinder is caught between duty and freedom, loyalty and betrayal. Now she must uncover secrets about her mysterious past in order to protect Earth\'s future. This is not the fairytale you remember. But it\'s one you won\'t forget.', 'http://books.google.com/books/content?id=Afmx_Es3oJwC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '2017-04-15 12:54:43', '2017-04-15 12:54:43'),
	(5, 'Leviathan', 'Scott Westerfeld', 448, 'cksRucI_oxcC', 'The year is 1914 and Europe, armed with futuristic machines and biotechnology, is on the precipice of war. Prince Aleksandar is fleeing for his life, having discovered that his parents have been assassinated and he is now a target for the Clanker Powers, a group determined to take over the globe with their mechanical machinery. When he meets Deryn Sharpe, an orphan girl who has disguised herself as a boy so she can to join the British Air Service, they form an uneasy, but necessary, alliance. But the pair will soon discover that their emerging friendship will dramatically change their lives - and the entire course of the Great World War...', 'http://books.google.com/books/content?id=cksRucI_oxcC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 12:54:44', '2017-04-15 12:54:44'),
	(6, 'Scarlet', 'Marissa Meyer', 452, 'lriq2m4d2VsC', 'The #1 New York Times Bestselling Series! Cinder, the cyborg mechanic, returns in the second thrilling installment of Marissa Meyer\'s bestselling Lunar Chronicles. She\'s trying to break out of prison--even though if she succeeds, she\'ll be the Commonwealth\'s most wanted fugitive. Halfway around the world, Scarlet Benoit\'s grandmother is missing. It turns out there are many things Scarlet doesn\'t know about her grandmother or the grave danger she has lived in her whole life. When Scarlet encounters Wolf, a street fighter who may have information as to her grandmother\'s whereabouts, she is loath to trust this stranger, but is inexplicably drawn to him, and he to her. As Scarlet and Wolf unravel one mystery, they encounter another when they meet Cinder. Now, all of them must stay one step ahead of the vicious Lunar Queen Levana, who will do anything for the handsome Prince Kai to become her husband, her king, her prisoner. An NPR Best Book of 2013', 'http://books.google.com/books/content?id=lriq2m4d2VsC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 13:02:09', '2016-06-02 14:41:55'),
	(7, 'I am Number Four', 'Pittacus Lore', 416, 'DnEtjgEACAAJ', 'The perfect companion book to the #1 New York Times bestselling I Am Number Four series! I Am Number Four: The Lost Files: Zero Hour is the fifth collection of novellas from Pittacus Lore. Originally published separately, they are now together in one print volume for the first time ever. Lost Files #13: Legacies Reborn gives a look at the Mogadorian invasion from the perspective of Daniela Morales, a human teen who’s shocked to discover aliens are attacking New York—and that she suddenly has the power to fight back. Lost Files #14: Last Defense reveals what happens to Malcolm Goode after the warships descend. To get to the president’s secret bunker near Washington DC, he’ll have to fight his way through a war zone. Lost Files #15: Hunt for the Garde picks up after the events of The Fate of Ten, following the stories of three different Mogadorians. One will do anything for redemption. One has a thirst for blood. One questions everything. You know about the invasion of Earth, and the Garde who will do anything to stop it. Yet there is still so much to learn. The stories in Zero Hour will help you get the answers you seek, but only the Garde and their allies can save our planet.', 'http://books.google.com/books/content?id=DnEtjgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '2017-04-15 12:54:45', '2017-04-15 12:54:45'),
	(8, 'Gathering Blue', 'Lois Lowry', 224, 'Dz57fISoA0AC', 'Lois Lowry once again creates a mysterious but plausible future world. It is a society ruled by savagery and deceit that shuns and discards the weak. Left orphaned and physically flawed, young Kira faces a frightening, uncertain future. Blessed with an almost magical talent that keeps her alive, she struggles with ever broadening responsibilities in her quest for truth, discovering things that will change her life forever. As she did in THE GIVER, Lowry challenges readers to imagine what our world could become, how people could evolve, and what could be considered valuable. Every reader will be taken by Kira’s plight and will long ponder her haunting world and the hope for the future. This ebook includes a sample chapter of MESSENGER.', 'http://books.google.com/books/content?id=Dz57fISoA0AC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 12:54:46', '2017-04-15 12:54:46'),
	(9, 'Pretty Little Liars', 'Sara Shepard', 286, NULL, NULL, NULL, '2016-06-12 11:18:38', '2016-06-12 11:18:38'),
	(10, 'The Curious Incident of the Dog in the Night-time', 'Mark Haddon', 240, 'Thc32eB1Kx4C', 'Narrated by a fifteen-year-old autistic savant obsessed with Sherlock Holmes, this dazzling novel weaves together an old-fashioned mystery, a contemporary coming-of-age story, and a fascinating excursion into a mind incapable of processing emotions. Christopher John Francis Boone knows all the countries of the world and their capitals and every prime number up to 7,057. Although gifted with a superbly logical brain, Christopher is autistic. Everyday interactions and admonishments have little meaning for him. At fifteen, Christopher’s carefully constructed world falls apart when he finds his neighbour’s dog Wellington impaled on a garden fork, and he is initially blamed for the killing. Christopher decides that he will track down the real killer, and turns to his favourite fictional character, the impeccably logical Sherlock Holmes, for inspiration. But the investigation leads him down some unexpected paths and ultimately brings him face to face with the dissolution of his parents’ marriage. As Christopher tries to deal with the crisis within his own family, the narrative draws readers into the workings of Christopher’s mind. And herein lies the key to the brilliance of Mark Haddon’s choice of narrator: The most wrenching of emotional moments are chronicled by a boy who cannot fathom emotions. The effect is dazzling, making for one of the freshest debut in years: a comedy, a tearjerker, a mystery story, a novel of exceptional literary merit that is great fun to read.', 'http://books.google.com/books/content?id=Thc32eB1Kx4C&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 12:54:47', '2017-04-15 12:54:47'),
	(11, 'Every Day', 'David Levithan', 324, '56CTsaubhjAC', 'In his New York Times bestselling novel, David Levithan introduces readers to what Entertainment Weekly calls a \\\"wise, wildly unique\\\" love story about A, a teen who wakes up every morning in a different body, living a different life. Every day a different body. Every day a different life. Every day in love with the same girl. There’s never any warning about where it will be or who it will be. A has made peace with that, even established guidelines by which to live: Never get too attached. Avoid being noticed. Do not interfere. It’s all fine until the morning that A wakes up in the body of Justin and meets Justin’s girlfriend, Rhiannon. From that moment, the rules by which A has been living no longer apply. Because finally A has found someone he wants to be with—day in, day out, day after day. With his new novel, David Levithan, bestselling co-author of Will Grayson, Will Grayson, and Nick and Norah\'s Infinite Playlist, has pushed himself to new creative heights. He has written a captivating story that will fascinate readers as they begin to comprehend the complexities of life and love in A’s world, as A and Rhiannon seek to discover if you can truly love someone who is destined to change every day.', 'http://books.google.com/books/content?id=56CTsaubhjAC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 13:02:44', '2016-06-12 11:19:26'),
	(12, 'We Were Liars', 'E. Lockheart', 240, '7ZRVAQAAQBAJ', 'A New York Times Bestseller \\\"Haunting, sophisticated . . . a novel so twisty and well-told that it will appeal to older readers as well as to adolescents.\\\"--Wall Street Journal \\\"A rich, stunning summer mystery with a sharp twist that will leave you dying to talk about the book with a pal or ten.\\\"--Parade.com \\\"Thrilling, beautiful, and blisteringly smart, We Were Liars is utterly unforgettable.\\\" - John Green, #1 New York Times bestselling author of The Fault in Our Stars \\\"You’re going to want to remember the title. Liars details the summers of a girl who harbors a dark secret, and delivers a satisfying, but shocking twist ending.\\\" - Breia Brissey, Entertainment Weekly A beautiful and distinguished family. A private island. A brilliant, damaged girl; a passionate, political boy. A group of four friends—the Liars—whose friendship turns destructive. A revolution. An accident. A secret. Lies upon lies. True love. The truth. We Were Liars is a modern, sophisticated suspense novel from New York Times bestselling author, National Book Award finalist, and Printz Award honoree E. Lockhart. Read it. And if anyone asks you how it ends, just LIE. \\\"An ambitious novel with an engaging voice, a clever plot and some terrific writing.\\\"--New York Times Book Review \\\"No one should be talking about the shocking twist ending. What we can talk about is...[Lockhart\'s] razor-sharp portrayal of a family for whom keeping up appearances is paramount and, ultimately, tragic.\\\"--The Chicago Tribune', 'http://books.google.com/books/content?id=7ZRVAQAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 13:04:23', '2016-06-12 11:19:54'),
	(13, 'Me and Earl and the Dying Girl', 'Jesse Andrews', 304, 'A8E1GEKj-_oC', 'The book that inspired the hit film! Sundance U.S. Dramatic Audience Award Sundance Grand Jury Prize This is the funniest book you’ll ever read about death. It is a universally acknowledged truth that high school sucks. But on the first day of his senior year, Greg Gaines thinks he’s figured it out. The answer to the basic existential question: How is it possible to exist in a place that sucks so bad? His strategy: remain at the periphery at all times. Keep an insanely low profile. Make mediocre films with the one person who is even sort of his friend, Earl. This plan works for exactly eight hours. Then Greg’s mom forces him to become friends with a girl who has cancer. This brings about the destruction of Greg’s entire life. Praise for Me and Earl and the Dying Girl STARRED REVIEW “One need only look at the chapter titles (“Let’s Just Get This Embarrassing Chapter Out of the Way”) to know that this is one funny book.” –Booklist, starred review STARRED REVIEW “A frequently hysterical confessional...Debut novelist Andrews succeeds brilliantly in painting a portrait of a kid whose responses to emotional duress are entirely believable and sympathetic, however fiercely he professes his essential crappiness as a human being. Though this novel begs inevitable thematic comparisons to John Green\'s The Fault in Our Stars (2011), it stands on its own in inventiveness, humor and heart.” –Kirkus Reviews, starred review “It is sure to be popular with many boys, including reluctant readers, and will not require much selling on the part of the librarian.” –VOYA \"Mr. Andrews\' often hilarious teen dialogue is utterly convincing, and his characters are compelling. Greg\'s random sense of humor, terrible self-esteem and general lack of self-awareness all ring true. Like many YA authors, Mr. Andrews blends humor and pathos with true skill, but he steers clear of tricky resolutions and overt life lessons, favoring incremental understanding and growth.\" –Pittsburgh Post-Gazette Awards: Capitol Choices 2013 - Noteworthy Titles for Children and Teens Cooperative Children’s Book Center (CCBC) Choices 2013 list - Young Adult Fiction YALSA 2013 Quick Picks for Reluctant Young Adult Readers YALSA 2013 Best Fiction for Young Adults YALSA 2014 Popular Paperbacks for Young Adults', 'http://books.google.com/books/content?id=A8E1GEKj-_oC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 12:54:49', '2017-04-15 12:54:49'),
	(14, 'Serial Killers', 'Brian Innes', 224, '9gSgDgAAQBAJ', 'The Terrifying Story of the Most Monstrous Serial Killers through History. Serial Killers are the most notorious and disturbing of all criminals, representing the very darkest side of humanity. Yet they endlessy fascinate and continue to capture the public\'s attention with their strange charisma and deadly deeds. From Jack the Ripper to Ted Bundy and the Moors Murderers Ian Brady and Myra Hindley, these killers transfix us with their ability to commit utterly savage acts of cruelty and depravity. Only with modern police detection methods and psychological profiling, have these figures that have existed throughout human history finally been identified in the deadliest category: serial killers. These methods, the killers\' characters and their crimes are described here in fascinating and terrifyingly gripping detail. The whole history of serial killers is brought to life in 50 chapters, including: Herman Webster Mudget, Devil in the White City John Christie, 10 Rillington Place murders Zodiac Killer Ian Brady and Myra Hindley, The Moors Murderers Ted Bundy Fred and Rosemary West Jeffrey Dahmer Aileen Wuornos Harold Shipman, Dr Death', 'http://books.google.com/books/content?id=9gSgDgAAQBAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '2017-04-15 13:06:41', '2016-06-12 11:20:35'),
	(15, 'H20', 'Virginia Bergin', 336, 'Q4ZvBAAAQBAJ', '.27 is a number Ruby hates. It\'s a number that marks the percentage of the population that has survived. It\'s a number that means she\'s one of the \\\"lucky\\\" few still standing. And it\'s a number that says her father is probably dead. Against all odds, Ruby has survived the catastrophic onset of the killer rain. Two weeks after the radio started broadcasting the warning, \\\"It\'s in the rain. It\'s fatal and there\'s no cure,\\\" the drinkable water is running out. Ruby\'s left with two options: persevere on her own, or embark on a treacherous journey across the country to find her father-if he\'s even still alive.', 'http://books.google.com/books/content?id=Q4ZvBAAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 13:08:11', '2016-06-12 11:21:05'),
	(16, 'The Old Man and the Sea', 'Ernest Hemingway', 124, 'Qr6vMwEACAAJ', NULL, 'http://books.google.com/books/content?id=Qr6vMwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '2017-04-15 12:54:51', '2017-04-15 12:54:51'),
	(17, 'To All the Boys I\'ve Loved Before', 'Jenny Han', 368, 'z-VfDeuhq6kC', 'Lara Jean’s love life gets complicated in this New York Times bestselling “lovely, lighthearted romance” (SLJ) from the New York Times bestselling author of The Summer I Turned Pretty series. What if all the crushes you ever had found out how you felt about them…all at once? Sixteen-year-old Lara Jean Song keeps her love letters in a hatbox her mother gave her. They aren’t love letters that anyone else wrote for her; these are ones she’s written. One for every boy she’s ever loved—five in all. When she writes, she pours out her heart and soul and says all the things she would never say in real life, because her letters are for her eyes only. Until the day her secret letters are mailed, and suddenly, Lara Jean’s love life goes from imaginary to out of control.', 'http://books.google.com/books/content?id=z-VfDeuhq6kC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 12:54:52', '2017-04-15 12:54:52'),
	(18, 'P.S. I Still Love You', 'Jenny Han', 352, 'T9T5DQAAQBAJ', 'Sequel to: To all the boys I\'ve loved before.', 'http://books.google.com/books/content?id=T9T5DQAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 12:54:53', '2017-04-15 12:54:53'),
	(19, 'Will Grayson, Will Grayson', 'John Green, David Levithan', 336, 'Kbla_WzMiZ4C', 'Two award-winning and New York Times–bestselling author join forces for a collaborative novel of awesome proportions. One cold night, in a most unlikely corner of Chicago, two teens—both named Will Grayson—are about to cross paths. As their worlds collide and intertwine, the Will Graysons find their lives going in new and unexpected directions, building toward romantic turns-of-heart and the epic production of history’s most fabulous high school musical. Hilarious, poignant, and deeply insightful, John Green and David Levithan’s collaborative novel is brimming with a double helping of the heart and humor that have won them both legions of faithful fans. A New York Times Book Review Editor’s Choice An ALA Stonewall Honor Book “Will Grayson, Will Grayson is a complete romp. [It is] so funny, rude and original that by the time flowers hit the stage, even the musical-averse will cheer.” —The New York Times Book Review “Will have readers simultaneously laughing, crying and singing at the top of their lungs.”—Kirkus Reviews, starred review “It is such a good book. [Green and Levithan] are two of the best writers writing today.” —NPR’sThe Roundtable From the Hardcover edition.', 'http://books.google.com/books/content?id=Kbla_WzMiZ4C&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 13:09:20', '2016-06-12 11:25:46'),
	(20, 'Bringing Down the House', 'Ben Mezrich', 273, 'CYwslODoc2cC', 'Recounts the story of how a notorious gang of MIT blackjack savants devised and received backing for a system for winning at the world\'s most sophisticated casinos, an endeavor that earned them more than three million dollars. Originally published as Bringing Down the House. Reissue. (A Columbia Pictures film, written by Peter Steinfeld & Allan Loeb, directed by Robert Luketic, releasing March 2008, starring Kevin Spacey, Kate Bosworth, Laurence Fishburne, Jim Sturgess, & others) (Current Affairs)', 'http://books.google.com/books/content?id=CYwslODoc2cC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 13:11:01', '2016-06-12 11:26:08'),
	(21, 'Elsewhere', 'Gabrielle Zevin', 288, 'Not9voFYfh4C', 'Is it possible to grow up while getting younger? Welcome to Elsewhere. It is warm, with a breeze, and the beaches are marvelous. It\'s quiet and peaceful. You can\'t get sick or any older. Curious to see new paintings by Picasso? Swing by one of Elsewhere\'s museums. Need to talk to someone about your problems? Stop by Marilyn Monroe\'s psychiatric practice. Elsewhere is where fifteen-year-old Liz Hall ends up, after she has died. It is a place so like Earth, yet completely different. Here Liz will age backward from the day of her death until she becomes a baby again and returns to Earth. But Liz wants to turn sixteen, not fourteen again. She wants to get her driver\'s license. She wants to graduate from high school and go to college. And now that she\'s dead, Liz is being forced to live a life she doesn\'t want with a grandmother she has only just met. And it is not going well. How can Liz let go of the only life she has ever known and embrace a new one? Is it possible that a life lived in reverse is no different from a life lived forward? This moving, often funny book about grief, death, and loss will stay with the reader long after the last page is turned. Elsewhere is a 2006 Bank Street - Best Children\'s Book of the Year.', 'http://books.google.com/books/content?id=Not9voFYfh4C&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 12:54:55', '2017-04-15 12:54:55'),
	(22, 'The Summer I turned Pretty', 'Jenny Han', 304, 'u2Opn0bJGbwC', 'Belly’s never been the kind of girl that things happen to. Year after year, she’s spent her summers at the beach house with Conrad and Jeremiah. The boys never noticed Belly noticing them. And every summer she hoped it would be different. This time, it was. But the summer Belly turned pretty was the summer that changed everything. For better, and for worse.', 'http://books.google.com/books/content?id=u2Opn0bJGbwC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 13:11:52', '2016-06-12 11:27:35'),
	(23, 'It\'s Not Summer Without You', 'Jenny Han', 304, 'THqGpKpcgxYC', 'In Jenny Han\'s follow-up to The Summer I Turned Pretty, Belly finds out what comes after falling in love. Now available in paperback!', 'http://books.google.com/books/content?id=THqGpKpcgxYC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 12:54:57', '2017-04-15 12:54:57'),
	(24, 'We\'ll Always Have Summer', 'Jenny Han', 291, 'N2hUAgWfB04C', 'The summer after her first year of college, Isobel \"Belly\" Conklin is faced with a choice between Jeremiah and Conrad Fisher, brothers she has always loved, when Jeremiah proposes marriage and Conrad confesses that he still loves her.', 'http://books.google.com/books/content?id=N2hUAgWfB04C&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 12:54:57', '2017-04-15 12:54:57'),
	(25, 'Diary of a Wimpy Kid', 'Jeff Kinney', 224, 'KFkHhZVLiCgC', 'Greg Heffley is not willing to be the odd man out. A dance at Greg\'s middle school has everyone scrambling to find a partner, and Greg is determined not to be left by the wayside. So he concocts a desperate plan to find someone—anyone!—to go with on the big night. But Greg\'s schemes go hilariously awry, and his only option is to attend the dance with his best friend, Rowley Jefferson, and a female classmate as a \\\"group of friends.\\\" But the night is long, and anything can happen along the way. Who will arrive at the dance triumphantly, and who will end up being the third wheel?', 'http://books.google.com/books/content?id=KFkHhZVLiCgC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 13:12:55', '2016-06-12 11:29:10'),
	(26, 'Freakonomics', 'Sthepen Dubner Stephen Dubner', 304, 'IzGSAgAAQBAJ', 'Steven Levitt and Stephen Dubner single-handedly showed the world that applying counter-intuitive approaches to everyday problems can bear surprising results. Think Like a Freak will take readers further inside this special thought process, revealing a new way of approaching the decisions we make, the plans we create and the morals we choose. It answers the question on the lips of everyone who’s read the previous books: How can I apply these ideas to my life? How do I make smarter, harder and better decisions? How can I truly think like a freak? With short, highly entertaining insights running the gamut from “The Upside of Quitting” to “How to Succeed with No Talent,” Think Like a Freak is poised to radically alter the way we think about all aspects of life on this planet.', 'http://books.google.com/books/content?id=IzGSAgAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 13:16:21', '2016-06-12 11:29:37'),
	(27, 'Peak', 'Roland Smith', 246, 'v5qxB2zDcXkC', 'The only thing you’ll find on the summit of Mount Everest is a divine view. The things that really matter lie far below. – Peak Marcello After fourteen-year-old Peak Marcello is arrested for scaling a New York City skyscraper, he\'s left with two choices: wither away in Juvenile Detention or go live with his long-lost father, who runs a climbing company in Thailand. But Peak quickly learns that his father\'s renewed interest in him has strings attached. Big strings. As owner of Peak Expeditions, he wants his son to be the youngest person to reach the Everest summit--and his motives are selfish at best. Even so, for a climbing addict like Peak, tackling Everest is the challenge of a lifetime. But it\'s also one that could cost him his life. Roland Smith has created an action-packed adventure about friendship, sacrifice, family, and the drive to take on Everest, despite the incredible risk. The story of Peak’s dangerous ascent—told in his own words—is suspenseful, immediate, and impossible to put down.', 'http://books.google.com/books/content?id=v5qxB2zDcXkC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 13:18:27', '2016-06-12 11:29:52'),
	(28, 'Eye of Minds', 'James Dashner', 320, 'DoCQOC9VEAEC', 'From James Dashner, the author of the New York Times bestselling Maze Runner series, comes an edge-of-your seat adventure. The Eye of Minds is the first book in The Mortality Doctrine, a series set in a world of hyperadvanced technology, cyberterrorists, and gaming beyond your wildest dreams . . . and your worst nightmares. To catch a hacker, you need a hacker. For Michael and the other gamers, the VirtNet can make your wildest fantasies become real. And the more hacking skills you have, the more fun. Who wants to play by the rules anyway? But some rules were made for a reason. One gamer has been taking people hostage inside the VirtNet with horrific consequences. The government needs Michael to track down the rogue gamer, but the risk is enormous and the line between game and reality could be blurred forever . . .', 'http://books.google.com/books/content?id=DoCQOC9VEAEC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '2017-04-15 12:55:00', '2017-04-15 12:55:00'),
	(29, 'Ready for RICA', 'James Zarrilo', 192, 'FdF5CwAAQBAJ', 'Test-taking strategies and content area reviews for successfully passing California’s Reading Instruction Competence Assessment (RICA). Thousands of students have used previous editions of James J. Zarrillo’s Ready for RICA to successfully prepare for the RICA. Now the new edition continues to provide test-taking strategies and helpful reviews of all 15 content areas and includes five significant new components: 1) Learning Outcomes in each chapter help readers focus on what they should accomplish by studying that chapter; 2) Chapter Summaries offer Test Taking Tips that re-state essential information and highlight key instructional strategies; 3) a new chapter, Ten Days to RICA, guides readers in what they should study during the last 10 days before they take the test; 4) 13 videos of the author offer insight on the most important information and instructional strategies; and 5) a new Glossary includes a dictionary of 210 reading-related words and phrases. This is the essential guide for all California Multiple Teaching Credential candidates required to take the RICA.', 'http://books.google.com/books/content?id=FdF5CwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 13:19:39', '2016-06-12 11:30:51'),
	(30, 'The Rule of Thoughts', 'James Dashner', 352, 'rvIHDAAAQBAJ', 'From James Dashner, author of the #1 New York Times bestselling Maze Runner series, comes the paperback of The Rule of Thoughts, the second book in the Mortality Doctrine series and the exciting companion toThe Eye of Minds and The Game of Lives. Look for The Maze Runner movie in stores now! And get ready for the movie adaptation of book two in the bestselling series,The Scorch Trials, which will hit theaters on September 18, 2015! Michael completed the Path, and the truth he discovered about Kaine is more complex—and more terrifying—than anyone at VirtNet Security could have anticipated. Kaine is a Tangent, a computer program that has become sentient. And Michael\'s completing the Path was the first stage in turning Kaine\'s master plan, the Mortality Doctrine, into a reality. The Mortality Doctrine will populate Earth entirely with human bodies harboring Tangent minds. Any gamer who sinks into the VirtNet risks coming out with a Tangent intelligence in control of their body. The VNS would rather pretend the world is perfectly safe, but Michael and his friends know that the takeover has already begun. And if they don\'t stop Kaine soon, it will be game over for humanity. Praise for the Mortality Doctrine series “An exhilarating adventure story with touches of Anthony Horowitz\'s Alex Rider books and Orson Scott Card\'sEnder\'s Game.” —Booklist “An adrenaline rush.” —School Library Journal “A gripping page-turner, Dashner\'s latest is sure to please.” —BookPage “Full of action [and] a rather surprising twist that will leave you flipping pages.” —FanBoyNation.com “High on concept, this is an intriguing read for the digital generation.” —Kirkus Reviews A Junior Library Guild Selection A YALSA Teen Top Ten Pick', 'http://books.google.com/books/content?id=rvIHDAAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 13:20:30', '2016-06-12 11:31:08'),
	(31, 'Carry On', 'Rainbow Rowell', 384, 'O0eNBwAAQBAJ', '#1 New York Times bestselling author! Booklist Editors’ Choice 2015 - Youth! Named a \\\"Best Book of 2015\\\" by Time Magazine, School Library Journal, Barnes & Noble, NPR, PopSugar, The Millions, and The News & Observer! Simon Snow is the worst Chosen One who\'s ever been chosen. That\'s what his roommate, Baz, says. And Baz might be evil and a vampire and a complete git, but he\'s probably right. Half the time, Simon can\'t even make his wand work, and the other half, he starts something on fire. His mentor\'s avoiding him, his girlfriend broke up with him, and there\'s a magic-eating monster running around, wearing Simon\'s face. Baz would be having a field day with all this, if he were here -- it\'s their last year at the Watford School of Magicks, and Simon\'s infuriating nemesis didn\'t even bother to show up. Carry On - The Rise and Fall of Simon Snow is a ghost story, a love story and a mystery. It has just as much kissing and talking as you\'d expect from a Rainbow Rowell story - but far, far more monsters.', 'http://books.google.com/books/content?id=O0eNBwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 13:22:20', '2016-06-14 08:20:12'),
	(32, 'This is Where it Ends', 'Marieke Nijkamp', 288, 'DKH4CQAAQBAJ', 'The #1 New York Times Bestseller! Everyone has a reason to fear the boy with the gun. 10:00 a.m. The principal of Opportunity, Alabama\'s high school finishes her speech, welcoming the entire student body to a new semester and encouraging them to excel and achieve. 10:02 a.m. The students get up to leave the auditorium for their next class. 10:03 The auditorium doors won\'t open. 10:05 Someone starts shooting. Told from four perspectives over the span of 54 harrowing minutes, terror reigns as one student\'s calculated revenge turns into the ultimate game of survival. A Buzzfeed Best YA of 2016 #1 Young Adult Debut of 2016 A Publishers Weekly Bestseller Winter \'15 Kids Indie Next List Goodreads YA Best Books of the Month Buzzfeed 5 YA Books You Should Be Reading This January Bustle.com 18 of 2016\'s Most-Anticipated YA Novels BookRiot 15 Books out in 2016 You Should Mark Down Now A Goodreads Choice Award Finalist for Young Adult Fiction', 'http://books.google.com/books/content?id=DKH4CQAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 12:55:03', '2017-04-15 12:55:03'),
	(33, 'Soccer IQ', 'Dan Blank', 122, 'hKF3oAEACAAJ', 'Dan Blank offers a treasure chest of useful tips to make you a smarter soccer player.', 'http://books.google.com/books/content?id=hKF3oAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '2017-04-15 12:55:04', '2017-04-15 12:55:04'),
	(34, 'By the Great Horn Spoon', 'Sid Fleischman', 224, 'bteVpF9oeMYC', 'In this rollicking adventure set during the California Gold Rush, Jack\'s aunt is forced to sell her beloved mansion to meet her debts. She is still unable to raise enough money to pay her creditors, and twelve-year-old Jack goes to California in search of gold to help her. Joined by his trusty butler, Praiseworthy, Jack finds adventure and trouble at every turn. Will Jack strike gold in San Francisco or come home empty-handed? This new edition features illustrations by Brett Helquist.', 'http://books.google.com/books/content?id=bteVpF9oeMYC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '2017-04-15 13:34:49', '2016-06-28 13:17:02'),
	(35, 'Power of Six', 'Pittacus Lore', 448, 'JAseBBv3tUwC', 'The second book of the #1 New York Times bestselling I Am Number Four series! In the beginning, nine aliens left their home planet Lorien when it fell under attack by the evil Mogadorians. They scattered on Earth and went into hiding. They look like ordinary teenagers but have extraordinary powers. The Mogs have come for them. They killed Number One in Malaysia, Number Two in England, and Number Three in Kenya. They tried to get John Smith, Number Four, in Ohio—but they failed. Now John has joined forces with Number Six, and they are on the run. But they are not alone. Already John and Six have inspired Marina, Number Seven, who has been hiding in Spain. She’s been following the news of what’s happening, and she’s certain this is the sign she’s been waiting for. It’s time to come together. Michael Bay, director of Transformers, raved: “Number Four is a hero for this generation.” This epic story is perfect for fans of action-packed science fiction like The Fifth Wave series by Rick Yancey, The Maze Runner series by James Dashner, and Orson Scott Card’s Ender’s Game. The battle for Earth’s survival wages on. Don’t miss the rest of the series: #3: The Rise of Nine, #4: The Fall of Five, #5: The Revenge of Seven, #6: The Fate of Ten, and #7: United as One. Don’t miss the first book in the brand-new I Am Number Four spin-off series: Generation One.', 'http://books.google.com/books/content?id=JAseBBv3tUwC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 13:35:47', '2016-06-28 13:32:09'),
	(36, 'Hunger Games', 'Suzanne Collins', 384, 'emNF_wqvNSwC', 'The New York Times bestselling The Hunger Games, with an all-new cover from the major motion picture! The astonishing bestseller is now a fantastic movie. Here is the original novel with new movie artwork on the cover. (Original cover version also available.) In the ruins of a place once known as North America lies the nation of Panem, a shining Capitol surrounded by twelve outlying districts. The Capitol is harsh and cruel and keeps the districts in line by forcing them all to send one boy and one girl between the ages of twelve and eighteen to participate in the annual Hunger Games, a fight to the death on live TV. Sixteen-year-old Katniss Everdeen, who lives alone with her mother and younger sister, regards it as a death sentence when she is forced to represent her district in the Games. But Katniss has been close to dead and survival, for her, is second nature. Without really meaning to, she becomes a contender. But if she is to win, she will have to start making choices that weigh survival against humanity and life against love.', 'http://books.google.com/books/content?id=emNF_wqvNSwC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '2017-04-15 12:55:06', '2017-04-15 12:55:06'),
	(37, 'Unwholly', 'Neal Shusterman', 402, 'fs8anKyN_3AC', 'The long-awaited sequel to the best-selling futuristic thriller Unwind finds Connor, Lev, Risa and Cam\'s fates inextricably bound as the morality of the practice of \"unwinding\" is finally called into question.', 'http://books.google.com/books/content?id=fs8anKyN_3AC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 12:55:06', '2017-04-15 12:55:06'),
	(38, 'City of Bones', 'Cassandra Clare', 544, 'UwH5IwTWH3EC', 'Discover this first installment of the internationally bestselling Mortal Instruments series and “prepare to be hooked” (Entertainment Weekly). When fifteen-year-old Clary Fray heads out to the Pandemonium Club in New York City, she hardly expects to witness a murder -- much less a murder committed by three teenagers covered with strange tattoos and brandishing bizarre weapons. Then the body disappears into thin air. It\'s hard to call the police when the murderers are invisible to everyone else and when there is nothing -- not even a smear of blood -- to show that a boy has died. Or was he a boy? This is Clary\'s first meeting with the Shadowhunters, warriors dedicated to ridding the earth of demons. It\'s also her first encounter with Jace, a Shadowhunter who looks a little like an angel and acts a lot like a jerk. Within twenty-four hours Clary is pulled into Jace\'s world with a vengeance, when her mother disappears and Clary herself is attacked by a demon. But why would demons be interested in ordinary mundanes like Clary and her mother? And how did Clary suddenly get the Sight? The Shadowhunters would like to know... Exotic and gritty, exhilarating and utterly gripping, Cassandra Clare\'s ferociously entertaining fantasy takes readers on a wild ride that they will never want to end.', 'http://books.google.com/books/content?id=UwH5IwTWH3EC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 13:36:37', '2016-06-28 13:35:52'),
	(39, 'Unwind', 'Neal Shusterman', 352, 'W1PXSW4R2xsC', 'In a future world where those between the ages of thirteen and eighteen can have their lives \"unwound\" and their body parts harvested for use by others, three teens go to extreme lengths to survive until they turn eighteen.', 'http://books.google.com/books/content?id=W1PXSW4R2xsC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 12:55:07', '2017-04-15 12:55:07'),
	(40, 'Pretties (Uglies #2)', 'Scott Westerfeld', 368, 'nzDSlAEACAAJ', 'A few years after rebel Tally Youngblood took down the uglies/pretties/specials regime, a cultural renaissance swept the world. Now popularity rules. Everyone craves fame—and fifteen-year-old Aya Fuse is no exception. But her face rank of 451,396 is so low, she’s a total nobody. An extra. Aya’s only chance to escape extra-land is to find a big story to kick—something wild and unexpected. Then Aya meets a clique of girls who pull crazy tricks. She knows she can propel herself into celebrity; but at what cost? There’s more at stake than Aya realizes in this spectacular conclusion to the Uglies series.', 'http://books.google.com/books/content?id=nzDSlAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '2017-04-15 12:55:08', '2017-04-15 12:55:08'),
	(41, 'City of Ashes (Mortal Instruments #2)', 'Cassandra Clare', 464, 'mwgpeq5PSgQC', 'Is love worth betraying everything? Plunge into the second adventure in the internationally bestselling Mortal Instruments series and “prepare to be hooked” (Entertainment Weekly). Clary Fray just wishes that her life would go back to normal. But what\'s normal when you\'re a demon-slaying Shadowhunter, your mother is in a magically induced coma, and you can suddenly see Downworlders like werewolves, vampires, and faeries? If Clary left the world of the Shadowhunters behind, it would mean more time with her best friend, Simon, who\'s becoming more than a friend. But the Shadowhunting world isn\'t ready to let her go -- especially her handsome, infuriating, newfound brother, Jace. And Clary\'s only chance to help her mother is to track down rogue Shadowhunter Valentine, who is probably insane, certainly evil—and also her father. To complicate matters, someone in New York City is murdering Downworlder children. Is Valentine behind the killings—and if he is, what is he trying to do? When the second of the Mortal Instruments, the Soul-Sword, is stolen, the terrifying Inquisitor arrives to investigate and zooms right in on Jace. How can Clary stop Valentine if Jace is willing to betray everything he believes in to help their father? In this breathtaking sequel to City of Bones, Cassandra Clare lures her readers back into the dark grip of New York City\'s Downworld, where love is never safe and power becomes the deadliest temptation.', 'http://books.google.com/books/content?id=mwgpeq5PSgQC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api', '2017-04-15 13:40:22', '2016-06-28 13:41:09'),
	(42, 'Maze Runner', 'James Dashner', 375, '6gfDfhmmHxMC', 'The first book in the blockbuster phenomenon The Maze Runner series now features chapters from the highly-anticipated series conclusion, The Fever Code, the book that finally reveals the story of how the maze was built! When Thomas wakes up in the lift, the only thing he can remember is his name. He’s surrounded by strangers—boys whose memories are also gone. Outside the towering stone walls that surround them is a limitless, ever-changing maze. It’s the only way out—and no one’s ever made it through alive. Then a girl arrives. The first girl ever. And the message she delivers is terrifying. Remember. Survive. Run. The Maze Runner and Maze Runner: The Scorch Trials are now major motion pictures featuring the star of MTV\'s Teen Wolf, Dylan O’Brien; Kaya Scodelario; Aml Ameen; Will Poulter; and Thomas Brodie-Sangster. The third movie, Maze Runner: The Death Cure, will hit screens in 2018. Also look for James Dashner’s edge-of-your-seat MORTALITY DOCTRINE series! Praise for the Maze Runner series: A #1 New York Times Bestselling Series A USA Today Bestseller A Kirkus Reviews Best Teen Book of the Year An ALA-YASLA Best Fiction for Young Adults Book An ALA-YALSA Quick Pick \\\"[A] mysterious survival saga that passionate fans describe as a fusion of Lord of the Flies, The Hunger Games, and Lost.\\\"—EW.com “Wonderful action writing—fast-paced…but smart and well observed.”—Newsday “[A] nail-biting must-read.”—Seventeen.com “Breathless, cinematic action.”—Publishers Weekly “Heart pounding to the very last moment.”—Kirkus Reviews “Exclamation-worthy.”—Romantic Times “James Dashner’s illuminating prequel [The Kill Order] will thrill fans of this Maze Runner [series] and prove just as exciting for readers new to the series.”—Shelf Awareness, Starred \\\"Take a deep breath before you start any James Dashner book.\\\"-Deseret News', 'http://books.google.com/books/content?id=6gfDfhmmHxMC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 13:43:00', '2016-06-28 13:41:59'),
	(43, 'Poetry U.S.A', 'Paul Molloy', 159, '2M3EFsqKDwkC', NULL, NULL, '2017-04-15 13:44:49', '2016-06-28 13:43:49'),
	(44, 'Screw and Run', 'Unknown', 402, NULL, NULL, NULL, '2016-06-28 13:44:31', '2016-06-28 13:44:31'),
	(45, 'Ms. Skybalts Home for Boys', 'Unknown', 152, NULL, NULL, NULL, '2016-06-28 13:45:40', '2016-06-28 13:45:40'),
	(46, 'The Amazing Book is not on Fire', 'Dan Howell, Phil Lester', 225, 'EhgmDAAAQBAJ', 'YouTube stars Dan Howell and Phil Lester tell the humorous story of growing up, becoming YouTube stars, and give advice to their teen followers.', 'http://books.google.com/books/content?id=EhgmDAAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 13:48:19', '2016-06-28 13:46:56'),
	(47, 'Doctor Who Character Encyclopedia', 'Jason Loborik, Annabel Gibson, Moray Laing', 208, 'JnrPMgEACAAJ', 'Meet all the most important characters from the entire history of Doctor Who, including every Doctor and companion. Packed with fascinating facts and statistics for characters from the Abzorbaloff to the Zygons, and with large cut-out poses and stunning stills from the program, this is the ultimate compendium of Doctor Who characters.', 'http://books.google.com/books/content?id=JnrPMgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '2017-04-15 13:50:44', '2016-06-28 13:47:46'),
	(48, 'Twist and Shout', 'Unknown', 163, NULL, NULL, NULL, '2016-06-28 13:48:40', '2016-06-28 13:48:40'),
	(49, 'Looking For Alaska', 'John Green', 200, 'OAb-4f8tBvUC', '\"Cansado de su aburrida existencia, Miles, de 16 a?nos, se muda a un colegio internado para ir en busca de lo que el poeta Rabelais llam?o \'Gran quiz?a.\' Ah?i su reci?en descubierta libertad y una enigm?atica chica, Alaska, lo lanzan de lleno a la vida. Cuando Miles siente que est?a por alcanzar su objectivo, una tragedia inesperada amenaza con arrebat?arselo\"--Cover.', 'http://books.google.com/books/content?id=OAb-4f8tBvUC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 12:55:14', '2017-04-15 12:55:14'),
	(50, 'Fun Home', 'Allison Bechdel', 232, 'eq0n9Ck79ysC', 'A memoir done in the form of a graphic novel by a cult favorite comic artist offers a darkly funny family portrait that details her relationship with her father--a funeral home director, high school English teacher, and closeted homosexual.', 'http://books.google.com/books/content?id=eq0n9Ck79ysC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 13:55:20', '2016-07-04 15:12:57'),
	(51, 'Where You\'ll Find Me', 'Natasha Friend', 272, '4dBfCgAAQBAJ', 'The first month of school, thirteen-year-old Anna Collette finds herself... DUMPED by her best friend Dani, who suddenly wants to spend eighth grade \"hanging out with different people.\" DESERTED by her mom, who\'s in the hospital recovering from a suicide attempt. TRAPPED in a house with her dad, a new baby sister, and a stepmother young enough to wear her Delta Delta Delta sweatshirt with pride. STUCK at a lunch table with Shawna the Eyebrow Plucker and Sarabeth the Irish Stepper because she has no one else to sit with. But what if all isn\'t lost? What if Anna\'s mom didn\'t exactly mean to leave her? What if Anna\'s stepmother is cooler than she thought? What if the misfit lunch table isn\'t such a bad fit after all? With help from some unlikely sources, including a crazy girl-band talent show act, Anna just may find herself on the road to okay.', 'http://books.google.com/books/content?id=4dBfCgAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 13:55:37', '2017-04-15 13:55:37'),
	(52, 'Booked', 'Kwame Alexander', 315, NULL, NULL, NULL, '2016-07-13 11:40:20', '2016-07-13 11:40:20'),
	(53, 'Counting by 7s', 'Holly Goldberg Sloan', 380, 'd2_foAEACAAJ', 'In the tradition of WONDER and TO KILL A MOCKINGBIRD this award-winning New York Times bestseller is an intensely moving, lyrically-written novel. COUNTING BY 7S tells the story of Willow Chance, a twelve-year-old genius who is obsessed with diagnosing medical conditions and finds comfort in counting by 7s. It has never been easy for her to connect with anyone other than her adoptive parents, but that hasn\'t kept her from leading a quietly happy life . . . until now. Suddenly Willow\'s world is tragically changed when her parents both die in a car crash, leaving her alone in a baffling world. Her journey to find a fascinatingly diverse and fully believable surrogate family is a joy and a revelation to read.', 'http://books.google.com/books/content?id=GuOQCgAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 14:00:29', '2016-07-13 12:01:55'),
	(54, 'True Letters From a Fictional Life', 'Kenneth Logan', 336, 'nM6LCgAAQBAJ', 'If you asked anyone in his small Vermont town, they’d tell you the facts: James Liddell, star athlete, decent student, and sort-of boyfriend to cute, peppy Theresa, is a happy, funny, carefree guy. But whenever James sits down at his desk to write, he tells a different story. As he fills his drawers with letters to the people in his world—letters he never intends to send—he spills the truth: he’s trying hard, but he just isn’t into Theresa. It’s his friend, a boy, who lingers in his thoughts. James’s secret letters are his safe space—but his truth can’t stay hidden for long. Will he come clean to his parents, his teammates, and himself, or is he destined to live a life of fiction? This heartfelt debut novel explores the muddy landscape of truth and lies and lays bare the sometimes painful but often hopeful work of writing one’s own authentic story.', 'http://books.google.com/books/content?id=nM6LCgAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 13:55:39', '2017-04-15 13:55:39'),
	(55, 'The Realm of Possibility', 'David Levithan', 224, 'qwMLPSnf3HMC', 'This collection of linked poems from David Levithan, the author of the New York Times bestseller Every Day and the groundbreaking classic Boy Meets Boy and the co-author of Will Grayson, Will Grayson (with John Green), will introduce you to a world of unforgettable and emotionally resonant voices. Here’s what I know about the realm of possibility— it is always expanding, it is never what you think it is. Everything around us was once deemed impossible. From the airplane overhead to the phones in our pockets to the choir girl putting her arm around the metalhead. As hard as it is for us to see sometimes, we all exist within the realm of possibility. Most of the limits are of our own world’s devising. And yet, every day we each do so many things that were once impossible to us. Enter The Realm of Possibility and meet a boy whose girlfriend is in love with Holden Caulfield; a girl who loves the boy who wears all black; a boy with the perfect body; and a girl who writes love songs for a girl she can’t have. These are just a few of the captivating characters readers will get to know in this intensely heartfelt new novel about those ever-changing moments of love and heartbreak that go hand-in-hand with high school. David Levithan plumbs the depths of teenage emotion to create an amazing array of voices that readers won’t forget. So, enter their lives and prepare to welcome the realm of possibility open to us all. Love, joy, and these stories will linger. A MARGARET A. EDWARDS AWARD WINNER AN ALA TOP TEN BEST BOOK FOR YOUNG ADULTS A NEW YORK PUBLIC LIBRARY BOOK FOR THE TEEN AGE “Luminous . . . each voice sings with hope, humor and possibility.” —Time Out New York Kids From the Hardcover edition.', 'http://books.google.com/books/content?id=qwMLPSnf3HMC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 13:55:41', '2017-04-15 13:55:41'),
	(56, 'Shatter Me', 'Tahereh Mafi', 338, 'qMLlo-IIxHoC', '\\\"You can\'t touch me,\\\" I whisper. I\'m lying, is what I don\'t tell him. He can touch me, is what I\'ll never tell him. But things happen when people touch me. Strange things. Bad things. No one knows why Juliette\'s touch is fatal, but The Reestablishment has plans for her. Plans to use her as a weapon. But Juliette has plans of her own. After a lifetime without freedom, she\'s finally discovering a strength to fight back for the very first time—and to find a future with the one boy she thought she\'d lost forever. This enhanced edition contains the full text of the novel, plus this exclusive content: Juliette’s police case file Juliette’s medical file Reestablishment “persons of interest” profiles An entry from Warner’s log Reestablishment propaganda posters', 'http://books.google.com/books/content?id=qMLlo-IIxHoC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 14:01:27', '2016-08-08 08:52:34'),
	(57, 'Dorothy Must Die', 'Danielle Paige', 480, 'pLlCAgAAQBAJ', 'The New York Times bestselling first book in a dark new series that reimagines the Oz saga, from debut author Danielle Paige. I didn\'t ask for any of this. I didn\'t ask to be some kind of hero. But when your whole life gets swept up by a tornado—taking you with it—you have no choice but to go along, you know? Sure, I\'ve read the books. I\'ve seen the movies. I know the song about the rainbow and the happy little blue birds. But I never expected Oz to look like this. To be a place where Good Witches can\'t be trusted, Wicked Witches may just be the good guys, and winged monkeys can be executed for acts of rebellion. There\'s still a road of yellow brick—but even that\'s crumbling. What happened? Dorothy. They say she found a way to come back to Oz. They say she seized power and the power went to her head. And now no one is safe. My name is Amy Gumm—and I\'m the other girl from Kansas. I\'ve been recruited by the Revolutionary Order of the Wicked. I\'ve been trained to fight. And I have a mission: Remove the Tin Woodman\'s heart. Steal the Scarecrow\'s brain. Take the Lion\'s courage. And—Dorothy must die.', 'http://books.google.com/books/content?id=pLlCAgAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 14:02:18', '2016-08-08 08:54:58'),
	(58, 'More Than This', 'Patrick Ness', 480, 'n-JIAgAAQBAJ', 'From two-time Carnegie Medal winner Patrick Ness comes an enthralling and provocative new novel chronicling the life — or perhaps afterlife — of a teen trapped in a crumbling, abandoned world. A boy named Seth drowns, desperate and alone in his final moments, losing his life as the pounding sea claims him. But then he wakes. He is naked, thirsty, starving. But alive. How is that possible? He remembers dying, his bones breaking, his skull dashed upon the rocks. So how is he here? And where is this place? It looks like the suburban English town where he lived as a child, before an unthinkable tragedy happened and his family moved to America. But the neighborhood around his old house is overgrown, covered in dust, and completely abandoned. What’s going on? And why is it that whenever he closes his eyes, he falls prey to vivid, agonizing memories that seem more real than the world around him? Seth begins a search for answers, hoping that he might not be alone, that this might not be the hell he fears it to be, that there might be more than just this. . . .', 'http://books.google.com/books/content?id=n-JIAgAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 13:55:43', '2017-04-15 13:55:43'),
	(59, 'Every Day', 'David Levithan', 304, '56CTsaubhjAC', 'In his New York Times bestselling novel, David Levithan introduces readers to what Entertainment Weekly calls a \"wise, wildly unique\" love story about A, a teen who wakes up every morning in a different body, living a different life. Every day a different body. Every day a different life. Every day in love with the same girl. There’s never any warning about where it will be or who it will be. A has made peace with that, even established guidelines by which to live: Never get too attached. Avoid being noticed. Do not interfere. It’s all fine until the morning that A wakes up in the body of Justin and meets Justin’s girlfriend, Rhiannon. From that moment, the rules by which A has been living no longer apply. Because finally A has found someone he wants to be with—day in, day out, day after day. With his new novel, David Levithan, bestselling co-author of Will Grayson, Will Grayson, and Nick and Norah\'s Infinite Playlist, has pushed himself to new creative heights. He has written a captivating story that will fascinate readers as they begin to comprehend the complexities of life and love in A’s world, as A and Rhiannon seek to discover if you can truly love someone who is destined to change every day.', 'http://books.google.com/books/content?id=56CTsaubhjAC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 13:55:44', '2017-04-15 13:55:44'),
	(60, 'The Start Of You And Me', 'Emery Lord', 376, 'C4BxBgAAQBAJ', 'Brimming with heartfelt relationships and authentic high-school dynamics The Start of Me and You proves that it\'s never too late for second chances. It\'s been a year since it happened-when Paige Hancock\'s first boyfriend died in an accident. After shutting out the world for two years, Paige is finally ready for a second chance at high school. . .and she has a plan. First: Get her old crush, Ryan Chase, to date her-the perfect way to convince everyone she\'s back to normal. Next: Join a club-simple, it\'s high school after all. But when Ryan\'s sweet, nerdy cousin, Max, moves to town and recruits Paige for the Quiz Bowl team (of all things!) her perfect plan is thrown for a serious loop. Will Paige be able to face her fears and finally open herself up to the life she was meant to live?', 'http://books.google.com/books/content?id=C4BxBgAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 14:03:13', '2016-08-14 14:28:27'),
	(61, 'The Start Of Me And You', 'Emery Lord', 376, NULL, NULL, NULL, '2016-08-19 10:39:26', '2016-08-19 10:39:26'),
	(62, 'Eloquent Javascript', 'Douglas Crockford', 225, NULL, NULL, NULL, '2016-09-03 10:04:51', '2016-09-03 10:04:51'),
	(63, 'Harry Potter And The Cursed Child', 'J.K.Rowling', 308, NULL, NULL, NULL, '2016-09-06 13:05:05', '2016-09-06 13:05:05'),
	(64, 'The Silmarllion', 'J.R.R Tolkien', 366, NULL, NULL, NULL, '2016-09-06 13:14:37', '2016-09-06 13:14:37'),
	(65, 'Hoot', 'Carl Hiaasen', 292, 'nhOPDQAAQBAJ', 'Reprint. Originally published: c2002.', 'http://books.google.com/books/content?id=nhOPDQAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 13:55:49', '2017-04-15 13:55:49'),
	(66, 'The Lightning Thief', 'Rick Riordan', 400, 'FFTJDYx_ZiEC', 'Percy Jackson is a good kid, but he can\'t seem to focus on his schoolwork or control his temper. And lately, being away at boarding school is only getting worse-Percy could have sworn his pre-algebra teacher turned into a monster and tried to kill him.', 'http://books.google.com/books/content?id=FFTJDYx_ZiEC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 14:14:28', '2016-09-08 11:44:29'),
	(67, 'Princess in the Spotlight', 'Meg Cabot', 240, 'l7AI03zg_psC', '14-year-old Mia Thermopolis is still coming to terms with the fact that she’s a princess – and heir to the throne of Genovia! But when she announces on national TV that her mum is pregnant by her algebra teacher and plans to marry him, a right-royal fuss results! For now Mia’s dreadful old Grandmere is all set to plan the year’s biggest society wedding, with every A-list celeb invited, from the Reagans to Phil Collins. But will the bride and groom turn up?', 'http://books.google.com/books/content?id=l7AI03zg_psC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '2017-04-15 13:55:51', '2017-04-15 13:55:51'),
	(68, 'The Book of Lost Things', 'John Connolly', 339, 'fUFh7o7U6agC', 'Taking refuge in fairy tales after the loss of his mother, twelve-year-old David finds himself violently propelled into an imaginary land in which the boundaries of fantasy and reality are disturbingly melded. By the author of The Black Angel. 75,000 first printing.', 'http://books.google.com/books/content?id=fUFh7o7U6agC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 13:55:52', '2017-04-15 13:55:52'),
	(69, 'The Maze Runner', 'James Dashner', 384, '6gfDfhmmHxMC', 'The first book in the blockbuster phenomenon The Maze Runner series now features chapters from the highly-anticipated series conclusion, The Fever Code, the book that finally reveals the story of how the maze was built! When Thomas wakes up in the lift, the only thing he can remember is his name. He’s surrounded by strangers—boys whose memories are also gone. Outside the towering stone walls that surround them is a limitless, ever-changing maze. It’s the only way out—and no one’s ever made it through alive. Then a girl arrives. The first girl ever. And the message she delivers is terrifying. Remember. Survive. Run. The Maze Runner and Maze Runner: The Scorch Trials are now major motion pictures featuring the star of MTV\'s Teen Wolf, Dylan O’Brien; Kaya Scodelario; Aml Ameen; Will Poulter; and Thomas Brodie-Sangster. The third movie, Maze Runner: The Death Cure, will hit screens in 2018. Also look for James Dashner’s edge-of-your-seat MORTALITY DOCTRINE series! Praise for the Maze Runner series: A #1 New York Times Bestselling Series A USA Today Bestseller A Kirkus Reviews Best Teen Book of the Year An ALA-YASLA Best Fiction for Young Adults Book An ALA-YALSA Quick Pick \"[A] mysterious survival saga that passionate fans describe as a fusion of Lord of the Flies, The Hunger Games, and Lost.\"—EW.com “Wonderful action writing—fast-paced…but smart and well observed.”—Newsday “[A] nail-biting must-read.”—Seventeen.com “Breathless, cinematic action.”—Publishers Weekly “Heart pounding to the very last moment.”—Kirkus Reviews “Exclamation-worthy.”—Romantic Times “James Dashner’s illuminating prequel [The Kill Order] will thrill fans of this Maze Runner [series] and prove just as exciting for readers new to the series.”—Shelf Awareness, Starred \"Take a deep breath before you start any James Dashner book.\"-Deseret News', 'http://books.google.com/books/content?id=6gfDfhmmHxMC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 14:15:30', '2016-09-08 11:50:54'),
	(70, 'The The Trials Of Opollo', 'Rick Riordan', 400, 'Zl4xMQAACAAJ', 'How do you punish an immortal? By making him human. After angering his father Zeus, the god Apollo is cast down from Olympus. Weak and disoriented, he lands in New York City as a regular teenage boy. Now, without his godly powers, the four-thousand-year-old deity must learn to survive in the modern world until he can somehow find a way to regain Zeus\'s favor. But Apollo has many enemies-gods, monsters, and mortals who would love to see the former Olympian permanently destroyed. Apollo needs help, and he can think of only one place to go . . . an enclave of modern demigods known as Camp Half-Blood. Also included, a bonus short story: \"Percy Jackson and the Singer of Apollo\"', 'http://books.google.com/books/content?id=Zl4xMQAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '2017-04-15 14:16:22', '2016-09-08 11:58:07'),
	(71, 'Harry Potter And The Prisoner Of Azkaban', 'J.K. Rowling', 448, 'Sm5AKLXKxHgC', '\"\'Welcome to the Knight Bus, emergency transport for the stranded witch or wizard. Just stick out your wand hand, step on board and we can take you anywhere you want to go.\'\" When the Knight Bus crashes through the darkness and screeches to a halt in front of him, it\'s the start of another far from ordinary year at Hogwarts for Harry Potter. Sirius Black, escaped mass-murderer and follower of Lord Voldemort, is on the run - and they say he is coming after Harry. In his first ever Divination class, Professor Trelawney sees an omen of death in Harry\'s tea leaves... But perhaps most terrifying of all are the Dementors patrolling the school grounds, with their soul-sucking kiss...', 'http://books.google.com/books/content?id=Sm5AKLXKxHgC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 13:55:55', '2017-04-15 13:55:55'),
	(72, 'Twilight', 'Stephenie Meyer', 472, 'npKKNAEACAAJ', 'When 17-year old Bella goes to live with her father, she thinks her life will be as dull as the town. She quickly finds friends but not with the Cullen family who prefer their own company, especially Edward who hates her.', NULL, '2017-04-15 14:16:49', '2016-09-08 12:01:44'),
	(73, 'Artemis Fowl The Arctic Incident', 'Eoin Colfer', 277, 'IOvsWu26604C', 'For use in schools and libraries only. In his second adventure, Artemis is at boarding school in Ireland, when he suddenly receives an urgent video e-mail from Russia. In it is a plea from a man who has been kidnapped by the Russian mafia, a man Artemis had thought he would see never again, his beloved father.', 'http://books.google.com/books/content?id=IOvsWu26604C&printsec=frontcover&img=1&zoom=1&source=gbs_api', '2017-04-15 13:55:56', '2017-04-15 13:55:56'),
	(74, 'Walk Two Moons', 'Sharon Creech', 288, 'zaSx03A7UTUC', 'In her own singularly beautiful style, Newbery Medal winner Sharon Creech intricately weaves together two tales, one funny, one bittersweet, to create a heartwarming, compelling, and utterly moving story of love, loss, and the complexity of human emotion. Thirteen-year-old Salamanca Tree Hiddle, proud of her country roots and the \"Indian-ness in her blood,\" travels from Ohio to Idaho with her eccentric grandparents. Along the way, she tells them of the story of Phoebe Winterbottom, who received mysterious messages, who met a \"potential lunatic,\" and whose mother disappeared. As Sal entertains her grandparents with Phoebe\'s outrageous story, her own story begins to unfold--the story of a thirteen-year-old girl whose only wish is to be reunited with her missing mother. Supports the Common Core State Standards', 'http://books.google.com/books/content?id=zaSx03A7UTUC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 14:17:37', '2016-09-08 12:11:32'),
	(75, 'Sleeping Giants', 'Sylvain Neuvel', 320, 'cxTUCwAAQBAJ', '\"17 years ago: A girl in South Dakota falls through the earth, then wakes up dozens of feet below ground on the palm of what seems to be a giant metal hand. Today: She is a top-level physicist leading a team of people to understand exactly what that hand is, where it came from, and what it portends for humanity. A swift and spellbinding tale told almost exclusively through transcriptions of interviews conducted by a mysterious and unnamed character, this is a unique debut that describes a hunt for truth, power, and giant body parts\"--', 'http://books.google.com/books/content?id=cxTUCwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 13:55:58', '2017-04-15 13:55:58'),
	(76, 'The Running Dream', 'Wendelin Van Draanen', 336, 'L3NoD57BQfAC', 'When a school bus accident leaves sixteen-year-old Jessica an amputee, she returns to school with a prosthetic limb and her track team finds a wonderful way to help rekindle her dream of running again.', 'http://books.google.com/books/content?id=L3NoD57BQfAC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 13:55:59', '2017-04-15 13:55:59'),
	(77, 'The 39 Clues The Maze Of Bones', 'Rick Riordan', 236, 'IhY_mAEACAAJ', 'At the reading of their grandmother\'s will, Dan and Amy Cahill are given the choice of receiving a million dollars or uncovering the 39 clues hidden around the world that will lead to the source of the family\'s power, but by taking on the clues, they end up in a dangerous race against their own family members.', NULL, '2017-04-15 13:56:00', '2017-04-15 13:56:00'),
	(78, 'The 39 Clues One False Note', 'Gordon Korman', 176, 'ilmJcAPafFkC', 'The highly-anticipated Book 2 of the #1 bestselling The 39 Clues series. THIS JUST IN! Amy and Dan Cahill were spotted on a train, hot on the trail of one of 39 Clues hidden around the world. BUT WAIT! Police report a break-in at an elite hotel, and the suspects ALSO sound suspiciously like Amy and Dan. UPDATE! Amy and Dan have been seen in a car . . . no, in a speedboat chase . . . and HOLD EVERYTHING! They\'re being chased by an angry mob?!?', 'http://books.google.com/books/content?id=ilmJcAPafFkC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 14:18:32', '2016-09-08 12:16:20'),
	(79, 'Harry Potter and the Sorcerer\'s Stone', 'J.K. Rowling', 309, 'wrOQLV6xB-wC', '\"Turning the envelope over, his hand trembling, Harry saw a purple wax seal bearing a coat of arms; a lion, an eagle, a badger and a snake surrounding a large letter \'H\'.\" Harry Potter has never even heard of Hogwarts when the letters start dropping on the doormat at number four, Privet Drive. Addressed in green ink on yellowish parchment with a purple seal, they are swiftly confiscated by his grisly aunt and uncle. Then, on Harry\'s eleventh birthday, a great beetle-eyed giant of a man called Rubeus Hagrid bursts in with some astonishing news: Harry Potter is a wizard, and he has a place at Hogwarts School of Witchcraft and Wizardry. An incredible adventure is about to begin!', 'http://books.google.com/books/content?id=wrOQLV6xB-wC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 14:19:24', '2016-09-08 12:17:45'),
	(80, 'the girl with the dragon', 'Stieg Larsson', 600, 'o53ilir4yXcC', 'Forty years after the disappearance of Harriet Vanger from the secluded island owned and inhabited by the powerful Vanger family, her octogenarian uncle hires journalist Mikael Blomqvist and Lisbeth Salander, an unconventional young hacker, to investigate.', 'http://books.google.com/books/content?id=o53ilir4yXcC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 14:22:05', '2016-09-08 12:17:51'),
	(81, 'Harry Potter and the Chamber of Secrets', 'J.K. Rowling', 341, '5iTebBW-w7QC', '\"\'There is a plot, Harry Potter. A plot to make most terrible things happen at Hogwarts School of Witchcraft and Wizardry this year.\'\" Harry Potter\'s summer has included the worst birthday ever, doomy warnings from a house-elf called Dobby, and rescue from the Dursleys by his friend Ron Weasley in a magical flying car! Back at Hogwarts School of Witchcraft and Wizardry for his second year, Harry hears strange whispers echo through empty corridors - and then the attacks start. Students are found as though turned to stone... Dobby\'s sinister predictions seem to be coming true.', 'http://books.google.com/books/content?id=5iTebBW-w7QC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 13:56:05', '2017-04-15 13:56:05'),
	(82, 'Brisingr', 'Christopher Paolini', 763, 'EZqODQAAQBAJ', 'Presents the further adventures of Eragon and his dragon Saphira as they continue to aid the Varden in the struggle against the evil king, Galbatorix.', 'http://books.google.com/books/content?id=EZqODQAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 14:23:33', '2016-09-08 12:20:04'),
	(83, 'Message in a Bottle', 'Nicholas Sparks', 352, 'SquEmRGaluEC', 'Now with a new look celebrating 20 years of Nicholas Sparks! Divorced and disillusioned about relationships, Theresa Osborne is jogging when she finds a bottle on the beach. Inside is a letter of love and longing to \"Catherine,\" signed simply \"Garrett.\" Challenged by the mystery and pulled by emotions she doesn\'t fully understand, Theresa begins a search for this man that will change her life. What happens to her is unexpected, perhaps miraculous-an encounter that embraces all our hopes for finding someone special, for having a love that is timeless and everlasting.... Nicholas Sparks exquisitely chronicles the human heart. In his first bestselling novel, The Notebook, he created a testament to romantic love that touched readers around the world. Now in this New York Times bestseller, he renews our faith in destiny, in the ability of lovers to find each other no matter where, no matter when...', 'http://books.google.com/books/content?id=SquEmRGaluEC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 14:09:37', '2017-04-15 14:09:37'),
	(84, 'Big Nate On A Roll', 'Lincoln Peirce', 224, 'rX881wVRrvQC', 'Big Nate is on a roll! Nate’s a big deal in his scout troop . . . until Artur—aka Mr. Perfect—joins up. Now Nate’s stuck in second place. And Artur means business. Will Nate take the grand prize? Or wipe out, big time?', 'http://books.google.com/books/content?id=rX881wVRrvQC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 14:24:24', '2016-09-09 11:46:06'),
	(85, 'After You', 'Jojo Moyes', 400, 'pXiMDAAAQBAJ', 'The New York Times bestseller, soon to be a major motion picture; US release on June 3, 2016. They had nothing in common until love gave them everything to lose . . . Louisa Clark is an ordinary girl living an exceedingly ordinary life--steady boyfriend, close family--who has barely been farther afield than their tiny village. She takes a badly needed job working for ex-Master of the Universe Will Traynor, who is wheelchair bound after an accident. Will has always lived a huge life--big deals, extreme sports, worldwide travel--and now he\'s pretty sure he cannot live the way he is. Will is acerbic, moody, bossy--but Lou refuses to treat him with kid gloves, and soon his happiness means more to her than she expected. When she learns that Will has shocking plans of his own, she sets out to show him that life is still worth living. A Love Story for this generation and perfect for fans of John Green\'s The Fault in Our Stars, Me Before You brings to life two people who couldn\'t have less in common--a heartbreakingly romantic novel that asks, What do you do when making the person you love happy also means breaking your own heart?', 'http://books.google.com/books/content?id=SxPUCwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 14:25:31', '2016-09-09 11:46:45'),
	(86, 'In the Wild', 'Jon Krakauer', 240, 'waBwNtI6rSwC', 'In April 1992 a young man from a well-to-do family hitchhiked to Alaska and walked alone into the wilderness north of Mt. McKinley. His name was Christopher Johnson McCandless. He had given $25,000 in savings to charity, abandoned his car and most of his possessions, burned all the cash in his wallet, and invented a new life for himself. Four months later, his decomposed body was found by a moose hunter. How McCandless came to die is the unforgettable story of Into the Wild. Immediately after graduating from college in 1991, McCandless had roamed through the West and Southwest on a vision quest like those made by his heroes Jack London and John Muir. In the Mojave Desert he abandoned his car, stripped it of its license plates, and burned all of his cash. He would give himself a new name, Alexander Supertramp, and , unencumbered by money and belongings, he would be free to wallow in the raw, unfiltered experiences that nature presented. Craving a blank spot on the map, McCandless simply threw the maps away. Leaving behind his desperate parents and sister, he vanished into the wild. Jon Krakauer constructs a clarifying prism through which he reassembles the disquieting facts of McCandless\'s short life. Admitting an interst that borders on obsession, he searches for the clues to the dries and desires that propelled McCandless. Digging deeply, he takes an inherently compelling mystery and unravels the larger riddles it holds: the profound pull of the American wilderness on our imagination; the allure of high-risk activities to young men of a certain cast of mind; the complex, charged bond between fathers and sons. When McCandless\'s innocent mistakes turn out to be irreversible and fatal, he becomes the stuff of tabloid headlines and is dismissed for his naiveté, pretensions, and hubris. He is said to have had a death wish but wanting to die is a very different thing from being compelled to look over the edge. Krakauer brings McCandless\'s uncompromising pilgrimage out of the shadows, and the peril, adversity , and renunciation sought by this enigmatic young man are illuminated with a rare understanding--and not an ounce of sentimentality. Mesmerizing, heartbreaking, Into the Wild is a tour de force. The power and luminosity of Jon Krakauer\'s stoytelling blaze through every page. From the Trade Paperback edition.', 'http://books.google.com/books/content?id=waBwNtI6rSwC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 14:27:04', '2016-09-09 11:47:00'),
	(87, 'The Black Arrow', 'Robert Louis Stevenson', 242, NULL, 'In fifteenth-century England, when his father\'s murderer is revealed to be his guardian, seventeen-year-old Richard Shelton joins the fellowship of the Black Arrow in avenging the death, rescuing the woman he loves, and participating in the struggle between the Yorks and Lancasters in the War of the Roses.', 'http://books.google.com/books/content?id=OfwuAAAAMAAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 14:27:59', '2016-09-09 11:47:03'),
	(88, 'The Amber Spyglass', 'Philip Pullman', 518, 'alZJ6--uhyUC', 'Lyra and Will find themselves at the center of a battle between the forces of the Authority and those gathered by Lyra\'s father, Lord Asriel.', 'http://books.google.com/books/content?id=alZJ6--uhyUC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 14:29:28', '2016-09-09 11:47:53'),
	(89, 'Frindle', 'Andrew Clements', 112, 'bGGNX0vYsJMC', 'Is Nick Allen a troublemaker? He really just likes to liven things up at school -- and he\'s always had plenty of great ideas. When Nick learns some interesting information about how words are created, suddenly he\'s got the inspiration for his best plan ever...the frindle. Who says a pen has to be called a pen? Why not call it a frindle? Things begin innocently enough as Nick gets his friends to use the new word. Then other people in town start saying frindle. Soon the school is in an uproar, and Nick has become a local hero. His teacher wants Nick to put an end to all this nonsense, but the funny thing is frindle doesn\'t belong to Nick anymore. The new word is spreading across the country, and there\'s nothing Nick can do to stop it.', 'http://books.google.com/books/content?id=bGGNX0vYsJMC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 14:30:15', '2016-09-09 11:48:04'),
	(90, 'The Lemonade War', 'Jacqueline Davies', 172, '6FuXRNUf0poC', 'Evan Treski, who is people-smart, and his younger sister Jesse, who is math-smart, battle it out through competing lemonade stands, each trying to be the first to earn one hundred dollars. Reprint.', 'http://books.google.com/books/content?id=6FuXRNUf0poC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 14:32:36', '2016-09-09 11:48:07'),
	(91, 'Holes', 'Louis Sachar', 272, 'U_zINMa9cAAC', 'Winner of the Newbery Medal and the National Book Award! This #1 New York Times bestselling, modern classic in which boys are forced to dig holes day in and day out is now available with a splashy new look. Stanley Yelnats is under a curse. A curse that began with his no-good-dirty-rotten-pig-stealing-great-great-grandfather and has since followed generations of Yelnatses. Now Stanley has been unjustly sent to a boys’ detention center, Camp Green Lake, where the boys build character by spending all day, every day digging holes exactly five feet wide and five feet deep. There is no lake at Camp Green Lake. But there are an awful lot of holes. It doesn’t take long for Stanley to realize there’s more than character improvement going on at Camp Green Lake. The boys are digging holes because the warden is looking for something. But what could be buried under a dried-up lake? Stanley tries to dig up the truth in this inventive and darkly humorous tale of crime and punishment—and redemption. Includes a double bonus: an excerpt from Small Steps, the follow-up to Holes, as well as an excerpt from Louis Sachar’s new middle-grade novel, Fuzzy Mud. \"A smart jigsaw puzzle of a novel.\" --The New York Times WINNER OF THE BOSTON GLOBE-HORN BOOK AWARD A NEW YORK TIMES BOOK REVIEW NOTABLE CHILDREN\'S BOOK SELECTED FOR NUMEROUS BEST BOOK OF THE YEAR AND ALA HONORS From the Paperback edition.', 'http://books.google.com/books/content?id=U_zINMa9cAAC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 14:09:42', '2017-04-15 14:09:42'),
	(92, 'Blood Promise', 'Richelle Mead', 503, 'owdvLQqC-dsC', 'The recent Strigoi attack at St. Vladimir’s Academy was the deadliest ever in the school’s history, claiming the lives of Moroi students, teachers, and guardians alike. Even worse, the Strigoi took some of their victims with them . . . including Dimitri. He’d rather die than be one of them, and now Rose must abandon her best friend, Lissa—the one she has sworn to protect no matter what—and keep the promise Dimitri begged her to make long ago. But with everything at stake, how can she possibly destroy the person she loves most?', 'http://books.google.com/books/content?id=owdvLQqC-dsC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 14:34:35', '2016-09-09 11:48:17'),
	(93, 'Waiting for normal', 'Leslie Connor', 320, 'Nit5kDe4vbYC', 'Addie is waiting for normal. But Addie\'s mom has an all-or-nothing approach to life: a food fiesta or an empty pantry, jubilation or gloom, her way or no way. All or nothing never adds up to normal. All or nothing can\'t bring you all to home, which is exactly where Addie longs to be, with her half sisters, every day. In spite of life\'s twists and turns, Addie remains optimistic. Someday, maybe, she\'ll find normal. Leslie Connor has created an inspiring novel about one girl\'s giant spirit. waiting for normal is a heartwarming gem.', 'http://books.google.com/books/content?id=Nit5kDe4vbYC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 14:35:25', '2016-09-09 11:48:22'),
	(94, 'Colibri', 'Ann Cameron', 227, 'pX0kHzjbnxsC', 'Kidnapped when she was very young by an unscrupulous man who has forced her to lie and beg to get money, a twelve-year-old Mayan girl endures an abusive life, always wishing she could return to the parents she can hardly remember. An ALA Children\'s Notable Book. Reprint.', 'http://books.google.com/books/content?id=pX0kHzjbnxsC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 13:56:15', '2017-04-15 13:56:15'),
	(95, 'Insurgent', 'Veronica Roth', 592, 'BG3P0sFxnT4C', 'Now includes an excerpt from the upcoming Four: A Divergent Collection. One choice can transform you—or it can destroy you. But every choice has consequences, and as unrest surges in the factions all around her, Tris Prior must continue trying to save those she loves—and herself—while grappling with haunting questions of grief and forgiveness, identity and loyalty, politics and love. Tris\'s initiation day should have been marked by celebration and victory with her chosen faction; instead, the day ended with unspeakable horrors. War now looms as conflict between the factions and their ideologies grows. And in times of war, sides must be chosen, secrets will emerge, and choices will become even more irrevocable—and even more powerful. Transformed by her own decisions but also by haunting grief and guilt, radical new discoveries, and shifting relationships, Tris must fully embrace her Divergence, even if she does not know what she may lose by doing so. New York Times bestselling author Veronica Roth\'s much-anticipated second book of the dystopian Divergent series is another intoxicating thrill ride of a story, rich with hallmark twists, heartbreaks, romance, and powerful insights about human nature.', 'http://books.google.com/books/content?id=BG3P0sFxnT4C&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 14:37:34', '2016-09-09 11:49:20'),
	(96, 'The Daring Book for Girls', 'Miriam Peskowits', 288, '2lCwJJ-EQh8C', 'The Daring Book for Girls is the manual for everything that girls need to know—and that doesn\'t mean sewing buttonholes! Whether it\'s female heroes in history, secret note-passing skills, science projects, friendship bracelets, double dutch, cats cradle, the perfect cartwheel or the eternal mystery of what boys are thinking, this book has it all. But it\'s not just a guide to giggling at sleepovers—although that\'s included, of course! Whether readers consider themselves tomboys, girly-girls, or a little bit of both, this book is every girl\'s invitation to adventure.', 'http://books.google.com/books/content?id=2lCwJJ-EQh8C&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 14:39:13', '2016-09-09 11:49:34'),
	(97, 'Lord Of the Flies', 'Robert Golding, William Golding, Edmund L. Epstein', 208, 'f0o-PgAACAAJ', 'The classic study of human nature which depicts the degeneration of a group of schoolboys marooned on a desert island.', NULL, '2017-04-15 14:39:54', '2016-09-09 11:50:04'),
	(98, 'King James Believe the HYPE', 'Ryan Jones', 240, 'D7w8QpDyrUkC', 'Updated to incorporate the 2005 basketball season, a portrait of LeBron James provides a close-up look at the eighteen-year-old high-school basketball phenomenon who has become one of the most sought after athletes on the basketball court, discussing the controversy over his career, his remarkable athletic abilities, and his rise from poverty to success. Original.', 'http://books.google.com/books/content?id=D7w8QpDyrUkC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 14:07:51', '2017-04-15 14:07:51'),
	(99, 'The Murder of Roger Ackroyd', 'Agatha Christie', 304, 'jLUPkkcWpjQC', 'Agatha Christie\'s ginius for detective fiction is unparalleled. Her worldwide popularity is phenomenal, her characters engaging, her plots spellbinding. No one knows the human heart—or the dark passions that can stop it—better than Agatha Christie. She is truly the one and only Queen of Crime. The Murder Of Roger Ackroyd Village rumor hints that Mrs. Ferrars poisoned her husband, but no one is sure. Then there\'s another victim in a chain of death. Unfortunately for the killer, master sleuth Hercule Poirot takes over the investigation.', 'http://books.google.com/books/content?id=jLUPkkcWpjQC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 14:40:45', '2016-09-09 11:50:52'),
	(100, 'Friends', 'Kazumi Yumoto', 169, '30QBAAAACAAJ', 'Curious about death, three sixth-grade boys decide to spy on an old man and wait for him to die, but they end up becoming his friends.', 'http://books.google.com/books/content?id=30QBAAAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '2017-04-15 14:41:50', '2016-09-09 11:51:03'),
	(101, 'The guardians of GaHoole The capture', 'Kathryn Lasky', 240, 'R6U2r30sRkYC', 'Ga\'Hoole is a classic hero mythology about the fight between good and evil. This new version of The Capture will feature art from the movie, due out in September 2010! After Soren, a young owlet, is pushed from his family\'s nest by his older brother, he\'s plucked from the forest floor by agents from a mysterious school, the St. Aegolius Academy for Orphaned Owls. When Soren arrives at St. Aggie\'s, he suspects there is more to the school than meets the eye. He and his new friend, the clever and scrappy Gylfie, find out that St. Aggie\'s is actually a training camp where the school\'s leader can groom young owls to help achieve her goal--to rule the entire owl kingdom.', 'http://books.google.com/books/content?id=R6U2r30sRkYC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 14:42:17', '2016-09-09 11:51:04'),
	(102, 'The Girl on the Train', 'Paula Hawkins', 336, 'Udv-AwAAQBAJ', 'The #1 New York Times Bestseller, USA Today Book of the Year, now a major motion picture starring Emily Blunt. Don\'t miss Paula Hawkins\' new novel, Into the Water, coming May 2017. The debut psychological thriller that will forever change the way you look at other people\'s lives. “Nothing is more addicting than The Girl on the Train.”—Vanity Fair “The Girl on the Train has more fun with unreliable narration than any chiller since Gone Girl. . . . [It] is liable to draw a large, bedazzled readership.”—The New York Times “Marries movie noir with novelistic trickery. . . hang on tight. You\'ll be surprised by what horrors lurk around the bend.”—USA Today “Like its train, the story blasts through the stagnation of these lives in suburban London and the reader cannot help but turn pages.”—The Boston Globe “Gone Girl fans will devour this psychological thriller.”—People EVERY DAY THE SAME Rachel takes the same commuter train every morning and night. Every day she rattles down the track, flashes past a stretch of cozy suburban homes, and stops at the signal that allows her to daily watch the same couple breakfasting on their deck. She’s even started to feel like she knows them. Jess and Jason, she calls them. Their life—as she sees it—is perfect. Not unlike the life she recently lost. UNTIL TODAY And then she sees something shocking. It’s only a minute until the train moves on, but it’s enough. Now everything’s changed. Unable to keep it to herself, Rachel goes to the police. But is she really as unreliable as they say? Soon she is deeply entangled not only in the investigation but in the lives of everyone involved. Has she done more harm than good?', 'http://books.google.com/books/content?id=Udv-AwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 14:45:14', '2016-09-09 11:51:27'),
	(103, 'Skateboarding and How it Works', 'Emily Sohn', 48, 'pzT6EjnUStIC', '\"Describes the science behind the sport of skateboarding, including basic skills, tricks, skateparks, and competitions\"--Provided by publisher.', 'http://books.google.com/books/content?id=pzT6EjnUStIC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 14:07:57', '2017-04-15 14:07:57'),
	(104, 'The red pyramid', 'Rick Riordan', 257, 'rYGJELZ1Y4QC', 'Since their mother\'s death, Carter and Sadie have become near strangers. While Sadie has lived with her grandparents in London, her brother has traveled the world with their father, the brilliant Egyptologist, Dr. Julius Kane. One night, Dr. Kane brings the siblings together for a \\\"research experiment\\\" at the British Museum, where he hopes to set things right for his family. Instead, he unleashes the Egyptian god Set, who banishes him to oblivion and forces the children to flee for their lives. From the creator of the hit Percy Jackson series.', 'http://books.google.com/books/content?id=rYGJELZ1Y4QC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 14:48:52', '2016-09-09 11:53:36'),
	(105, 'Esperanza Rising', 'Pam Munoz Ryan', 262, 'Ly6KPrawvqIC', 'Esperanza and her mother are forced to leave their life of wealth and privilege in Mexico to go work in the labor camps of Southern California, where they must adapt to the harsh circumstances facing Mexican farm workers on the eve of the Great Depression. Jr Lib Guild. Reprint.', 'http://books.google.com/books/content?id=Ly6KPrawvqIC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 14:49:27', '2016-09-09 11:54:53'),
	(107, 'First They Killed My Father', 'Loung Ung', 288, '1q9JKbNlfwUC', 'One of seven children of a high-ranking government official, Loung Ung lived a privileged life in the Cambodian capital of Phnom Penh until the age of five. Then, in April 1975, Pol Pot\'s Khmer Rouge army stormed into the city, forcing Ung\'s family to flee and, eventually, to disperse. Loung was trained as a child soldier in a work camp for orphans, her siblings were sent to labor camps, and those who survived the horrors would not be reunited until the Khmer Rouge was destroyed. Harrowing yet hopeful, Loung\'s powerful story is an unforgettable account of a family shaken and shattered, yet miraculously sustained by courage and love in the face of unspeakable brutality.', 'http://books.google.com/books/content?id=1q9JKbNlfwUC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '2017-04-15 14:56:47', '2016-09-09 11:55:15'),
	(108, 'Tao-Girls Rule!', 'C. J. Golden', 124, 'vMYkdnmI-EAC', 'If you are the sort of girl who wants to find balance, be confident and act boldly, this book has all of the rules.Wise beyond measure, in Tao-Girls Rule!, author and motivational speaker CJ Golden examines girlhood in all its glory. By combining the philosophy of Tao with a healthy dose of boldness, she offers a lightening rod to direct teen and preteen girls on how to be strong, courageous, and confident.Following her first book, Tao of the Defiant Woman, Golden now brings her rare, uncanny insight to teens and pre-teens. In three parts, which include \"Tao and Dynamic,\" Living Life as a Tao-Girl,\" and \"Confident, Balanced, and Bold,\" twelve chapters with titles such as \"A Tao-Girl is Imaginative,\" \"A Tao-Girl is Radiant,\" and \"Celebrity Tao-Girls\" show girls how to be spirited individuals that make the most of their uniqueness and strive to live a life of grace by combining the acceptance of ancient philosophy of Taoism with a healthy dose of bravery. One thing is certain, as our young girls face the challenges of growing up in an ever-changing and complex world, the anecdotes and biographical sketches found in this collection will lead them to appreciate that they are not alone. Being a Tao-Girl means embracing power and being a role model. It means keeping a dynamic attitude and having a loving and grateful spirit. There are gads of Tao-Girls out there to look up to. Kelly Clarkson is one. Queen Latifah is one. Miley Cyrus is another. There are Tao-Girls in every city and if you want, you can be one too.', 'http://books.google.com/books/content?id=vMYkdnmI-EAC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 14:08:02', '2017-04-15 14:08:02'),
	(109, 'Ender\'s Game', 'Orson Scott Card', 380, NULL, 'Child hero Ender Wiggin must fight a desperate battle against a deadly alien race if mankind is to survive.', 'http://books.google.com/books/content?id=Z5QtUpmbcDwC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 14:57:47', '2016-09-09 11:56:10'),
	(110, 'Rules', 'Cynthia Lord', 224, 'tXIzAAAAQBAJ', 'This 2007 Newbery Honor Book is a humorous and heartwarming debut about feeling different and finding acceptance. Now in After Words paperback! Twelve-year-old Catherine just wants a normal life. Which is near impossible when you have a brother with autism and a family that revolves around his disability. She\'s spent years trying to teach David the rules from \\\"a peach is not a funny-looking apple\\\" to \\\"keep your pants on in public\\\"---in order to head off David\'s embarrassing behaviors. But the summer Catherine meets Jason, a surprising, new sort-of friend, and Kristi, the next-door friend she\'s always wished for, it\'s her own shocking behavior that turns everything upside down and forces her to ask: What is normal?', 'http://books.google.com/books/content?id=tXIzAAAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 14:58:52', '2016-09-09 11:56:14'),
	(111, 'The Throne of Fire: The Graphic Novel', 'Rick Riordan', 128, 's2XdsgEACAAJ', 'On curse. Two heroes. Five days to save the world. Ever since the Gods of Ancient Egypt were unleashed on the modern world, Carter Kane and his sister, Sadie, have been in big trouble. As descendants of the magical House of Life, they command certain powers. But now a terrifying enemy - Apophis, the giant snake of Chaos - is rising. If Carter and Sadie don\'t destroy him, the world will end in five days\' time. And, in order to battle the forces of Chaos, they must revive the sun god Ra - a feat no magician has ever achieved. Because first they must search the world for the three sections of the Book of Ra, thenthey have to learn how to chant its spells . . . Can the Kanes destroy Apophis before he swallows the sun and plunges the earth into darkness . . . ?', NULL, '2017-04-15 15:00:27', '2016-09-09 11:57:37'),
	(112, 'Water Wars', 'Cameron Stracher', 256, 'ZmcXQx0e_wAC', 'Welcome to a future where water is more precious than oil or gold... Hundreds of millions of people have already died, and millions more will soon fall-victims of disease, hunger, and dehydration. It is a time of drought and war. The rivers have dried up, the polar caps have melted, and drinkable water is now in the hands of the powerful few. There are fines for wasting it and prison sentences for exceeding the quotas. But Kai didn\'t seem to care about any of this. He stood in the open road drinking water from a plastic cup, then spilled the remaining drops into the dirt. He didn\'t go to school, and he traveled with armed guards. Kai claimed he knew a secret-something the government is keeping from us... And then he was gone. Vanished in the middle of the night. Was he kidnapped? Did he flee? Is he alive or dead? There are no clues, only questions. And no one can guess the lengths to which they will go to keep him silent. We have to find him-and the truth-before it is too late for all of us.', 'http://books.google.com/books/content?id=ZmcXQx0e_wAC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '2017-04-15 15:01:44', '2016-09-09 11:58:13'),
	(113, 'The 39 Clues #8: The Emperor\'s Code', 'Gordon Korman', 192, 'jKrE5oTyqDUC', 'Tensions run high in the explosive 8th book of 39 Clues, the #1 New York Times bestselling series. One belief has sustained fourteen-year-old Amy Cahill and her younger brother, Dan, on their hunt for the 39 Clues: They are the good guys. But then a shocking discovery about their parents shatters everything Amy and Dan think they know, dividing the two siblings for the first time ever. When Dan disappears in a country of more than a billion people, Amy has to make a terrible choice - find the next Clue . . . or find her younger brother.', 'http://books.google.com/books/content?id=jKrE5oTyqDUC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 15:02:31', '2016-09-09 11:58:31'),
	(114, 'Oliver Twist', 'Marian Leighton', 240, NULL, NULL, NULL, '2016-09-09 11:58:35', '2016-09-09 11:58:35'),
	(115, 'Harry Potter And The Half Blood Prince', 'J.K. Rowling', 652, 'R7YsowJI9-IC', '\"There it was, hanging in the sky above the school: the blazing green skull with a serpent tongue, the mark Death Eaters left behind whenever they had entered a building... wherever they had murdered...\" When Dumbledore arrives at Privet Drive one summer night to collect Harry Potter, his wand hand is blackened and shrivelled, but he does not reveal why. Secrets and suspicion are spreading through the wizarding world, and Hogwarts itself is not safe. Harry is convinced that Malfoy bears the Dark Mark: there is a Death Eater amongst them. Harry will need powerful magic and true friends as he explores Voldemort\'s darkest secrets, and Dumbledore prepares him to face his destiny...', 'http://books.google.com/books/content?id=R7YsowJI9-IC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 14:09:56', '2017-04-15 14:09:56'),
	(116, 'Harry Potter And the Order of The Pheonix', 'J.K. Rowling', 870, '-E0stwAACAAJ', NULL, NULL, '2017-04-15 14:09:57', '2017-04-15 14:09:57'),
	(117, 'Spectrums', 'David Blatner', 192, '3VT4AgAAQBAJ', 'Original publication and copyright date: 2012.', 'http://books.google.com/books/content?id=3VT4AgAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 14:09:57', '2017-04-15 14:09:57'),
	(118, 'Harry Potter And the Deathly Hallows', 'J.K. Rowling', 784, '_oaAHiFOZmgC', '\"\'Give me Harry Potter,\' said Voldemort\'s voice, \'and none shall be harmed. Give me Harry Potter, and I shall leave the school untouched. Give me Harry Potter, and you will be rewarded.\'\" As he climbs into the sidecar of Hagrid\'s motorbike and takes to the skies, leaving Privet Drive for the last time, Harry Potter knows that Lord Voldemort and the Death Eaters are not far behind. The protective charm that has kept Harry safe until now is broken, but he cannot keep hiding. The Dark Lord is breathing fear into everything Harry loves and to stop him Harry will have to find and destroy the remaining Horcruxes. The final battle must begin - Harry must stand and face his enemy...', 'http://books.google.com/books/content?id=_oaAHiFOZmgC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 14:09:58', '2017-04-15 14:09:58'),
	(119, 'The 39 Clues #3: The Sword Thief', 'Peter Lerangis', 160, 'UO6KH66_1mQC', 'Book 3 in the #1 bestselling The 39 Clues series may just be the most thrill-packed yet! ATTENTION! Amy and Dan Cahill have been located once again, this time in the company of the notoriously unreliable Alistair Oh. Could they have been foolish enough to make an alliance? Spies report that Amy and Dan seem to be tracking the life of one of the most powerful fighters the world has ever known. If this fearsome warrior was a Cahill, his secrets are sure to be well-guarded . . . and the price to uncover them just might be lethal.', 'http://books.google.com/books/content?id=UO6KH66_1mQC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 15:06:47', '2016-09-12 09:57:58'),
	(120, 'Eternity Code, The (Artemis Fowl, Book 3)', 'Eoin Colfer', 320, 'fnJ4t979fFIC', 'Artemis Fowl is going straight-as soon as he pulls off the most brilliant criminal feat of his career... but his plan goes awry, leaving his loyal bodyguard, Butler, mortally injured. Artemis knows his only hope to save Butler lies in fairy magic, so once again he is forced to contact his old rival, Captain Holly Short of the LEPrepcon fairy police. Miraculously, Butler is healed, but there is a catch: he has aged fifteen years.', 'http://books.google.com/books/content?id=fnJ4t979fFIC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 15:07:32', '2016-09-12 10:02:39'),
	(121, 'The Icebound Land (Ranger\'s Apprentice Book 3)', 'John Flanagan', 336, 'UnmoqK-bq08C', 'The Icebound Land is the third thrilling book in John Flanagan’s Ranger’s Apprentice series – over eight million sold worldwide. Kidnapped after the fierce battle with Lord Morgarath, Will and Evanlyn are bound for Skandia as captives aboard a fearsome wolfship. But Halt has sworn to rescue them, and he will do anything to keep his promise – even defy his King. Expelled from the Rangers he has served so loyally, Halt is joined by Will\'s friend Horace as he travels towards Skandia. On their way, they face many challenges – but Horace knows a thing or two about combat. Soon he begins to attract the attention of knights and warlords for miles around with his uncanny skill. Even so, will they be in time to rescue Will from a horrific life of slavery? Perfect for fans of J.R.R. Tolkien’s Lord of the Rings, T.H. White’s The Sword in the Stone, Christopher Paolini’s Eragon series and Rick Riordan’s Percy Jackson series.', 'http://books.google.com/books/content?id=UnmoqK-bq08C&printsec=frontcover&img=1&zoom=1&source=gbs_api', '2017-04-15 15:12:24', '2016-09-12 10:06:24'),
	(122, 'Ranger\'s Apprentice The Battle For Skandia', 'John Flanagan', 294, NULL, NULL, NULL, '2016-09-12 10:10:35', '2016-09-12 10:10:35'),
	(123, 'Big Nate and Friends', 'Lincoln Pierce', 224, 'OU4cuEOzXmQC', 'Sixth-grader Nate Wright is on top of the world . . . with a little help from his friends! His best buddies, Francis and Teddy, stick with Nate through thick and thin—usually thin. They\'ve seen it all. Nate\'s disastrous love life, his chess tournament trash talking, even his misguided attempt to be a \\\"bad boy.\\\" Along the way, Nate and his pals are joined by Artur, the gentle exchange student who\'s popular with almost everyone. And don\'t forget Gina, the teacher\'s pet who gets an \\\"A\\\" for annoying. They\'re all here in this collection of cartoons, featuring highlights from Nate\'s most hilarious adventures. Now in full-color with poster!', 'http://books.google.com/books/content?id=OU4cuEOzXmQC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 15:13:35', '2016-09-12 10:14:26'),
	(124, 'The Game of Lives', 'James Dashner', 352, 'xiaiBQAAQBAJ', 'From James Dashner, author of the #1 New York Times bestselling Maze Runner series, comes the final book in the Mortality Doctrine series, an edge-of-your-seat cyber-adventure trilogy that includes The Eye of Minds and The Rule of Thoughts. Includes a sneak peek of The Fever Code, the highly-anticipated conclusion to the Maze Runner series—the novel that finally reveals how the maze was built! Michael used to live to game, but the games he was playing have become all too real. Only weeks ago, sinking into the Sleep was fun. The VirtNet combined the most cutting-edge technology and the most sophisticated gaming for a full mind-body experience. And it was Michael’s passion. But now every time Michael sinks, he risks his life. The games are over. The VirtNet has become a world of deadly consequences, and Kaine grows stronger by the day. The Mortality Doctrine—Kaine’s master plan—has nearly been realized, and little by little the line separating the virtual from the real is blurring. If Kaine succeeds, it will mean worldwide cyber domination. And it looks like Michael and his friends are the only ones who can put the monster back in the box—if Michael can figure out who his friends really are. The author who brought you the #1 New York Times bestselling MAZE RUNNER series and two #1 movies—The Maze Runner and The Scorch Trials—now brings you an electrifying cyber-adventure trilogy that takes you into a world of hyperadvanced technology, cyber terrorists, and gaming beyond your wildest dreams . . . and your worst nightmares. Praise for the MORTALITY DOCTRINE series: “Dashner takes full advantage of the Matrix-esque potential for asking ‘what is real.’” —io9.com “Set in a world taken over by virtual reality gaming, the series perfectly capture[s] Dashner’s hallmarks for inventiveness, teen dialogue and an ability to add twists and turns like no other author.” —MTV.com “A brilliant, visceral, gamified mash-up of The Matrix and Inception, guaranteed to thrill even the non-gaming crowd.” —Christian Science Monitor', 'http://books.google.com/books/content?id=xiaiBQAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 15:14:24', '2016-09-12 11:03:33'),
	(125, 'New Moon', 'Stephenie Meyer', 608, '07LTDdpMZfYC', 'Legions of readers entranced by Twilight are hungry for more and they won\'t be disappointed. In New Moon, Stephenie Meyer delivers another irresistible combination of romance and suspense with a supernatural twist. The \"star-crossed\" lovers theme continues as Bella and Edward find themselves facing new obstacles, including a devastating separation, the mysterious appearance of dangerous wolves roaming the forest in Forks, a terrifying threat of revenge from a female vampire and a deliciously sinister encounter with Italy\'s reigning royal family of vampires, the Volturi. Passionate, riveting, and full of surprising twists and turns, this vampire love saga is well on its way to literary immortality.', 'http://books.google.com/books/content?id=07LTDdpMZfYC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 15:15:01', '2016-09-12 11:51:23'),
	(126, 'Eclipse', 'Stephenie Meyers', 640, NULL, NULL, NULL, '2016-09-12 11:56:45', '2016-09-12 11:56:45'),
	(127, 'Girls Under Pressure', 'Jacqueline Wilson', 224, 'QZmlgM--oYAC', 'Ellie thinks she looks awful. Horrible. FAT. Her best friends are both drop-dead gorgeous and Ellie’s sick of being the ugly duckling. So she goes on a diet. And she even starts to exercise, much to her friends’ and her gym teacher’s amazement. Ellie’s hungry all the time, she works out every spare second, and she’s turned into a grouchy meanie. But if her friends don’t want to deal with the new and improved Ellie, that’s their problem. It’s better to be thin than happy. Isn’t it? From the Paperback edition.', 'http://books.google.com/books/content?id=QZmlgM--oYAC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 15:05:15', '2017-04-15 15:05:15'),
	(128, 'Harry Potter And The Goblet Of Fire', 'J.K. Rowling', 752, 'etukl7GfrxQC', '\"\'There will be three tasks, spaced throughout the school year, and they will test the champions in many different ways ... their magical prowess - their daring - their powers of deduction - and, of course, their ability to cope with danger.\'\" The Triwizard Tournament is to be held at Hogwarts. Only wizards who are over seventeen are allowed to enter - but that doesn\'t stop Harry dreaming that he will win the competition. Then at Hallowe\'en, when the Goblet of Fire makes its selection, Harry is amazed to find his name is one of those that the magical cup picks out. He will face death-defying tasks, dragons and Dark wizards, but with the help of his best friends, Ron and Hermione, he might just make it through - alive!', 'http://books.google.com/books/content?id=etukl7GfrxQC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 15:05:16', '2017-04-15 15:05:16'),
	(129, 'Judy Moody, Girl Detective (Book #9)', 'Megan McDonald', 192, 'YjQ49Ctk1pkC', 'It\'s an honest-to-jeepers mystery! Agent Judy Drewdy sets out to solve the case of the missing puppy when a canine-cop-in-training vanishes into thin air.', 'http://books.google.com/books/content?id=YjQ49Ctk1pkC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 15:17:36', '2016-09-13 07:50:50'),
	(130, 'Stargirl', 'Jerry Spinelli', 186, '_VpTPgAACAAJ', 'In this story about the perils of popularity, the courage of nonconformity, and the thrill of first love, an eccentric student named Stargirl changes Mica High School forever', NULL, '2017-04-15 15:17:56', '2016-09-13 07:54:12'),
	(131, 'Big Nate Out Loud', 'Lincoln Pierce', 224, 'gQN4UAhIgV8C', 'Self-proclaimed genius Nate Wright blazes a haphazard trail through the sixth grade at P.S. 38, where between endless misadventures, marked by complaining observations, he earns straight As and numerous detentions.', 'http://books.google.com/books/content?id=gQN4UAhIgV8C&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 15:19:04', '2016-09-13 09:41:09'),
	(132, 'The Cartoon History of the Universe II.', 'Larry Gonick', 305, 'hD0a0mZ7IjQC', 'A cartoon journey through the history of the universe from the big bang through the rise and fall of civilizations.', 'http://books.google.com/books/content?id=hD0a0mZ7IjQC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 15:21:35', '2016-09-13 14:55:30'),
	(133, 'Miss Peregrine\'s Home For Peculiar Children', 'Ransom Riggs', 384, 'R31pCgAAQBAJ', NULL, NULL, '2017-04-15 15:05:20', '2017-04-15 15:05:20'),
	(134, 'Runner', 'Patrick Lee', 328, NULL, NULL, NULL, '2016-09-14 13:40:12', '2016-09-14 13:40:12'),
	(135, 'The Fault in Our Stars', 'John Green', 336, 'UzqVUdEtLDwC', 'Now a Major Motion Picture TODAY Book Club pick TIME Magazine’s #1 Fiction Book of 2012 \"The greatest romance story of this decade.\" —Entertainment Weekly -Millions of copies sold- #1 New York Times Bestseller #1 Wall Street Journal Bestseller #1 USA Today Bestseller #1 International Bestseller #1 Indie Bestseller Despite the tumor-shrinking medical miracle that has bought her a few years, Hazel has never been anything but terminal, her final chapter inscribed upon diagnosis. But when a gorgeous plot twist named Augustus Waters suddenly appears at Cancer Kid Support Group, Hazel’s story is about to be completely rewritten. Insightful, bold, irreverent, and raw, The Fault in Our Stars brilliantly explores the funny, thrilling, and tragic business of being alive and in love.', 'http://books.google.com/books/content?id=UzqVUdEtLDwC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 15:25:04', '2016-09-14 19:25:31'),
