	(139, 'The Cartoon Introduction To Economics vol. 1', 'Grady Klein, Yoram Bauman', 211, 'cpanu5XCatoC', 'Provides an introduction to the principles of both microeconomics and macroeconmics that features graphic representations of key concepts.', 'http://books.google.com/books/content?id=cpanu5XCatoC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 15:05:26', '2017-04-15 15:05:26'),
	(140, 'Mad Magazine', 'Frank Jacobs', 57, NULL, NULL, NULL, '2016-09-16 13:23:31', '2016-09-16 13:23:31'),
	(141, 'Brian\'s Winter', 'Gary Paulsen', 133, '3kTp2qE3a6YC', 'Instead of being rescued from a plane crash, as in the author\'s book \"Hatchet,\" this story portrays what would have happened to Brian had he been forced to survive a winter in the wilderness with only his survival pack and hatchet.', 'http://books.google.com/books/content?id=3kTp2qE3a6YC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 15:26:16', '2016-09-16 13:27:19'),
	(142, 'Star Wars X-wing Rogue Squadron: In The Empire\'s Service', 'Michael A. Stackpole, John Nadeau, Jordi Ensign', 90, NULL, NULL, NULL, '2016-09-16 13:28:12', '2016-09-16 13:28:12'),
	(143, 'Un Wind', 'Neal Shusterman', 335, NULL, NULL, NULL, '2016-09-16 13:30:32', '2016-09-16 13:30:32'),
	(144, 'Planetes Vol. 1', 'Makoto Yukimura', 240, NULL, NULL, NULL, '2016-09-16 13:31:36', '2016-09-16 13:31:36'),
	(145, 'The Outsiders', 'S.E. Hinton', 180, NULL, NULL, NULL, '2016-09-20 19:46:08', '2016-09-16 13:33:58'),
	(146, 'Cirque Du Freak #5: Trials of Death', 'Darren Shan', 224, '4DQU53Y096gC', 'The trials: seventeen ways to die unless the luck of the vampire is with you. Darren Shan must pass five fearsome Trials to prove himself to the vampire clan ? or face the stakes of the Hall of Death. But Vampire Mountain holds hidden threats. Sinister, potent forces are gathering in the darkness. In this nightmarish world of bloodshed and betrayal, death may be a blessing...', 'http://books.google.com/books/content?id=4DQU53Y096gC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 15:27:11', '2016-09-16 14:12:02'),
	(147, 'Dog Days (Diary of a Wimpy Kid #4)', 'Jeff Kinney', 214, '7IljjSwdSAsC', 'It’s summer vacation, the weather’s great, and all the kids are having fun outside. So where’s Greg Heffley? Inside his house, playing video games with the shades drawn. Greg, a self-confessed “indoor person,” is living out his ultimate summer fantasy: no responsibilities and no rules. But Greg’s mom has a different vision for an ideal summer . . . one packed with outdoor activities and “family togetherness.” Whose vision will win out? Or will a new addition to the Heffley family change everything? F&P level: T', 'http://books.google.com/books/content?id=7IljjSwdSAsC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 15:27:44', '2016-09-16 14:14:46'),
	(148, 'DragonsBlood', 'Todd McCaffrey', 433, NULL, NULL, NULL, '2016-09-16 14:16:41', '2016-09-16 14:16:41'),
	(149, 'I funny a middle school story', 'james paterson', 303, NULL, NULL, NULL, '2016-09-16 14:18:17', '2016-09-16 14:18:17'),
	(150, 'Captain Underpants and the Preposterous Plight of the Purple Potty People', 'Dav Pilkey', 144, 'rIpIBAAAQBAJ', 'Captain Underpants returns to face his nemesis - the evil Capain Blunderpants - with the help of two new superheroes, Great-Granny Girdle and Boxer Boy. More laffs, evil, horror and high adventure. Complete with amazing Flip-o-Rama animation!', 'http://books.google.com/books/content?id=rIpIBAAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 15:28:35', '2016-09-16 14:24:08'),
	(151, 'The Martian: Classroom Edition', 'Andy Weir', 400, 'BGDhCwAAQBAJ', 'In the Classroom Edition of The Martian: Classroom-appropriate language Discussion questions and activities Q&A with Andy Weir Six days ago, astronaut Mark Watney became one of the first people to walk on Mars. Now, he\'s sure he\'ll be the first person to die there. After a dust storm nearly kills him and forces his crew to evacuate while thinking him dead, Mark finds himself stranded and completely alone with no way to even signal Earth that he\'s alive--and even if he could get word out, his supplies would be gone long before a rescue could arrive. Chances are, though, he won\'t have time to starve to death. The damaged machinery, unforgiving environment, or plain-old \"human error\" are much more likely to kill him first. But Mark isn\'t ready to give up yet. Drawing on his ingenuity, his engineering skills--and a relentless, dogged refusal to quit--he steadfastly confronts one seemingly insurmountable obstacle after the next. Will his resourcefulness be enough to overcome the impossible odds against him?', 'http://books.google.com/books/content?id=BGDhCwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 15:29:27', '2016-09-18 20:13:30'),
	(152, 'the misadventures of Max Crumbly Locker Hero', 'Rachel Russell', 302, NULL, NULL, NULL, '2016-09-19 10:26:11', '2016-09-19 10:26:11'),
	(153, 'Cardboard', 'Doug TenNapel', 288, NULL, NULL, NULL, '2016-09-19 14:15:23', '2016-09-19 14:15:23'),
	(154, 'Denton Little\'s Deathdate', 'Lance Rubin', 368, 'x9T9sgEACAAJ', 'Denton and his quirky friends are laugh-out-loud funny, even as their riotous adventures raise deeper questions about science, government control, life, and death.\" -- SLJ You only live once--unless you\'re Denton Little! Denton Little lives in a world exactly like our own except that everyone knows the day on which they will die. The good news: Denton has lived through his deathdate. Yay! The bad news: He\'s being chased by the DIA (Death Investigation Agency), he can never see his family again, and he may now die anytime. Huh. Cheating death isn\'t quite as awesome as Denton would have thought. . . . Lance Rubin\'s debut novel, Denton Little\'s Deathdate, showed readers just how funny and poignant imminent death could be. Now in this sequel, he takes on the big questions about life. How do we cope, knowing we could die at any time? Would you save someone from dying even if they were a horrible person? Is it wrong to kiss the girl your best friend is crushing on if she\'s really into you instead? What if she\'s wearing bacon lip gloss? Praise for Denton Little\'s Deathdate: \"Highly original, fantastically entertaining, and laugh-out-loud funny, Denton Little\'s Deathdate is a wild romp through a night like no other.\" --Jennifer E. Smith, author of The Geography of You and Me \"Let\'s all pray the grim reaper is even half as witty (and wise) as the deadly talented Lance Rubin. Till then: skip this book at your own peril.\" --Tim Federle, author of Better Nate than Ever and The Great American Whatever \"Rubin is really funny, but like John Green, he manages to be poignant. . . . In other words, it\'s a keeper. --Bustle', 'http://books.google.com/books/content?id=x9T9sgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '2017-04-15 15:30:21', '2016-09-19 14:19:03'),
	(155, 'The Third Planet From Altair', 'Edward Packard', 117, 'sgnEYgEACAAJ', 'The reader, en route to the third planet from Altair to seek the source and meaning of extraterrestrial messages, is given choices to make determining the course of the spacehsip and the survival of its crew', NULL, '2017-04-15 15:30:47', '2016-09-19 14:21:10'),
	(156, 'Ghosts of Onyx', 'Eric S. Nylund', 384, NULL, NULL, NULL, '2016-09-19 14:29:10', '2016-09-19 14:29:10'),
	(157, 'The Reinvention of Edison Thomas', 'Jacqueline Houtman', 192, 'tAe7DAAAQBAJ', 'Eddy\'s a science geek and has problems communicating with others. The combination gives the class bully, who pretends to be Eddy\'s friend, plenty of ammunition. Eddy Thomas can read a college physics book, but he can\'t read the emotions on the faces of his classmates. He can spend hours tinkering with an invention, but he can\'t stand more than a few minutes in a noisy crowd, like the crowd at the science fair, which Eddy fails to win. When the local school crossing guard is laid off, Eddy is haunted by thoughts of the potentially disastrous consequences and invents a traffic-calming device, using parts he has scavenged from discarded machines. By trusting his real friends, Eddy uses his talents to help others and rethinks his purely mechanical definition of success. Named to the Kansas State Reading Circle Recommended Reading List; CCBC--Best of the Year; Tofte/Wright Children\'s Literature Award; starred review in Library Media Connection.', 'http://books.google.com/books/content?id=tAe7DAAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 15:30:56', '2017-04-15 15:30:56'),
	(158, 'Treasure Hunters Peril at the top of the World', 'James Patterson, Chris Grabenstein', 384, 'kxKzCwAAQBAJ', 'Join the Kidds on their trek to exotic Russia and the dangerous Arctic as they outrun the bad guys in their search for stolen treasure. After their adventures in China and Germany, the Kidd family is ready for some rest and relaxation. But when you\'re an ace treasure hunting team, there\'s always another adventure waiting around the corner! This time, the Kidds head to Russia where a set of priceless paintings by Leonardo da Vinci and Rembrandt has gone missing. Hot on the trail of the daring thieves, the Kidds race through the sinister streets of St. Petersburg and the wild Arctic tundra to track down the stolen treasure. The action never stops with more chases, sneak attacks, spy missions, and doublecrossing than anyone can handle...except the Kidds!', 'http://books.google.com/books/content?id=kxKzCwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 15:30:56', '2017-04-15 15:30:56'),
	(159, 'Bone Vol. 1', 'Jeff Smith', 155, NULL, NULL, NULL, '2016-09-20 09:39:09', '2016-09-20 09:39:09'),
	(160, 'Bone Vol. 2', 'Jeff Smith, Steve Hamaker', 132, 'bPQARiu3M_wC', 'Before leaving the village of Barrelhaven, Phoney Bone risks everything on one last get-rich-quick scheme for the town\'s annual Great Cow Race, but as usual, Phoney\'s plans go disastrously awry. Tween.', 'http://books.google.com/books/content?id=bPQARiu3M_wC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 15:31:03', '2017-04-15 15:31:03'),
	(161, 'Breaking Dawn', 'Stephenie Meyer', 768, 'kcsqGna7fBIC', 'When you loved the one who was killing you, it left you no options. How could you run, how could you fight, when doing so would hurt that beloved one? If your life was all you had to give, how could you not give it? If it was someone you truly loved? To be irrevocably in love with a vampire is both fantasy and nightmare woven into a dangerously heightened reality for Bella Swan. Pulled in one direction by her intense passion for Edward Cullen, and in another by her profound connection to werewolf Jacob Black, a tumultuous year of temptation, loss, and strife have led her to the ultimate turning point. Her imminent choice to either join the dark but seductive world of immortals or to pursue a fully human life has become the thread from which the fates of two tribes hangs. Now that Bella has made her decision, a startling chain of unprecedented events is about to unfold with potentially devastating, and unfathomable, consequences. Just when the frayed strands of Bella\'s life-first discovered in Twilight, then scattered and torn in New Moon and Eclipse-seem ready to heal and knit together, could they be destroyed... forever? The astonishing, breathlessly anticipated conclusion to the Twilight Saga, Breaking Dawn illuminates the secrets and mysteries of this spellbinding romantic epic that has entranced millions.', 'http://books.google.com/books/content?id=kcsqGna7fBIC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 15:38:40', '2016-09-20 09:44:36'),
	(162, 'In God We Trust', 'Jean Shepherd', 272, 'cHpM9jx9roIC', 'A beloved, bestselling classic of humorous and nostalgic Americana, reissued in a strikingly designed paperback edition. Before Garrison Keillor and Spalding Gray there was Jean Shepherd: a master monologist and writer who spun the materials of his all-American childhood into immensely resonant--and utterly hilarious--works of comic art. In God We Trust: All Others Pay Cash represents one of the peaks of his achievement, a compound of irony, affection, and perfect detail that speaks across generations. In God We Trust, Shepherd\'s wildly witty reunion with his Indiana hometown, disproves the adage \"You can never go back.\" Bending the ear of Flick, his childhood-buddy-turned-bartender, Shepherd recalls passionately his genuine Red Ryder BB gun, confesses adolescent failure in the arms of Junie Jo Prewitt, and relives a story of man against fish that not even Hemingway could rival. From pop art to the World\'s Fair, Shepherd\'s subjects speak with a universal irony and are deeply and unabashedly grounded in American Midwestern life, together rendering a wonderfully nostalgic impression of a more innocent era when life was good, fun was clean, and station wagons roamed the earth. A comic genius who bridged the gap between James Thurber and David Sedaris, Shepherd may have accomplished for Holden, Indiana, what Mark Twain did for Hannibal, Missouri. From the Trade Paperback edition.', 'http://books.google.com/books/content?id=cHpM9jx9roIC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 15:39:14', '2016-09-20 09:45:31'),
	(163, 'Big Nate In The Zone', 'Lincoln Peirce', 216, 'kzF9lQEACAAJ', 'Big Nate is back the sixth instalment of his own super-funny series. Big Nate is created by Lincoln Peirce, who inspired Jeff Kinney, author of \'Diary of a Wimpy Kid\'.', 'http://books.google.com/books/content?id=kzF9lQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '2017-04-15 15:40:14', '2016-09-20 09:45:53'),
	(164, 'Ready Player One', 'Ernest Cline', 374, 'J8ahqXjUhAAC', 'Immersing himself in a mid-21st-century technological virtual utopia to escape an ugly real world of famine, poverty and disease, Wade Watts joins an increasingly violent effort to solve a series of puzzles by the virtual world\'s super-wealthy creator, who has promised that the winner will be his heir. (This book was previously listed in Forecast.)', 'http://books.google.com/books/content?id=J8ahqXjUhAAC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 15:40:40', '2016-09-20 09:45:58'),
	(165, 'Divergent (3) - Allegiant', 'Veronica Roth', 544, 'UC0pjgEACAAJ', 'What if your whole world was a lie? What if a single revelation - like a single choice - changed everything? What if love and loyalty made you do things you never expected?', 'http://books.google.com/books/content?id=UC0pjgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '2017-04-15 15:42:56', '2016-09-20 09:46:14'),
	(166, 'The CHRONICLES of Narnia Prince Caspian', 'C.S. LEWIS', 238, NULL, NULL, NULL, '2016-09-20 09:46:26', '2016-09-20 09:46:26'),
	(167, 'Bone', 'Jeff Smith', 117, '0eeACwAAQBAJ', NULL, 'http://books.google.com/books/content?id=0eeACwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 15:43:37', '2016-09-20 09:46:51'),
	(168, 'The Elegant Universe: Superstrings, Hidden Dimensions, and the Quest for the Ultimate Theory', 'Brian Greene', 464, 'okv_O0Xhl9gC', 'A new edition of the New York Times bestseller—now a three-part Nova special: a fascinating and thought-provoking journey through the mysteries of space, time, and matter. Now with a new preface (not in any other edition) that will review the enormous public reception of the relatively obscure string theory—made possible by this book and an increased number of adherents amongst physicists—The Elegant Universe \"sets a standard that will be hard to beat\" (New York Times Book Review). Brian Greene, one of the world\'s leading string theorists, peels away the layers of mystery surrounding string theory to reveal a universe that consists of eleven dimensions, where the fabric of space tears and repairs itself, and all matter—from the smallest quarks to the most gargantuan supernovas—is generated by the vibrations of microscopically tiny loops of energy. Today physicists and mathematicians throughout the world are feverishly working on one of the most ambitious theories ever proposed: superstring theory. String theory, as it is often called, is the key to the Unified Field Theory that eluded Einstein for more than thirty years. Finally, the century-old antagonism between the large and the small-General Relativity and Quantum Theory-is resolved. String theory proclaims that all of the wondrous happenings in the universe, from the frantic dancing of subatomic quarks to the majestic swirling of heavenly galaxies, are reflections of one grand physical principle and manifestations of one single entity: microscopically tiny vibrating loops of energy, a billionth of a billionth the size of an atom. In this brilliantly articulated and refreshingly clear book, Greene relates the scientific story and the human struggle behind twentieth-century physics\' search for a theory of everything. Through the masterful use of metaphor and analogy, The Elegant Universe makes some of the most sophisticated concepts ever contemplated viscerally accessible and thoroughly entertaining, bringing us closer than ever to understanding how the universe works.', 'http://books.google.com/books/content?id=okv_O0Xhl9gC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 15:44:20', '2016-09-20 09:47:36'),
	(169, '101 WAY TO BUG YOUR PARENTS', 'LEE WARDLAW', 199, NULL, NULL, NULL, '2016-09-20 09:47:42', '2016-09-20 09:47:42'),
	(170, 'Divergent', 'Veronica Roth', 487, NULL, NULL, NULL, '2016-09-20 09:48:03', '2016-09-20 09:48:03'),
	(171, 'The Scorch Trials', 'James Dashner', 361, 'arTZCwAAQBAJ', 'Read the second book in the #1 New York Times bestselling Maze Runner series that is now a motion picture and is perfect for fans of The Hunger Games and Divergent. This special movie tie-in trade paperback edition features a foreword by Wes Ball, the director of the movie, an eight-page full-color insert with photos from the film and an exclusive fan sticker. The first book, The Maze Runner, is also a movie featuring the star of MTV\'s Teen Wolf, Dylan O\'Brien; Kaya Scodelario; Aml Ameen; Will Poulter; and Thomas Brodie-Sangster! Also look for James Dashner\'s newest series: the Mortality Doctrine that includes The Eye of Minds and The Rule of Thoughts. Solving the Maze was supposed to be the end. Thomas was sure that escape from the Maze would mean freedom for him and the Gladers. But WICKED isn\'t done yet. Phase Two has just begun. The Scorch. There are no rules. There is no help. You either make it or you die. The Gladers have two weeks to cross through the Scorch--the most burned-out section of the world. And WICKED has made sure to adjust the variables and stack the odds against them. Friendships will be tested. Loyalties will be broken. All bets are off. There are others now. Their survival depends on the Gladers\' destruction--and they\'re determined to survive. Praise for the Maze Runner series: A #1 New York Times Bestselling Series A USA Today Bestseller A Kirkus Reviews Best Teen Book of the Year An ALA-YASLA Best Fiction for Young Adults Book An ALA-YALSA Quick Pick \"[A] mysterious survival saga that passionate fans describe as a fusion of Lord of the Flies, The Hunger Games, and Lost.\"--EW.com \"Wonderful action writing--fast-paced...but smart and well observed.\"--Newsday \"[A] nail-biting must-read.\"--Seventeen.com \"Breathless, cinematic action.\"--Publishers Weekly \"Heart pounding to the very last moment.\"--Kirkus Reviews \"Exclamation-worthy.\"--Romantic Times [STAR] \"James Dashner\'s illuminating prequel [The Kill Order] will thrill fans of this Maze Runner [series] and prove just as exciting for readers new to the series.\"--Shelf Awareness, Starred \"Take a deep breath before you start any James Dashner book.\"-Deseret News', 'http://books.google.com/books/content?id=arTZCwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 15:45:01', '2016-09-20 09:48:33'),
	(172, 'Big Nate Blasts Off', 'Lincoln Peirce', 224, 'hBswCwAAQBAJ', 'For fans of the hilarious Diary of a Wimpy Kid series, here comes the eighth novel in the New York Times bestselling series Big Nate. BIG NATE IS BLASTING OFF! Nate has a crush on Ruby. But after his scrap with Randy Betancourt makes headlines in the Weekly Bugle, he\'s got a problem WAY worse than detention! Can Nate bounce back? And will the annual Mud Bowl be a blast . . . or a bust? Meet BIG NATE, P.S. 38\'s coolest doodler and definitely NOT the teacher\'s pet.', 'http://books.google.com/books/content?id=hBswCwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 15:31:15', '2017-04-15 15:31:15'),
	(173, 'Star Wars Darth Vader', 'Kieron Larroco', 160, NULL, NULL, NULL, '2016-09-20 09:48:59', '2016-09-20 09:48:59'),
	(174, 'Middle School: Ultimate Showdown', 'James Patterson', 256, 'I3CnAgAAQBAJ', 'Readers get a chance to participate in James Patterson\'s wildly successful Middle School series in this interactive book featuring more than 80 hilarious anecdotes from dueling siblings Rafe and Georgia Khatchadorian - plus dozens of fun-filled activities! The Khatchadorian kids are an opinionated duo, and as readers of the Middle School stories know, they don\'t exactly see eye to eye. But when wild-card Rafe and mostly-straight-laced Georgia go at it, the only thing more fun than their ranting is getting to join in! Their back-and-forth banter on a range of topics - from bullying to cafeteria food to school dress codes - introduces more than 40 writing and drawing prompts and other games, along with room for readers to share their own points of view. (Includes over 200 illustrations.)', 'http://books.google.com/books/content?id=I3CnAgAAQBAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '2017-04-15 15:45:47', '2016-09-20 09:49:18'),
	(175, 'The Unwanteds', 'Lisa McMann', 390, 'dK5S9DlwxmsC', 'In a society that purges thirteen-year-olds who are creative, identical twins Aaron and Alex are separated, one to attend University while the other, supposedly Eliminated, finds himself in a wondrous place where youths hone their abilities and learn magic.', 'http://books.google.com/books/content?id=dK5S9DlwxmsC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 15:46:10', '2016-09-20 09:50:27'),
	(176, 'Message in a Bottle 2', 'Nicholas Sparks', 352, 'SquEmRGaluEC', 'Now with a new look celebrating 20 years of Nicholas Sparks! Divorced and disillusioned about relationships, Theresa Osborne is jogging when she finds a bottle on the beach. Inside is a letter of love and longing to \"Catherine,\" signed simply \"Garrett.\" Challenged by the mystery and pulled by emotions she doesn\'t fully understand, Theresa begins a search for this man that will change her life. What happens to her is unexpected, perhaps miraculous-an encounter that embraces all our hopes for finding someone special, for having a love that is timeless and everlasting.... Nicholas Sparks exquisitely chronicles the human heart. In his first bestselling novel, The Notebook, he created a testament to romantic love that touched readers around the world. Now in this New York Times bestseller, he renews our faith in destiny, in the ability of lovers to find each other no matter where, no matter when...', 'http://books.google.com/books/content?id=SquEmRGaluEC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 15:31:22', '2017-04-15 15:31:22'),
	(177, 'Naruto,  Vol. 1', 'Masashi Kishimoto', 192, 'J0VfQgAACAAJ', 'Best selling VIZ series Naruto, Volume 1 now reissued in an amazing fan-desirable collector\'s edition! Special edition features larger trim, sturdy deluxe hardcover binding and protective dust cover. Both new and collector fans will admire this edition. Naruto is a ninja-in-training with a need for attention, a knack for mischief and, sealed within him, a strange, formidable power. His antics amuse his instructor Kakashi and irritate his teammates, intense Sasuke and witty Sakura, but Naruto is serious about becoming the greatest ninja in the village of Konohagakure! Believe it!', 'http://books.google.com/books/content?id=J0VfQgAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '2017-04-15 15:46:47', '2016-09-20 09:52:17'),
	(178, 'Duplicity', 'Newt Gingrich & Pete Earley', 444, NULL, NULL, NULL, '2016-09-20 09:53:12', '2016-09-20 09:53:12'),
	(179, 'The Throne of Fire', 'Rick Riordan', 464, 'othICd7x3tMC', 'In this exciting second installment of the three-book series, Carter and Sadie, offspring of the brilliant Egyptologist Dr. Julius Kane, embark on a worldwide search for the Book of Ra, but the House of Life and the gods of chaos are determined to stop them.', 'http://books.google.com/books/content?id=othICd7x3tMC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 15:48:09', '2016-09-20 09:54:02'),
	(180, 'Charlotte\'s Web', 'E.B. White', 192, NULL, NULL, NULL, '2016-09-20 09:54:37', '2016-09-20 09:54:37'),
