	(182, 'The Ugly Truth (Diary of a Wimpy Kid #5)', 'Jeff Kinney', 224, 'BTM7iwk64VgC', 'Greg Heffley has always been in a hurry to grow up. But is getting older really all it’s cracked up to be? Greg suddenly finds himself dealing with the pressures of boy-girl parties, increased responsibilities, and even the awkward changes that come with getting older—all without his best friend, Rowley, at his side. Can Greg make it through on his own? Or will he have to face the “ugly truth”?', 'http://books.google.com/books/content?id=BTM7iwk64VgC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 15:49:07', '2016-09-20 09:55:52'),
	(183, 'The Death Cure (Maze Runner, Book Three)', 'James Dashner', 336, '8t5GVWLo_eEC', 'Book three in the blockbuster Maze Runner series that spawned a movie franchise and ushered in a worldwide phenomenon! And don’t miss The Fever Code, the highly-anticipated series conclusion that finally reveals the story of how the maze was built! It’s the end of the line. WICKED has taken everything from Thomas: his life, his memories, and now his only friends—the Gladers. But it’s finally over. The trials are complete, after one final test. Will anyone survive? What WICKED doesn’t know is that Thomas remembers far more than they think. And it’s enough to prove that he can’t believe a word of what they say. The truth will be terrifying. Thomas beat the Maze. He survived the Scorch. He’ll risk anything to save his friends. But the truth might be what ends it all. The time for lies is over. The Maze Runner and Maze Runner: The Scorch Trials are now major motion pictures featuring the star of MTV\'s Teen Wolf, Dylan O’Brien; Kaya Scodelario; Aml Ameen; Will Poulter; and Thomas Brodie-Sangster. The third movie, Maze Runner: The Death Cure, will hit screens in 2018. Also look for James Dashner’s edge-of-your-seat MORTALITY DOCTRINE series! Praise for the Maze Runner series: A #1 New York Times Bestselling Series A USA Today Bestseller A Kirkus Reviews Best Teen Book of the Year An ALA-YASLA Best Fiction for Young Adults Book An ALA-YALSA Quick Pick “[A] mysterious survival saga that passionate fans describe as a fusion of Lord of the Flies, The Hunger Games, and Lost.” —EW.com “Wonderful action writing—fast-paced…but smart and well observed.” —Newsday “[A] nail-biting must-read.” —Seventeen.com “Breathless, cinematic action.” —Publishers Weekly “Heart pounding to the very last moment.” —Kirkus Reviews “Exclamation-worthy.” —Romantic Times “James Dashner’s illuminating prequel [The Kill Order] will thrill fans of this Maze Runner [series] and prove just as exciting for readers new to the series.” —Shelf Awareness, Starred “Take a deep breath before you start any James Dashner book.” —Deseret News From the Hardcover edition.', 'http://books.google.com/books/content?id=8t5GVWLo_eEC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 15:49:37', '2016-09-20 09:56:23'),
	(184, 'The Hunger Games', 'Suzanne Collins', 374, 'Yz8Fnw0PlEQC', 'The book no one can stop talking about . . . In the ruins of a place once known as North America lies the nation of Panem, a shining Capitol surrounded by twelve outlying districts. The Capitol is harsh and cruel and keeps the districts in line by forcing them all to send one boy and one girl between the ages of twelve and eighteen to participate in the annual Hunger Games, a fight to the death on live TV. Sixteen-year-old Katniss Everdeen, who lives alone with her mother and younger sister, regards it as a death sentence when she is forced to represent her district in the Games. But Katniss has been close to dead and survival, for her, is second nature. Without really meaning to, she becomes a contender. But if she is to win, she will have to start making choices that weigh survival against humanity and life against love. New York Times bestselling author Suzanne Collins delivers equal parts suspense and philosophy, adventure and romance, in this searing novel set in a future with unsettling parallels to our present.', 'http://books.google.com/books/content?id=Yz8Fnw0PlEQC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 15:51:17', '2016-09-20 09:56:30'),
