	(197, 'Pokemon Adventures', 'Hidenori Kusaka', 208, 'EKoGAAAACAAJ', 'In this latest illustrated adventure, based on the original Game Boy game, as Bill and Lt. Surge face their darkest hour, help unexpectedly comes from Red! Then, high above the caves of Cerise Island, Blaine and Yellows battle against Lance intensifies as both sides bring out the most powerful Pokemon in their arsenals. Just as victory seems within reach, Blaines time runs out with Mewtwo. Ultimately, its up to Yellow to finish the job.', 'http://books.google.com/books/content?id=EKoGAAAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '2017-04-15 15:53:21', '2016-09-20 10:11:20'),
