	(200, 'Somewhere In The Darkness', 'Walter Dean Myers', 168, 'JgldIwWfVwgC', 'A teenage boy accompanies his father, who has recently escaped from prison, on a trip that turns out to be a time of often painful discovery for them both.', 'http://books.google.com/books/content?id=JgldIwWfVwgC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 15:53:28', '2017-04-15 15:53:28'),
	(201, 'Crank', 'Ellen Hopkins', 537, NULL, NULL, NULL, '2016-09-20 11:45:24', '2016-09-20 11:45:24'),
	(202, 'Boy Meets Boy', 'David Levithan', 240, 'RW8012_TGRwC', 'This is the story of Paul, a sophomore at a high school like no other: The cheerleaders ride Harleys, the homecoming queen used to be a guy named Daryl (she now prefers Infinite Darlene and is also the star quarterback), and the gay-straight alliance was formed to help the straight kids learn how to dance. When Paul meets Noah, he thinks he’s found the one his heart is made for. Until he blows it. The school bookie says the odds are 12-to-1 against him getting Noah back, but Paul’s not giving up without playing his love really loud. His best friend Joni might be drifting away, his other best friend Tony might be dealing with ultra-religious parents, and his ex-boyfriend Kyle might not be going away anytime soon, but sometimes everything needs to fall apart before it can really fit together right. This is a happy-meaningful romantic comedy about finding love, losing love, and doing what it takes to get love back in a crazy-wonderful world.', 'http://books.google.com/books/content?id=RW8012_TGRwC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 15:54:11', '2017-04-15 15:54:11'),
	(203, 'The Final Storm', 'Jeff Shaara', 446, 'KdzJTdnqXVAC', 'When the United States military targets the island of Okinawa as part of a plan to halt conflicts that are inflicting massive casualties on both sides, B-29 pilot Paul Tibbets accepts a mission with world-changing implications.', 'http://books.google.com/books/content?id=KdzJTdnqXVAC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 15:54:23', '2017-04-15 15:54:23'),
	(204, 'World War Z', 'Max Brooks', 342, 'aq6YMQEACAAJ', NULL, NULL, '2017-04-15 15:55:22', '2016-09-20 11:53:51'),
	(205, 'Cress', 'Marissa Meyer', 560, 'LUyeAgAAQBAJ', 'Working to overthrow Queen Levana, a fugitive Cinder and her companions search for Rapunzel-like hacker Cress, who has been trapped on a satellite since childhood and who has received orders from Levana to foil Cinder\'s efforts. By the best-selling author of Scarlet.', 'http://books.google.com/books/content?id=LUyeAgAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 15:56:07', '2016-09-20 11:54:54'),
	(206, 'Winter', 'Marissa Meyer', 827, NULL, NULL, NULL, '2016-09-20 11:56:18', '2016-09-20 11:56:18'),
	(207, 'The Sea of Monsters', 'Rick Riordan', 304, 'Y39JAQAAIAAJ', 'When Camp Half-Blood, the only safe haven for demigods, comes close to being overrun by mythological monsters, Percy must find his best friend Grover, who is prisoner on an island in the Bermuda Triangle, and then set out to save the Camp.', 'http://books.google.com/books/content?id=Y39JAQAAIAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '2017-04-15 16:01:19', '2016-09-20 11:58:32'),
	(208, 'Titan\'s Curse, The (Percy Jackson and the Olympians, Book 3)', 'Rick Riordan', 336, 'xszg4sndpVwC', 'When the goddess Artemis goes missing, she is believed to have been kidnapped. And now it\'s up to Percy and his friends to find out what happened. Who is powerful enough to kidnap a goddess?', 'http://books.google.com/books/content?id=xszg4sndpVwC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:02:26', '2016-09-20 11:59:38'),
	(209, 'The Battle of the Labyrinth', 'Rick Riordan', 361, 'SRFuuAAACAAJ', 'Percy Jackson isn\'t expecting freshman orientation to be any fun. But when a mysterious mortal acquaintance appears on campus, followed by demon cheerleaders, things quickly move from bad to diabolical. In this latest installment of the blockbuster series, time is running out as war between the Olympians and the evil Titan lord Kronos draws near. Even the safe haven of Camp Half-Blood grows more vulnerable by the minute as Kronos\'s army prepares to invade its once impenetrable borders. To stop them, Percy and his demigod friends must set out on a quest through the Labyrinth--a sprawling underground world with stunning surprises at every turn. Full of humor and heart-pounding action, this fourth book promises to be their most thrilling adventure yet.', 'http://books.google.com/books/content?id=SRFuuAAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '2017-04-15 16:02:50', '2016-09-20 12:01:04'),
	(210, 'Misery', 'Stephen King', 369, '00_8nAEACAAJ', 'Misery Chastain was dead. Paul Sheldon had just killed her - with relief, with joy. Misery had made him rich; she was the heroine of a string of bestsellers. And now he wanted to get on to some real writing. That\'s when the car accident happened, and he woke up in pain in a strange bed. But it wasn\'t the hospital. Annie Wilkes had pulled him from the wreck, brought him to her remote mountain home, splinted and set his mangled legs. The good news was that Annie was a nurse and has pain-killing drugs. The bad news was that she was Paul\'s Number One Fan. And when she found out what Paul had done to Misery, she didn\'t like it. She didn\'t like it at all. And now he had to bring Misery back to life. Or else...', 'http://books.google.com/books/content?id=00_8nAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '2017-04-15 16:03:18', '2016-09-20 12:03:46'),
	(211, 'This One Summer', 'Jillian and Mariko Tamaki', 319, NULL, NULL, NULL, '2016-09-20 12:11:14', '2016-09-20 12:11:14'),
	(212, 'Matched', 'Ally Condie', 366, '6LeTAQAACAAJ', 'Cassia has always trusted the Society to make the right choices for her: what to read, what to watch, what to believe. So when Xander\'s face appears on-screen at her Matching ceremony, Cassia knows with complete certainty that he is her ideal mate ... until she sees Ky Markham\'s face flash for an instant before the screen fades to black. The Society tells her it\'s a glitch, a rare malfunction, and that she should focus on the happy life she\'s destined to lead with Xander. But Cassia can\'t stop thinking about Ky, and as they slowly fall in love, Cassia begins to doubt the Society\'s infallibility and is faced with an impossible choice: between Xander and Ky, between the only life she\'s known and a path that no one else has dared to follow.', NULL, '2017-04-15 16:03:35', '2016-09-20 12:17:39'),
	(213, 'we are the ants', 'shaun david hutchinson', 335, NULL, NULL, NULL, '2016-09-20 14:36:14', '2016-09-20 14:36:14'),
	(214, 'Hidden Talents', 'David Lubar', 256, 'XHVhCQAAQBAJ', 'A debut young adult novel from a popular children\'s author tells the story of thirteen-year-old Martin Anderson, who arrives at the Edgewater Alternative School as an outcast but quickly finds his place among other teens with strange gifts. 15,000 first printing.', 'http://books.google.com/books/content?id=XHVhCQAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 15:58:33', '2017-04-15 15:58:33'),
