	(218, 'If You´re Reading This, It´s To Late', 'Pseudonymous Bosch', 385, 'jHlaAAAAYAAJ', 'Cass and Max-Ernest discover the Museum of Magic, unscramble more coded messages, and solve new mysteries in their attempt to thwart the Terces Society\'s ambitions of discovering immortality.', 'http://books.google.com/books/content?id=jHlaAAAAYAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '2017-04-15 15:58:36', '2017-04-15 15:58:36'),
	(219, 'Suicide Squad', 'David Ayer', 375, NULL, NULL, NULL, '2016-09-20 14:40:16', '2016-09-20 14:40:16'),
	(220, 'In Real Life', 'Jessica Love', 240, 'UaVwCwAAQBAJ', 'Hannah Cho and Nick Cooper have been best friends since 8th grade. They talk for hours on the phone, regularly shower each other with presents, and know everything there is to know about one another. There\'s just one problem: Hannah and Nick have never actually met. Hannah has spent her entire life doing what she\'s supposed to, but when her senior year spring break plans get ruined by a rule-breaker, she decides to break a rule or two herself. She impulsively decides to road trip to Vegas, her older sister and BFF in tow, to surprise Nick and finally declare her more-than-friend feelings for him. Hannah\'s romantic gesture backfires when she gets to Vegas and meets Nick\'s girlfriend, whom he failed to mention. And it turns out his relationship status isn\'t the only thing he\'s been lying to her about. Hannah knows the real Nick can\'t be that different from the online Nick she knows and loves, but now she only has one night in Sin City to figure out what her feelings for Nick really are, all while discovering how life can change when you break the rules every now and then.', 'http://books.google.com/books/content?id=UaVwCwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 15:58:38', '2017-04-15 15:58:38'),
	(221, 'dragon ball z vol.14', 'Akira Toriyama', 77, NULL, NULL, NULL, '2016-09-20 14:41:38', '2016-09-20 14:41:38'),
	(222, 'The Thing About Jellyfish', 'Ali Benjamin', 352, 'rooQBgAAQBAJ', 'This stunning debut novel about grief and wonder was an instant New York Times bestseller and captured widespread critical acclaim, including selection as a 2015 National Book Award finalist! Oddlot Entertainment has acquired the screen rights to The Thing About Jellyfish, with Gigi Pritzker set to produce with Bruna Papandrea and Reese Witherspoon. After her best friend dies in a drowning accident, Suzy is convinced that the true cause of the tragedy must have been a rare jellyfish sting-things don\'t just happen for no reason. Retreating into a silent world of imagination, she crafts a plan to prove her theory--even if it means traveling the globe, alone. Suzy\'s achingly heartfelt journey explores life, death, the astonishing wonder of the universe...and the potential for love and hope right next door.', 'http://books.google.com/books/content?id=rooQBgAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 15:58:40', '2017-04-15 15:58:40'),
	(223, 'Artemis Fowl', 'Eoin Colfer', 304, 'D9TKSKS74MwC', 'Twelve-year-old Artemis is a millionaire, a genius-and above all, a criminal mastermind. But Artemis doesn\'t know what he\'s taken on when he kidnaps a fairy, Captain Holly Short of the LEPrecon Unit. These aren\'t the fairies of the bedtime stories-they\'re dangerous! http://books.google.com/books/content?id=D9TKSKS74MwC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api\ntitle Eternity Code, The (Artemis Fowl, Book 3) Eoin Colfer fnJ4t979fFIC pages 320 Artemis Fowl is going straight-as soon as he pulls off the most brilliant criminal feat of his career... but his plan goes awry, leaving his loyal bodyguard, Butler, mortally injured. Artemis knows his only hope to save Butler lies in fairy magic, so once again he is forced to contact his old rival, Captain Holly Short of the LEPrepcon fairy police. Miraculously, Butler is healed, but there is a catch: he has aged fifteen years.', 'http://books.google.com/books/content?id=fnJ4t979fFIC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:04:33', '2016-09-20 14:44:30'),
	(224, 'Four', 'Veronica Roth', 208, NULL, NULL, NULL, '2016-09-20 14:44:37', '2016-09-20 14:44:37'),
	(225, 'The Sword of Summer', 'Rick Riordan', 512, 'mgEprgEACAAJ', 'Magnus Chase has always been a troubled kid. Since his mother\'s mysterious death, he\'s lived alone on the streets of Boston, surviving by his wits, keeping one step ahead of the police and the truant officers. One day, he\'s tracked down by an uncle he\'s never met-a man his mother claimed was dangerous. His uncle tells him an impossible secret: Magnus is the son of a Norse god. The Viking myths are true. The gods of Asgard are preparing for war. Trolls, giants and worse monsters are stirring for doomsday. To prevent Ragnarok, Magnus must search the Nine Worlds for a weapon that has been lost for thousands of years. When an attack by fire giants forces him to choose between his own safety and the lives of hundreds of innocents, Magnus makes a fatal decision. Sometimes, the only way to start a new life is to die . . . This limited edition is numbered and signed by the author. It comes in a full-color case and has specially designed endpapers and a full-color frontispiece.', 'http://books.google.com/books/content?id=mgEprgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '2017-04-15 16:05:39', '2016-09-20 14:45:06'),
	(226, 'anyas ghost', 'Vera Brosgol', 224, NULL, NULL, NULL, '2016-09-20 14:46:02', '2016-09-20 14:46:02'),
	(227, 'the music man junior', 'meredith willson', 54, NULL, NULL, NULL, '2016-09-20 17:28:29', '2016-09-20 17:28:29'),
	(228, 'Military history', 'DK SMITHSONIAN', 441, NULL, NULL, NULL, '2016-09-20 18:47:36', '2016-09-20 18:47:36'),
	(229, 'Endgame The Calling', 'James Frey and Nils Johnson-Shelton', 465, NULL, NULL, NULL, '2016-09-20 19:14:12', '2016-09-20 19:14:12'),
	(230, 'Serena', 'Ron Rash', 400, 'w2wNVme0_rEC', 'The year is 1929, and newlyweds George and Serena Pemberton travel from Boston to the North Carolina mountains where they plan to create a timber empire. Although George has already lived in the camp long enough to father an illegitimate child, Serena is new to the mountains—but she soon shows herself to be the equal of any man, overseeing crews, hunting rattle-snakes, even saving her husband\'s life in the wilderness. Together this lord and lady of the woodlands ruthlessly kill or vanquish all who fall out of favor. Yet when Serena learns that she will never bear a child, she sets out to murder the son George fathered without her. Mother and child begin a struggle for their lives, and when Serena suspects George is protecting his illegitimate family, the Pembertons\' intense, passionate marriage starts to unravel as the story moves toward its shocking reckoning. Rash\'s masterful balance of violence and beauty yields a riveting novel that, at its core, tells of love both honored and betrayed.', 'http://books.google.com/books/content?id=w2wNVme0_rEC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 15:58:47', '2017-04-15 15:58:47'),
	(231, 'Ranger\'s Apprentice Erak\'s Ransom', 'John Flanagan', 373, NULL, NULL, NULL, '2016-09-21 09:58:59', '2016-09-21 09:58:59'),
	(232, 'we are the ants (correct version)', 'shaun david hutchinson', 451, NULL, NULL, NULL, '2016-09-21 09:59:50', '2016-09-21 09:59:50'),
	(233, 'The Lovely Bones', 'Alice Sebold', 336, 'GKc2mPfcZ8AC', 'Once in a generation a novel comes along that taps a vein of universal human experience, resonating with readers of all ages. The Lovely Bones is such a book - a phenomenal #1 bestseller celebrated at once for its narrative artistry, its luminous clarity of emotion, and its astoniishing power to lay claim to the hearts of millions of readers around the world. \"My name was Salmon, like the fish; first name, Susie. I was fourteen when I was murdered on December 6, 1973.\" So begins the story of Susie Salmon, who is adjusting to her new home in heaven, a place that is not at all what she expected, even as she is watching life on eath continue without her - her friends trading rumors about her disappearance, her killer trying to cover his tracks, her grief-stricken family unraveling. Out of unspeakable traged and loss, The Lovely Bones succeeds, miraculously, in building a tale filled with hope, humor, suspense, even joy \"A stunning achievement.\" -The New Yorker \"Deeply affecting. . . . A keenly observed portrait of familial love and how it endures and changes over time.\" -New York Times \"A triumphant novel. . . . It\'s a knockout.\" -Time \"Destined to become a classic in the vein of To Kill a Mockingbird. . . . I loved it.\" -Anna Quindlen \"A novel that is painfully fine and accomplished.\" -Los Angeles Times \"The Lovely Bones seems to be saying there are more important things in life on earth than retribution. Like forgiveness, like love.\" -Chicago Tribune', 'http://books.google.com/books/content?id=GKc2mPfcZ8AC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:06:25', '2016-09-21 10:01:18'),
	(234, 'Big Nate\'s Greatest Hits', 'Lincoln Peirce', 376, 'qa6ooAEACAAJ', 'Follows the adventures of self-described middle school genius Nate Wright, including having an imaginary near-death experience, creating an episode of \"Doctor Cesspool,\" and meeting the girl of his dreams at summer school.', 'http://books.google.com/books/content?id=qa6ooAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '2017-04-15 16:06:58', '2016-09-21 10:02:39'),
	(235, 'Ranger\'s Apprentice The Siege Of Macindaw', 'John Flanagan', 293, NULL, NULL, NULL, '2016-09-21 10:02:44', '2016-09-21 10:02:44'),
	(236, 'If I fall if I die', 'Michael Christie', 18, NULL, NULL, NULL, '2016-09-21 10:02:52', '2016-09-21 10:02:52'),
	(237, 'Dragon Ball vol.14', 'Akira Toriyama', 187, 'ORfwAQAAQBAJ', 'Our heroes\' worst fears have come true: androids #17 and #18,who in time traveler Trunks\'s future have already destroyed the world, have been activated! And along with them is #16, an android even Trunks doesn\'t know! With Goku almost dead from a virus, only Super Saiyan Vegeta has a chance against them--unless Piccolo\'s plan to merge with his ancient enemy Kami-sama will make him the new strongest being on Earth! But something even worse than androids has come back from the future... -- VIZ Media', 'http://books.google.com/books/content?id=ORfwAQAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:07:38', '2016-09-21 10:03:01'),
	(238, 'The Body of Christopher Creed', 'Carol Plum-Ucci', 259, 'hYVBulFN12MC', 'Torey Adams, a high school junior with a seemingly perfect life, struggles with doubts and questions surrounding the mysterious disappearance of the class outcast.', 'http://books.google.com/books/content?id=hYVBulFN12MC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:07:49', '2017-04-15 15:58:53'),
	(239, 'If I Fall, If I Die', 'Michael CHristie', 323, NULL, NULL, NULL, '2017-04-15 16:07:56', '2016-09-21 10:04:15'),
	(240, 'The One And Only Ivan', 'K. A. Applegate', 307, NULL, NULL, NULL, '2016-09-21 10:04:29', '2016-09-21 10:04:29'),
	(241, 'The Stars Of Summer', 'Tara Dairman', 352, '9CFhDQAAQBAJ', 'Joan Bauer meets Ruth Reichl--Tara Dairman\'s charming sequel to All Four Stars brings Gladys Gatsby to summer camp. In this charming sequel to All Four Stars, eleven-year-old foodie Gladys Gatsby now has her first published review under her belt and is looking forward to a quiet summer of cooking and reviewing. But her plans quickly go awry when her friend Charissa Bentley delivers Gladys\'s birthday gift: a free summer at Camp Bentley. As Gladys feared, camp life is not easy: she struggles to pass her swim test and can\'t keep the other campers happy while planning lunches. The worst part is she can\'t seem to sneak away for her latest assignment--finding the best hot dog in New York City. Could this summer be the end Gladys\'s reviewing career? \"A scrumptious gem of a story!\"--Jennifer A. Nielsen, New York Times bestselling author of The False Prince for All Four Stars', 'http://books.google.com/books/content?id=9CFhDQAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 15:58:57', '2017-04-15 15:58:57'),
	(242, 'Persepolis: The Story of a Childhood', 'Marjane Satrapi', 160, 'g0s_DAAAQBAJ', 'Wise, often funny, sometimes heartbreaking, Persepolis tells the story of Marjane Satrapi\'s life in Tehran from the ages of six to fourteen, years that saw the overthrow of the Shah\'s regime, the triumph of the Islamic Revolution and the devastating effects of war with Iraq. The intelligent and outspoken child of radical Marxists, and the great-grandaughter of Iran\'s last emperor, Satrapi bears witness to a childhood uniquely entwined with the history of her country. Persepolis paints an unforgettable portrait of daily life in Iran and of the bewildering contradictions between home life and public life. Amidst the tragedy, Marjane\'s child\'s eye view adds immediacy and humour, and her story of a childhood at once outrageous and ordinary, beset by the unthinkable and yet buffered by an extraordinary and loving family, is immensely moving. It is also very beautiful; Satrapi\'s drawings have the power of the very best woodcuts.', 'http://books.google.com/books/content?id=g0s_DAAAQBAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '2017-04-15 15:58:57', '2017-04-15 15:58:57'),
	(243, 'Rangers Apprentice The Ruins Of Gorlan', 'John Flanagan', 249, NULL, NULL, NULL, '2016-09-21 10:10:49', '2016-09-21 10:10:49'),
	(244, 'Roller Girl', 'Victoria Jamieson', 240, '_ovMAwAAQBAJ', 'The Newbery Honor Award Winner and New York Times bestseller Roller Girl is a heartwarming graphic novel about friendship and surviving junior high through the power of roller derby—perfect for fans of Raina Telgemeier\'s Smile! For most of her twelve years, Astrid has done everything with her best friend Nicole. But after Astrid falls in love with roller derby and signs up for derby camp, Nicole decides to go to dance camp instead. And so begins the most difficult summer of Astrid\'s life as she struggles to keep up with the older girls at camp, hang on to the friend she feels slipping away, and cautiously embark on a new friendship. As the end of summer nears and her first roller derby bout (and junior high!) draws closer, Astrid realizes that maybe she is strong enough to handle the bout, a lost friendship, and middle school… in short, strong enough to be a roller girl. In this graphic novel debut that earned a Newbery Honor and five starred reviews, real-life derby girl Victoria Jamieson has created an inspiring coming-of-age story about friendship, perseverence, and girl power! From the Trade Paperback edition.', 'http://books.google.com/books/content?id=_ovMAwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 15:58:58', '2017-04-15 15:58:58'),
	(245, 'test book', 'Parliamentary test book', 0, 'gNPCfI35vVsC', NULL, 'http://books.google.com/books/content?id=gNPCfI35vVsC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 15:58:59', '2017-04-15 15:58:59'),
	(246, 'Where the Sidewalk Ends', 'Shel Silverstein', 176, '_fXZe-dKiz8C', 'If you are a dreamer, come in, If you are a dreamer, A wisher, a liar, A hope-er, a pray-er, A magic bean buyer … Come in … for where the sidewalk ends, Shel Silverstein’s world begins. You’ll meet a boy who turns into a TV set, and a girl who eats a whale. The Unicorn and the Bloath live there, and so does Sarah Cynthia Sylvia Stout who will not take the garbage out. It is a place where you wash your shadow and plant diamond gardens, a place where shoes fly, sisters are auctioned off, and crocodiles go to the dentist. Shel Silverstein’s masterful collection of poems and drawings is at once outrageously funny and profound.', 'http://books.google.com/books/content?id=_fXZe-dKiz8C&printsec=frontcover&img=1&zoom=1&source=gbs_api', '2017-04-15 16:09:08', '2016-09-21 19:28:35'),
	(247, 'Inkspell', 'Cornelia Funke', 545, 'TGtlBAAAQBAJ', 'Although a year has passed, not a day goes by without Meggie thinking of the extraordinary events of Inkheart, and the story whose characters strode out of the pages, and changed her life forever. But for Dustfinger, the fire-eater, torn from his world of words, the need to return has become desperate. When he finds a crooked storyteller with the magical ability to read him back, he sets in motion a dangerous reversal that sees the characters of Inkheart transported to a charmed Inkworld, about to be fought over by rival rebels and princes. But can Meggie, Farid and Fenoglio \'write\' the wrongs of a charmed world about to be fought over by rival princes and rebels?', 'http://books.google.com/books/content?id=TGtlBAAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 15:59:01', '2017-04-15 15:59:01'),
	(248, 'Inkdeath', 'Cornelia Funke', 568, 'G6Z8BgAAQBAJ', 'Life in the Inkworld has been far from easy since the extraordinary events of Inkspell, when the story of Inkheart magically drew Meggie, Mo and Dustfinger back into its pages. With Dustfinger dead, and the evil Adderhead now in control, the story in which they are all caught has taken an unhappy turn. Even Elinor, left alone in the real world, believes her family to be lost - lost between the covers of a book. But as winter comes on there is reason to hope - if only Meggie and Mo can rewrite the wrongs of the past and make a dangerous pact with death. The Final Book in the Inkheart Trilogy.', 'http://books.google.com/books/content?id=G6Z8BgAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 15:59:01', '2017-04-15 15:59:01'),
	(249, 'Seraphina', 'Rachel Hartman', 512, 'sxsDkcDpWckC', 'Lyrical, imaginative, and wholly original, this New York Times bestseller with 8 starred reviews is not to be missed. Rachel Hartman’s award-winning debut will have you looking at dragons as you’ve never imagined them before… In the kingdom of Goredd, dragons and humans live and work side by side – while below the surface, tensions and hostility simmer. The newest member of the royal court, a uniquely gifted musician named Seraphina, holds a deep secret of her own. One that she guards with all of her being. When a member of the royal family is brutally murdered, Seraphina is drawn into the investigation alongside the dangerously perceptive—and dashing—Prince Lucien. But as the two uncover a sinister plot to destroy the wavering peace of the kingdom, Seraphina’s struggle to protect her secret becomes increasingly difficult… while its discovery could mean her very life. \"Will appeal to both fans of Christopher Paolini’s Eragon series and Robin McKinley’s The Hero and the Crown.\" —Entertainment Weekly “[A] lush, intricately plotted fantasy.” —The Washington Post \"Beautifully written. Some of the most interesting dragons I\'ve read.\" —Christopher Paolini, New York Times bestselling author of Eragon From the Hardcover edition.', 'http://books.google.com/books/content?id=sxsDkcDpWckC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 15:59:01', '2017-04-15 15:59:01'),
	(250, 'The Blood of Olympus', 'Rick Riordan', 544, 'tLM7jwEACAAJ', 'Though the Greek and Roman crewmembers of the \"Argo II\" have made progress in their many quests, they still seem no closer to defeating the earth mother, Gaea. Her giants have risen-all of them-and they\'re stronger than ever. They must be stopped before the Feast of Spes, when Gaea plans to have two demigods sacrificed in Athens. She needs their blood-the blood of Olympus-in order to wake. The demigods are having more frequent visions of a terrible battle at Camp Half-Blood. The Roman legion from Camp Jupiter, led by Octavian, is almost within striking distance. Though it is tempting to take the Athena Parthenos to Athens to use as a secret weapon, the friends know that the huge statue belongs back on Long Island, where it \"might\" be able to stop a war between the two camps. The Athena Parthenos will go west; the \"Argo II\" will go east. The gods, still suffering from multiple personality disorder, are useless. How can a handful of young demigods hope to persevere against Gaea\'s army of powerful giants? As dangerous as it is to head to Athens, they have no other option. They have sacrificed too much already. And if Gaea wakes, it is game over.', 'http://books.google.com/books/content?id=tLM7jwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '2017-04-15 16:09:54', '2016-09-22 12:19:30'),
	(251, 'pokemon emerald adventures', 'Hidenori Kusaka', 206, '8WncjgEACAAJ', 'Awesome adventures inspired by the best-selling Pokmon video games bring favorite Pokmon characters leaping off the screen and into the pages of this action-packed manga!', 'http://books.google.com/books/content?id=8WncjgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '2017-04-15 15:59:03', '2017-04-15 15:59:03'),
	(252, 'Gone Girl', 'Gillian Flynn', 432, 'mmWODQAAQBAJ', 'When a woman goes missing on her fifth wedding anniversary, her diary reveals hidden turmoil in her marriage, while her husband, desperate to clear himself of suspicion, realizes that something more disturbing than murder may have occurred.', 'http://books.google.com/books/content?id=mmWODQAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:10:27', '2016-09-22 14:00:40'),
	(253, 'The Walking Dead Compendium One', 'Robert Kirkman, Charles Adlard, Tony Moore, Cliff Rathburn', 1088, '2ZP4PQAACAAJ', 'Introducing the first eight volumes of this fan-favorite series collected into one massive 1088 page paperback collection! Collects The Walking Dead #1-48.', 'http://books.google.com/books/content?id=2ZP4PQAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '2017-04-15 15:59:05', '2017-04-15 15:59:05'),
	(254, 'City of the Beasts', 'Isabel Allende', 406, 'Vv2DPwAACAAJ', 'When 15-year-old Alexander Cold accompanies his individualistic grandmother on an expedition to find a Beast in the Amazon, he experiences ancient wonders and a supernatural world as he tries to avert disaster for the Indians.', 'http://books.google.com/books/content?id=Vv2DPwAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '2017-04-15 15:59:06', '2017-04-15 15:59:06'),
	(255, 'Small Steps', 'Louis Sachar', 288, 'xQ9U42Pt_88C', 'Two years after being released from Camp Green Lake, Armpit is home in Austin, Texas, trying to turn his life around. But it’s hard when you have a record, and everyone expects the worst from you. The only person who believes in him is Ginny, his 10-year old disabled neighbour. Together, they are learning to take small steps. And he seems to be on the right path, until X-Ray, a buddy from Camp Green Lake, comes up with a get-rich-quick scheme. This leads to a chance encounter with teen pop sensation, Kaira DeLeon, and suddenly his life spins out of control, with only one thing for certain. He’ll never be the same again. In his first major novel since Holes, critically acclaimed novelist Louis Sachar uses his signature wit combined with a unique blend of adventure and deeply felt characters to explore issues of race, the nature of celebrity, the invisible connections that determine a person’s life, and what it takes to stay on course. Doing the right thing is never a wrong choice – but a small step in the right direction. From the Hardcover edition.', 'http://books.google.com/books/content?id=xQ9U42Pt_88C&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 15:59:07', '2017-04-15 15:59:07'),
	(256, 'Kingdom of the Golden Dragon', 'Isabel Allende', 480, 'EE7dBF5x_RoC', 'Reunited once more, young Alexander Cold and his best friend, Nadia, embark upon a new adventure, following Alex\'s frighteningly fearless journalist grandmother Kate to a forbidden kingdom hidden away in the frosty peaks of the Himalayas. They seek the fabled Golden Dragon—a sacred statue and priceless oracle coveted by a greedy and powerful outsider. To prevent the desecration of the holy relic, they will need the help of a sage Buddhist monk, his young royal disciple, and a fierce tribe of Yeti warriors. But even the mystical power of their totemic animal spirits may not be enough to save the teenagers and this remote world from the destructive encroachment of “civilization.” Kingdom of the Golden Dragon is the second book in a remarkable trilogy by internationally acclaimed author Isabel Allende.', 'http://books.google.com/books/content?id=EE7dBF5x_RoC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '2017-04-15 15:59:08', '2017-04-15 15:59:08'),
	(257, 'Forest of the Pygmies', 'Isabel Allende', 320, 'Xy7IAgAAQBAJ', 'Once again Alexander Cold and his indomitable journalist grandmother, Kate, are braving the mystical unknown, this time in the heart of Africa. Along with Alex\'s friend Nadia Santos and a photographic crew from International Geographic magazine, they have travelled to Kenya to work on an article about the continent\'s first elephant-led safaris. But when a missionary approaches their camp in search of companions who have mysteriously disappeared, Alex, Nadia, and their group find themselves embarking on a dangerous mission to Africa\'s equatorial forest to aid a clan of Pygmies. For the Cold expedition is the tribe\'s last hope for survival in a world where poaching, corruption, and slavery run rampant. Forest of the Pygmies is the concluding volume of acclaimed author Isabel Allende\'s celebrated trilogy, which begins with City of the Beasts and continues with Kingdom of the Golden Dragon.', 'http://books.google.com/books/content?id=Xy7IAgAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:10:50', '2017-04-15 16:10:50'),
	(258, 'when you reach me', 'rebecca stead', 197, NULL, NULL, NULL, '2016-09-23 11:49:17', '2016-09-23 11:49:17'),
	(259, 'The Chronicles of Narnia The Lion, The Witch, and The Wardrobe', 'C.S. LEWIS', 208, NULL, NULL, NULL, '2016-09-23 11:49:32', '2016-09-23 11:49:32'),
	(260, 'The Brotherband Chronicles The Ghostfaces', 'John Flanagan', 400, 'rXAuDAAAQBAJ', '\"When the brotherband crew are caught in a massive storm at sea, they\'re blown far off course, surviving only because they wash up on the shores of a land that isn\'t on any of Hal\'s maps. They\'re being watched, but they don\'t know if the locals are friend or foe u until the brotherband spring into action to rescue two children from a marauding bear, earning the Herons the gratitude of the Mawagansett people. The peace is short-lived. The ruthless, warmongering Ghostface tribe are heading their way, and the Herons must help their new friends repel an invasion. Among the nail-biting battles and heart-stopping action, one Heron must make an agonising decision that could change the brotherband forever.\"', 'http://books.google.com/books/content?id=rXAuDAAAQBAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '2017-04-15 16:10:53', '2017-04-15 16:10:53'),
	(261, 'Wonder', 'R. J. Palacio', 416, 'utCk2EpUrqgC', 'SOON TO BE A MAJOR MOTION PICTURE STARRING JULIA ROBERTS, OWEN WILSON, AND JACOB TREMBLAY! Over 5 million people have read the #1 New York Times bestseller WONDER and have fallen in love with Auggie Pullman, an ordinary boy with an extraordinary face. The book that inspired the Choose Kind movement. I won\'t describe what I look like. Whatever you\'re thinking, it\'s probably worse. August Pullman was born with a facial difference that, up until now, has prevented him from going to a mainstream school. Starting 5th grade at Beecher Prep, he wants nothing more than to be treated as an ordinary kid—but his new classmates can’t get past Auggie’s extraordinary face. WONDER, now a #1 New York Times bestseller and included on the Texas Bluebonnet Award master list, begins from Auggie’s point of view, but soon switches to include his classmates, his sister, her boyfriend, and others. These perspectives converge in a portrait of one community’s struggle with empathy, compassion, and acceptance. \"Wonder is the best kids\' book of the year,\" said Emily Bazelon, senior editor at Slate.com and author of Sticks and Stones: Defeating the Culture of Bullying and Rediscovering the Power of Character and Empathy. In a world where bullying among young people is an epidemic, this is a refreshing new narrative full of heart and hope. R.J. Palacio has called her debut novel “a meditation on kindness” —indeed, every reader will come away with a greater appreciation for the simple courage of friendship. Auggie is a hero to root for, a diamond in the rough who proves that you can’t blend in when you were born to stand out. Join the conversation: #thewonderofwonder', 'http://books.google.com/books/content?id=utCk2EpUrqgC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:12:12', '2016-09-23 11:52:49'),
	(262, 'Five Kingdoms Death Weavers', 'Brandon Mull', 512, NULL, NULL, NULL, '2016-09-23 11:57:37', '2016-09-23 11:57:37'),
	(263, 'The Unwanteds Island Of Dragons', 'Lisa McMann', 400, 'RqTWsgEACAAJ', 'Twins Alex and Aaron Stowe are put to the ultimate test to fulfill their destinies and save both Quill and Artimé from the deadliest enemy the cities have ever faced in the thrilling conclusion of the New York Times bestselling Unwanteds series, which Kirkus Reviews called “The Hunger Games meets Harry Potter.” Head mage Alexander Stowe and his friends successfully fended off the latest threat to their magical world of Artimé with the help of a surprise ally. But old enemies have secretly been plotting against them. Now Alex must lead his people in a final epic battle, one they can’t hope to win alone. Will Artimé finally know peace or will all they’ve fought for be destroyed forever?', 'http://books.google.com/books/content?id=RqTWsgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '2017-04-15 16:10:54', '2017-04-15 16:10:54'),
	(264, 'Crossed', 'Ally Condie', 367, NULL, NULL, NULL, '2016-09-23 12:05:35', '2016-09-23 12:05:35'),
	(265, 'The Legend of Zelda Oracle of Seasons', 'Akira Himekawa', 176, 'DTDlnAAACAAJ', 'In the mystical land of Hyrule, three spiritual stones hold the key to the Triforce, and whoever holds them will control the world. R to L (Japanese Style) In the mystical land of Hyrule, three spiritual stones hold the key to the Triforce, and whoever holds them will control the world. A boy named Link sets out on a quest to deliver the Emerald, the spiritual stone of the forest, to Zelda, Pr Four Swords Pt. 2 The green, red and blue Links reach Death Mountain, where they challenge Shadow Link and Violet Link in battle. Then, inside the Fire Temple they learn a terrible secret about the Dark World and the evil power behind Vaati. To defeat this great enemy, the different colored Links must find a way to become one again in order to harness the power of the Four Sword! The manga adapation of the legendary video game series, now available in English for the first time! Become part of the Legend – The Legend of Zelda!', 'http://books.google.com/books/content?id=DTDlnAAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '2017-04-15 16:10:56', '2017-04-15 16:10:56'),
	(266, 'The Legend of Zelda Ocarina of Time Part 2', 'Akira Himekawa', 189, NULL, NULL, NULL, '2016-09-23 13:03:54', '2016-09-23 13:03:54'),
	(267, 'Yu-Gi-Oh! Volume 1', 'Kazuki Takahashi', 195, 'mSH0AQAAQBAJ', 'Sitting by himself in the back of the class, 10th-grader Yugi always had his head in some game--until he solved the Millennium Puzzle, an Egyptian artifact containing a powerful spirit from the age of the pharoahs! Awakened after three thousand years, the King of Games possesses Yugi, recklessly challenging bullies and evildoers to the Shadow Games, where the stakes are high, and even the most ordinary bet may result in weirdness and danger beyond belief! Let the games...begin! -- VIZ Media', 'http://books.google.com/books/content?id=mSH0AQAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:13:09', '2016-09-23 13:07:51'),
