	(269, 'Battle of the Labyrinth, The (Percy Jackson and the Olympians, Book 4)', 'Rick Riordan', 384, 'K_ZF6kZ9MlgC', 'Percy Jackson isn\'t expecting freshman orientation to be any fun. But when a mysterious mortal acquaintance appears on campus, followed by demon cheerleaders, things quickly move from bad to diabolical. In this latest installment of the blockbuster series, time is running out as war between the Olympians and the evil Titan lord Kronos draws near.', 'http://books.google.com/books/content?id=K_ZF6kZ9MlgC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:13:44', '2016-09-23 13:14:05'),
