	(279, 'The Last Holiday Concert', 'Andrew Clements', 176, 'q3X-lvmkW3MC', 'A moving holiday story from New York Times bestselling author Andrew Clements. For Hart Evans, being the most popular kid in sixth grade has its advantages. Kids look up to him, and all the teachers let him get away with anything -- all the teachers except the chorus director, Mr. Meinert. When Hart\'s errant rubber band hits Mr. Meinert on the neck during chorus practice, it\'s the last straw for the chorus director, who\'s just learned he\'s about to lose his job due to budget cuts. So he tells the class they can produce the big holiday concert on their own. Or not. It\'s all up to them. And who gets elected to run the show? The popular Mr. Hart Evans. Hart soon discovers there\'s a big difference between popularity and leadership, and to his surprise, discovers something else as well -- it\'s really important to him that this be the best holiday concert ever, and even more important, that it not be the last.', 'http://books.google.com/books/content?id=q3X-lvmkW3MC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:11:08', '2017-04-15 16:11:08'),
