	(286, 'Big Nate Flips Out', 'Lincoln Peirce', 224, '7SbjMAEACAAJ', 'The fifth Big Nate novel in the New York Times bestselling series by Lincoln Peirce! Big Nate is a New York Times bestseller! Here comes the latest illustrated novel from Lincoln Peirce, all about king of detention and cartooning genius Nate Wright! Everyone knows N-A-T-E does not equal N-E-A-T! And when Nate\'s sloppiness gets out of hand, his best friend, Francis, is in serious trouble. Can Nate clean up his act, or will he flip out first? \"Big Nate is funny, big time.\"—Jeff Kinney, author of Diary of a Wimpy Kid Includes a sneak peek of the next Big Nate novel, Big Nate: In the Zone!', 'http://books.google.com/books/content?id=7SbjMAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '2017-04-15 16:14:49', '2016-09-29 13:14:07'),
