	(293, 'Artemis Fowl The Lost Colony', 'Eoin Colfer', 376, 'w1spPwAACAAJ', 'Artemis Fowl and the Lost Colony is the fifth sensational book in the gripping Artemis Fowl series by Eoin Colfer.Has criminal mastermind Artemis Fowl met his match?Until recently Artemis Fowl was the only human to have discovered that fairies do exist. But now a second juvenile genius wants to capture one for scientific study - and not just any old fairy. The newcomer intends to trap a demon, the most human-hating species unknown to man. Only an ancient time spell separates the demons from mankind - and Artemis must prevent it from unravelling. If he fails, the bloodthirsty tribe will re-launch their quest to wipe humans from the planet . . . There can only be one winner in this battle of the demons. And it may not be Artemis Fowl. \'A superb series\' - The Times\'Engagingly vivid, exciting and witty\' - The Telegraph\'Fast, funny and very exciting\' - Daily Mail ***Artemis Fowl was winner of the WHSmith Children\'s Book of the Year Award and Children\'s Book of the Year at the Children\'s Book Awards. Shortlisted for the Whitbread Children\'s Book of the Year Award.*******Enter Artemis\'s wicked world at www.artemisfowl.co.uk****Eoin Colfer was born and raised in Wexford in the south-east of Ireland. He began writing plays at an early age and, as an adult, continued to write. ARTEMIS FOWL, his first book featuring the brilliant young anti-hero, was an immediate international bestseller and won several prestigious awards.', 'http://books.google.com/books/content?id=w1spPwAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '2017-04-15 16:14:59', '2017-04-15 16:14:59'),
	(294, 'Thirteen', 'Lauren Myracle', 272, 'kr13XmIOifsC', 'Winnie Perry is a teenager—at last! And it’s a really big deal. A ginormous deal, that, wouldn’t you know it, brings ginormous problems along with it. Winnie’s bff #1 is growing up too slowly, while her bff #2 is growing up too fast, leaving Winnie stuck in the middle. Winnie’s boyfriend, Lars, is fabulous—except when he’s not. And as for Winnie’s family, well, big changes are in the air! Beloved author Lauren Myracle returns with first kisses and near misses for everyone’s favorite birthday girl.', 'http://books.google.com/books/content?id=kr13XmIOifsC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:15:00', '2017-04-15 16:15:00'),
	(295, 'How to Ditch Your Fairy', 'Justine Larbalestier', 336, 'j1VitQ0bPPIC', 'If you lived in a world where everyone had a personal fairy, what kind would you want? A clothes-shopping fairy (The perfect outfit will always be on sale!) A loose-change fairy (Pretty self-explanatory.) A never-getting-caught fairy (You can get away with anything. . . .) Unfortunately for Charlie, she\'s stuck with a parking fairy-if she\'s in the car, the driver will find the perfect parking spot. Tired of being treated like a personal parking pass, Charlie devises a plan to ditch her fairy for a more useful model. At first, teaming up with her archenemy (who has an all-the-boys-like-you fairy) seems like a good idea. But Charlie soon learns there are consequences for messing with fairies-and she will have to resort to extraordinary measures to set things right again.', 'http://books.google.com/books/content?id=j1VitQ0bPPIC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:15:00', '2017-04-15 16:15:00'),
	(296, 'Ranger\'s Apprentice The Kings Of Clonmel', 'John Flanagan', 358, NULL, NULL, NULL, '2016-10-03 10:00:12', '2016-10-03 10:00:12'),
	(297, 'Stella by Starlight', 'Sharon M. Draper', 352, 'xcfNCwAAQBAJ', 'When a burning cross set by the Klan causes panic and fear in 1932 Bumblebee, North Carolina, fifth-grader Stella must face prejudice and find the strength to demand change in her segregated town.', 'http://books.google.com/books/content?id=xcfNCwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:15:02', '2017-04-15 16:15:02'),
