	(300, 'Explorer: The Lost Islands', 'Kazu Kibuishi', 128, '-K1-lwEACAAJ', 'The highly anticipated second volume to the critically acclaimed Explorer series, The Lost Islands is a collection of seven all-new stories written and illustrated by an award-winning roster of comics artists, with each story centered around the theme of hidden places. Edited by the New York Times bestselling comics creator Kazu Kibuishi, this graphic anthology includes well-written, beautifully illustrated stories by Kazu (the Amulet series), Jason Caffoe (the Flight series), Raina Telgemeier (Drama and Smile), Dave Roman (the Astronaut Academy series), Jake Parker (the Missile Mouse series), Michel Gagné (The Saga of Rex), Katie and Steven Shanahan (the Flight series), and up-and-coming new artist Chrystin Garland.', 'http://books.google.com/books/content?id=-K1-lwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '2017-04-15 16:15:39', '2017-04-15 16:15:39'),
	(301, 'Battle world: Ultimate End', 'Hanna Ponsor', 30, NULL, NULL, NULL, '2016-10-03 12:00:12', '2016-10-03 12:00:12'),
	(302, 'The Long Haul (Diary of a Wimpy Kid #9)', 'Jeff Kinney', 224, 'dSQpAwAAQBAJ', 'A family road trip is supposed to be a lot of fun . . . unless, of course, you’re the Heffleys. The journey starts off full of promise, then quickly takes several wrong turns. Gas station bathrooms, crazed seagulls, a fender bender, and a runaway pig—not exactly Greg Heffley’s idea of a good time. But even the worst road trip can turn into an adventure—and this is one the Heffleys won’t soon forget.', 'http://books.google.com/books/content?id=dSQpAwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:16:48', '2016-10-03 12:01:57'),
