	(308, 'Inside out & Back Again', 'Thanhha Lai', 276, 'kWjZKdoC1icC', 'Through a series of poems, a young girl chronicles the life-changing year of 1975, when she, her mother, and her brothers leave Vietnam and resettle in Alabama.', 'http://books.google.com/books/content?id=kWjZKdoC1icC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:15:44', '2017-04-15 16:15:44'),
