	(311, 'Dragon Ball Z vol.24', 'Akira Toriyama', 184, 'UXfwAQAAQBAJ', 'Breaking from his master Bobbidi, the rampaging Boo turns the entire world into his candy store! To fight back, Goku transforms into his most powerful form yet, but the world\'s only hope may lie in Trunks and Goten, the world\'s youngest and most promising fighters. Using an alien fusion technique, they attempt to merge together to form a single, even more powerful hero! Meanwhile, as Boo destroys city after city, the people of Earth call forth their secret weapon...the seemingly invincible (but actually incompetent) Hercule! -- VIZ Media', 'http://books.google.com/books/content?id=UXfwAQAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:15:46', '2017-04-15 16:15:46'),
