	(315, 'The Amazing Spider-Man', 'Dan Slott', 291, 'mLlSXwAACAAJ', 'New York City is hit by an infestation and eight million people are plagued - everyone is developing Spider powers. As someone near to Peter Parker\'s life reveals their spider-abilities, the brilliantly fearsome Jackal rises from the past and begins organising an army of Spider-powered soldiers. Spider-Man isn\'t the only hero affected as the threat soon grows bigger than any one Fantastically Friendly Neighborhood Avenger can handle.', 'http://books.google.com/books/content?id=mLlSXwAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '2017-04-15 16:15:49', '2017-04-15 16:15:49'),
