	(317, 'Three Cups Of Tea', 'Greg Mortenson, David Oliver Relin', 209, 'cVUgKxnYvSkC', 'An adaptation of the bestselling book about the American Greg Mortenson\'s building of over 60 schools in Pakistan and Afghanistan.', 'http://books.google.com/books/content?id=cVUgKxnYvSkC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:15:51', '2017-04-15 16:15:51'),
