	(319, 'Planetes Vol. 2', 'Makoto Yukimura', 524, NULL, NULL, NULL, '2016-10-06 09:40:29', '2016-10-06 09:40:29'),
	(320, 'My Sergei', 'Ekaterina Gordeeva, E. M. Swift', 300, 'kSQ7AQAAQBAJ', 'The Olympic gold medalist offers a poignant, loving account of her life with her long-time partner and beloved husband, Sergei Grinkov, from their first introduction and successive world pairs skating championships, to their storybook romance and marriage, to the fatal heart attack that took Sergei\'s life.', 'http://books.google.com/books/content?id=kSQ7AQAAQBAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '2017-04-15 16:15:53', '2017-04-15 16:15:53'),
	(321, 'The Mark of the Athena', 'Rick Riordan', 584, 'w-kCtwAACAAJ', 'One fatal prophecy. Seven brace demigods. A quest to find - and close - the doors of death. Annabeth and her friends Piper, Jason and Leo have landed at camp Jupiter with one mission in mind. The time has come for Roman and Greek demigods to unite. With Percy Jackson, Hazel and Frank by their side, they must combine forces to find - and close - the Doors of Death. But Annabeth is hiding a secret - a command from her mother, the goddess of war and wisdom: \'Follow the Mark of Athena, Avenge me.\' Annabeth is already risking her life . . . What more does Athena want her daughter to do? Now the seven demigods must begin their quest across land and sea to Rome, but what will they have to sacrifice this time - and what unspeakable horrors await?', 'http://books.google.com/books/content?id=w-kCtwAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '2017-04-15 16:15:54', '2017-04-15 16:15:54'),
	(322, 'Cabin Fever (Diary of a Wimpy Kid #6)', 'Jeff Kinney', 224, 'HKmkHMhcfNEC', ' Greg Heffley is in big trouble. School property has been damaged, and Greg is the prime suspect. But the crazy thing is, he’s innocent. Or at least sort of. The authorities are closing in, but when a surprise blizzard hits, the Heffley family is trapped indoors. Greg knows that when the snow melts he’s going to have to face the music, but could any punishment be worse than being stuck inside with your family for the holidays?', 'http://books.google.com/books/content?id=HKmkHMhcfNEC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:18:47', '2016-10-06 11:49:42'),
