	(325, 'Bart Simpson\'s Guide to Life', 'Matt Groening', 186, '9MFYHAAACAAJ', 'Written by the creator of The Simpsons, this guide provides hints and tips such as Dr Bart\'s Miracle Cures, Homer\'s Dozen-Donut-A-Day Diet and Marge\'s beauty secrets. Guest appearances by Lisa, Barney, Millhouse, Krusty the Clown, Groundskeeper Willie, Mr Burns and Smithers are also included.', 'http://books.google.com/books/content?id=9MFYHAAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '2017-04-15 16:19:43', '2016-10-06 11:57:53'),
