	(329, 'The Eye Of Minds', 'James Dashner', 310, 'BdAckgEACAAJ', '\"Michael is a skilled internet gamer in a world of advanced technology. When a cyber-terrorist begins to threaten players, Michael is called upon to seek him and his secrets out\"--', 'http://books.google.com/books/content?id=BdAckgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '2017-04-15 16:20:05', '2016-10-07 09:41:30'),
	(330, 'Shotgun Lovesongs', 'Nickolas Butler', 320, 'CY7qAQAAQBAJ', 'NATIONAL BESTSELLER \"Impressively original.\" —The New York Times \"Sparkles in every way. A love letter to the open lonely American heartland...A must-read.\" —People \"The kind of book that restores your faith in humanity.\" —Toronto Star Welcome to Little Wing. It\'s a place like hundreds of others, nothing special, really. But for four friends—all born and raised in this small Wisconsin town—it is home. And now they are men, coming into their own or struggling to do so. One of them never left, still working the family farm that has been tilled for generations. But others felt the need to move on, with varying degrees of success. One trades commodities, another took to the rodeo circuit, and one of them even hit it big as a rock star. And then there\'s Beth, a woman who has meant something special in each of their lives. Now all four are brought together for a wedding. Little Wing seems even smaller than before. While lifelong bonds are still strong, there are stresses—among the friends, between husbands and wives. There will be heartbreak, but there will also be hope, healing, even heroism as these memorable people learn the true meaning of adult friendship and love. Seldom has the American heartland been so richly and accurately portrayed. Though the town may have changed, the one thing that hasn\'t is the beauty of the Wisconsin farmland, the lure of which, in Nickolas Butler\'s hands, emerges as a vibrant character in the story. Shotgun Lovesongs is that rare work of fiction that evokes a specific time and place yet movingly describes the universal human condition. It is, in short, a truly remarkable book—a novel that once read will never be forgotten.', 'http://books.google.com/books/content?id=CY7qAQAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:19:03', '2017-04-15 16:19:03'),
	(331, 'Paper Towns', 'John Green', 305, NULL, NULL, NULL, '2016-10-07 10:56:31', '2016-10-07 10:56:31'),
	(332, 'The House of Hades', 'Rick Riordan', 583, NULL, NULL, NULL, '2016-10-07 11:39:35', '2016-10-07 11:39:35'),
	(333, 'Planetes Vol. 3', 'Makoto Yukimara', 240, NULL, NULL, NULL, '2016-10-07 11:56:50', '2016-10-07 11:56:50'),
	(334, 'Turning 15 On The Road To Freedom', 'Lynda Blackmon Lowery', 128, 'WguYDQAAQBAJ', 'A memoir of the Civil Rights Movement from one of its youngest heroes--now in paperback will an all-new discussion guide. As the youngest marcher in the 1965 voting rights march from Selma to Montgomery, Albama, Lynda Blackmon Lowery proved that young adults can be heroes. Jailed eleven times before her fifteenth birthday, Lowery fought alongside Martin Luther King, Jr. for the rights of African-Americans. In this memoir, she shows today\'s young readers what it means to fight nonviolently (even when the police are using violence, as in the Bloody Sunday protest) and how it felt to be part of changing American history. Straightforward and inspiring, this beautifully illustrated memoir brings readers into the middle of the Civil Rights Movement, complementing Common Core classroom learning and bringing history alive for young readers.', 'http://books.google.com/books/content?id=WguYDQAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:19:06', '2017-04-15 16:19:06'),
	(335, 'Rangers Apprentice The Burning Bridge', 'John Flanagan', 276, NULL, NULL, NULL, '2016-10-07 12:05:37', '2016-10-07 12:05:37'),
	(336, 'A Light in the Attic', 'Shel Silverstein', 192, NULL, NULL, NULL, '2016-10-07 12:13:23', '2016-10-07 12:13:23'),
	(337, 'Seeing Cinderella', 'Jenny Lundquist', 240, 'SXo5yvhL3o8C', 'Magical realism and a modern Cinderella story makes for a fun and relatable M!X read. Sixth grade is not going well for Calliope Meadow Anderson. Callie’s hair is frizzy, her best friend, Ellen, is acting weird, and to top things off, she has to get glasses. And her new specs aren’t even cute, trendy glasses—more like hideously large and geeky. But Callie soon discovers that her glasses have a special, magical perk: When she wears them, she can read people’s thoughts. Crazy glasses aside, Callie has more drama to face when she’s cast as the lead in the school play—and instead opts to be an understudy, giving the role of Cinderella to Ellen. Can Callie’s magic glasses help her see her way to leading lady, or is she destined to stay in the background forever?', 'http://books.google.com/books/content?id=SXo5yvhL3o8C&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:20:32', '2017-04-15 16:20:32'),
	(338, 'Ghostopolis', 'Doug TenNapel', 272, 'QY_YHEkvml8C', 'Imagine Garth Hale\'s surprise when he\'s accidentally zapped to the spirit world by Frank Gallows, a washed-out ghost wrangler. Suddenly Garth finds he has powers the ghosts don\'t have, and he\'s stuck in a world run by the evil ruler of Ghostopolis, who would use Garth\'s newfound abilities to rule the ghostly kingdom. When Garth meets Cecil, his grandfather\'s ghost, the two search for a way to get Garth back home, and nearly lose hope until Frank Gallows shows up to fix his mistake.', 'http://books.google.com/books/content?id=QY_YHEkvml8C&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:20:32', '2017-04-15 16:20:32'),
	(339, 'Bad Island', 'Doug TenNapel', 224, 'XR0wasbE5FoC', 'When Reese is forced to go on a boating trip with his family, the last thing he expects is to be shipwrecked on an island-especially one teeming with weird plants and animals. But what starts out as simply a bad vacation turns into a terrible one, as the castaways must find a way to escape while dodging the island\'s dangerous inhabitants. With few resources and a mysterious entity on the hunt, each secret unlocked could save them . . . or spell their doom. One thing Reese knows for sure: This is one Bad Island.', 'http://books.google.com/books/content?id=XR0wasbE5FoC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:20:33', '2017-04-15 16:20:33'),
