	(348, 'Girls Like Us', 'Gail Giles', 224, 'eQI6AwAAQBAJ', 'A 2015 Schneider Family Book Award Winner. Quincy and Biddy are both graduates of their high school’s special ed program, but they couldn’t be more different: suspicious Quincy faces the world with her fists up, while gentle Biddy is frightened to step outside her front door. When they’re thrown together as roommates in their first \"real world\" apartment, it initially seems to be an uneasy fit. But as Biddy’s past resurfaces and Quincy faces a harrowing experience that no one should have to go through alone, the two of them realize that they might have more in common than they thought — and more important, that they might be able to help each other move forward. Hard-hitting and compassionate, Girls Like Us is a story about growing up in a world that can be cruel, and finding the strength — and the support — to carry on.', 'http://books.google.com/books/content?id=eQI6AwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:21:45', '2017-04-15 16:21:45'),
