	(365, 'Srsly Hamlet', 'William Shakespeare, Courtney Carbone', 128, 'PjhEBQAAQBAJ', 'Hamlet, one of the greatest stories ever told . . . in texts?! Imagine: What if Hamlet, the Prince of Denmark, and the tragic Ophelia had smartphones? A classic is reborn in this fun and funny adaptation of one of Shakespeare’s most famous plays! A kingdom on the brink of war. A stolen throne. A boy seeking revenge. and h8. The classics just got a whole lot more interesting. ;) tl;dr A Shakespeare play told through its characters texting with emojis, checking in at certain locations, and updating their relationship statuses. The perfect gift for hip theater lovers and teens. A glossary and cast of characters are included for those who need it. For example: tl;dr means too long; didn’t read.', 'http://books.google.com/books/content?id=PjhEBQAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:21:57', '2017-04-15 16:21:57'),
