	(381, 'The Rule Of Three', 'Eric Walters', 416, 'sVT1AAAAQBAJ', 'One shocking afternoon, computers around the globe shut down in a viral catastrophe. At sixteen-year-old Adam Daley\'s high school, the problem first seems to be a typical electrical outage, until students discover that cell phones are down, municipal utilities are failing, and a few computer-free cars like Adam\'s are the only vehicles that function. Driving home, Adam encounters a storm tide of anger and fear as the region becomes paralyzed. Soon—as resources dwindle, crises mount, and chaos descends—he will see his suburban neighborhood band together for protection. And Adam will understand that having a police captain for a mother and a retired government spy living next door are not just the facts of his life but the keys to his survival, in The Rule of Three by Eric Walters.', 'http://books.google.com/books/content?id=sVT1AAAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:22:18', '2017-04-15 16:22:18'),
