	(401, 'The Strange Case Of Origami Yoda', 'Tom Angleberger', 160, 'VdtFTO20UugC', 'In this funny, uncannily wise portrait of the dynamics of a sixth-grade class and of the greatness that sometimes comes in unlikely packages, Dwight, a loser, talks to his classmates via an origami finger puppet of Yoda. If that weren’t strange enough, the puppet is uncannily wise and prescient. Origami Yoda predicts the date of a pop quiz, guesses who stole the classroom Shakespeare bust, and saves a classmate from popularity-crushing embarrassment with some well-timed advice. Dwight’s classmate Tommy wonders how Yoda can be so smart when Dwight himself is so clueless. With contributions from his puzzled classmates, he assembles the case file that forms this novel. F&P Level: T F&P Genre: RF', 'http://books.google.com/books/content?id=VdtFTO20UugC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:23:01', '2017-04-15 16:23:01'),
