	(413, 'The Brotherband Chronicles The Outcasts', 'John Flanagan', 434, 'NAN4uQAACAAJ', 'Hal, who does not fit into Skandian society, ends up in a brotherband, a group of boys learning the skills that they need to become warriors, with other outcasts, and they compete with other brotherbands in a series of challenges.', 'http://books.google.com/books/content?id=NAN4uQAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '2017-04-15 16:23:10', '2017-04-15 16:23:10'),
	(414, 'The Brotherband Chronicles The Invaders', 'John Flanagan', 448, 'rKGYMgEACAAJ', 'Hal and the Herons celebrate their victory in the Brotherband competition only to be wrongly blamed for the theft of a sacred artifact that they must risk their lives to reclaim.', 'http://books.google.com/books/content?id=rKGYMgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '2017-04-15 16:23:10', '2017-04-15 16:23:10'),
	(415, 'Speak', 'Laurie Halse Anderson', 198, NULL, NULL, NULL, '2016-10-25 11:06:12', '2016-10-25 11:06:12'),
	(416, 'Sunny Side Up', 'Jennifer L. Holm', 224, '32pzBgAAQBAJ', 'When is a summer vacation not really a summer vacation? Sunny Lewin has been packed off to Florida to live with her grandfather for the summer. At first she thought Florida might be fun -- it is the home of Disney World, after all. But the place where Gramps lives is no amusement park. It’s full of . . . old people. Really old people. Luckily, Sunny isn’t the only kid around. She meets Buzz, a boy who is completely obsessed with comic books, and soon they’re having adventures of their own: facing off against golfball-eating alligators, runaway cats, and mysteriously disappearing neighbors. But the question remains -- why is Sunny down in Florida in the first place? The answer lies in a family secret that won’t be secret to Sunny much longer. . .', 'http://books.google.com/books/content?id=32pzBgAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:23:12', '2017-04-15 16:23:12'),
