	(425, 'Selp-Helf', 'Miranda Sings', 240, 'UMWZBgAAQBAJ', 'In this decidedly unhelpful, candid, hilarious “how-to” guide, YouTube personality Miranda Sings offers life lessons and tutorials with her signature sassy attitude. Over six million social media fans can’t be wrong: Miranda Sings is one of the funniest faces on YouTube. As a bumbling, ironically talentless, self-absorbed personality (a young Gilda Radner, if you will), she offers up a vlog of helpful advice every week on her widely popular YouTube channel. For the first time ever, Miranda is putting her advice to paper in this easy-to-follow guide, illustrated by Miranda herself. In it, you’ll find instructions on everything: how to get a boyfriend (wear all black and carry a fishing net), to dressing for a date (sequins and an orange tutu), to performing magic (“Magic is Lying”), and much, much more! Miranda-isms abound in these self-declared lifesaving pages, and if you don’t like it…well, as Miranda would say…“Haters, back off!”', 'http://books.google.com/books/content?id=UMWZBgAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:23:20', '2017-04-15 16:23:20'),
	(426, 'Out of the box', 'Andrew Williams', 171, NULL, NULL, NULL, '2016-10-26 17:55:06', '2016-10-26 17:55:06'),
	(427, 'License to Spill', 'Lisi Harrison', 352, 'hZ6kAQAAQBAJ', 'Three girls, two guys, five secret journals. The five most popular students at Noble High have secrets to hide; secrets they wrote down in their journals. Now one of their own exposes the private entries... When our parents were growing up they were encouraged to make mistakes. That\'s how they learned. But us? Our mistakes go viral. There is no delete button on the Internet. What kind of future do we have if we can\'t escape our embarrassing pasts? I must come off as quite the hypocrite; complaining about our overexposed lives in a book of secret journals I have leaked. But these pages hold proof of how this pressure affects the \"best\" of us... so until the heat\'s turned down, keep reading.', 'http://books.google.com/books/content?id=hZ6kAQAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:23:22', '2017-04-15 16:23:22'),
	(428, 'The Graveyard Book', 'Neil Gaiman', 313, NULL, NULL, NULL, '2016-10-27 11:49:27', '2016-10-27 11:49:27'),
