	(439, '365 days of wonder', 'R. J. Palacio', 480, '80DRAwAAQBAJ', 'WONDER IS SOON TO BE A MAJOR MOTION PICTURE STARRING JULIA ROBERTS AND JACOB TREMBLAY! Over 5 million people have read the #1 New York Times bestseller Wonder—the book that inspired the Choose Kind movement—and have fallen in love with Auggie Pullman, an ordinary boy with an extraordinary face. In Wonder, readers were introduced to memorable English teacher Mr. Browne and his love of precepts. This companion book features conversations between Mr. Browne and Auggie, Julian, Summer, Jack Will, and others, giving readers a special peek at their lives after Wonder ends. Mr. Browne\'s essays and correspondence are rounded out by a precept for each day of the year—drawn from popular songs to children’s books to inscriptions on Egyptian tombstones to fortune cookies. His selections celebrate the goodness of human beings, the strength of people’s hearts, and the power of people’s wills. There’s something for everyone here, with words of wisdom from such noteworthy people as Anne Frank, Martin Luther King Jr., Confucius, Goethe, Sappho—and over 100 readers of Wonder who sent R. J. Palacio their own precepts. From the Hardcover edition.', 'http://books.google.com/books/content?id=80DRAwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:23:33', '2017-04-15 16:23:33'),
	(440, 'A long walk to water', 'Linda Sue Park', 128, 'gFaJTEvrFEsC', 'The New York Times bestseller A Long Walk to Water begins as two stories, told in alternating sections, about two eleven-year-olds in Sudan, a girl in 2008 and a boy in 1985. The girl, Nya, is fetching water from a pond that is two hours’ walk from her home: she makes two trips to the pond every day. The boy, Salva, becomes one of the \"lost boys\" of Sudan, refugees who cover the African continent on foot as they search for their families and for a safe place to stay. Enduring every hardship from loneliness to attack by armed rebels to contact with killer lions and crocodiles, Salva is a survivor, and his story goes on to intersect with Nya’s in an astonishing and moving way.', 'http://books.google.com/books/content?id=gFaJTEvrFEsC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:23:35', '2017-04-15 16:23:35'),
