	(459, 'Firelight', 'Kazu Kibuishi', 224, 'U-lbjwEACAAJ', 'A hidden past . . . and a deadly secret. Emily, Trellis, and Vigo visit Algos Island, where they can access and enter lost memories. They re hoping to uncover the events of Trellis s mysterious childhood knowledge they can use against the Elf King. What they discover is a dark secret that changes everything. Meanwhile, the Voice of Emily s Amulet is getting stronger, and threatens to overtake her completely.\"', 'http://books.google.com/books/content?id=U-lbjwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '2017-04-15 16:23:50', '2017-04-15 16:23:50'),
