	(466, 'My Perfect Life', 'Dyan Sheldon', 229, '1PWMAAAACAAJ', 'The witty sequel to \'Confessions of a Teenage Drama Queen\' sees high school rivals Carla and Lola compete in the school election.', 'http://books.google.com/books/content?id=1PWMAAAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '2017-04-15 16:23:56', '2017-04-15 16:23:56'),
