	(473, 'TOKYO GHOUL volume', 'Sui ishida', 199, NULL, NULL, NULL, '2016-11-01 14:22:13', '2016-11-01 14:22:13'),
	(474, 'See Me', 'Nicholas Sparks', 304, 'ZM4aCgAAQBAJ', 'See me just as I see you . . . Colin Hancock is giving his second chance his best shot. With a history of violence and bad decisions behind him and the threat of prison dogging his every step, he\'s determined to walk a straight line. To Colin, that means applying himself single-mindedly toward his teaching degree and avoiding everything that proved destructive in his earlier life. Reminding himself daily of his hard-earned lessons, the last thing he is looking for is a serious relationship. Maria Sanchez, the hardworking daughter of Mexican immigrants, is the picture of conventional success. With a degree from Duke Law School and a job at a prestigious firm in Wilmington, she is a dark-haired beauty with a seemingly flawless professional track record. And yet Maria has a traumatic history of her own, one that compelled her to return to her hometown and left her questioning so much of what she once believed. A chance encounter on a rain-swept road will alter the course of both Colin and Maria\'s lives, challenging deeply held assumptions about each other and ultimately, themselves. As love unexpectedly takes hold between them, they dare to envision what a future together could possibly look like . . . until menacing reminders of events in Maria\'s past begin to surface. As a series of threatening incidents wreaks chaos in Maria\'s life, Maria and Colin will be tested in increasingly terrifying ways. Will demons from their past destroy the tenuous relationship they\'ve begun to build, or will their love protect them, even in the darkest hour? Rich in emotion and fueled with suspense, SEE ME reminds us that love is sometimes forged in the crises that threaten to shatter us . . . and that those who see us for who we truly are may not always be the ones easiest to recognize.', 'http://books.google.com/books/content?id=ZM4aCgAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:24:03', '2017-04-15 16:24:03'),
	(475, 'Prince of Shadows', 'Rachel Caine', 384, '8rqMDQAAQBAJ', 'The star-crossed tale of Romeo and Juliet, told through the eyes of Romeo\'s cousin, Benvolio, a thief known as the Prince of Shadows.', 'http://books.google.com/books/content?id=8rqMDQAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:24:04', '2017-04-15 16:24:04'),
