	(479, 'Warriors Into the wild', 'Erin Hunter', 288, 'F_acEmeuf9sC', 'When Rusty, an ordinary housecat, becomes ThunderClan\'s new apprentice, he realizes that his past life has not prepared him for the hardships he now faces and so must work extra hard to prove he can be a true warrior.', 'http://books.google.com/books/content?id=F_acEmeuf9sC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:24:08', '2017-04-15 16:24:08'),
	(480, 'The Absolutely True Diary of a Part-Time Indian', 'Sherman Alexie', 230, NULL, NULL, NULL, '2016-11-07 13:30:44', '2016-11-07 13:30:44'),
	(481, 'Into the Woods', 'Lyn Gardner', 488, 'Kwk-4G39BeoC', 'Storm, Aurora, and Anything Eden live in a decaying mansion on the edge of the wilds with their erstwhile father and indolent mother. When an accident leaves them orphaned and at the mercy of the sinister Dr. DeWilde, these three courageous and eccentric sisters are forced to flee into the woods, where they encounter kidnappers, sweet-filled orphanages, mountains of ice, diamond mines, and some ravenously hungry wolves. Taking inspiration from numerous fairytales and weaving them into a wholly original story, Into the Woods is a whirlwind of a novel, full of imaginative happenings and dastardly deeds. From the Hardcover edition.', 'http://books.google.com/books/content?id=Kwk-4G39BeoC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:24:10', '2017-04-15 16:24:10'),
