	(486, 'Bottled Up', 'Jaye Murray', 224, 'L5PwCVL1jBQC', 'Pip’s desperate to escape his life—he’s been skipping classes, drinking, getting high. Anything and everything to avoid his smug teachers, his sweet but needy little brother, his difficult home life. Now he’s been busted by Principal Giraldi and given an ultimatum: either he shows up for all his classes and sees a counselor after school, or he’s expelled. Pip’s freaked out; not because he might get kicked out of school, but by the thought that Giraldi might call his father. Because Pip will do anything to avoid his father.', 'http://books.google.com/books/content?id=L5PwCVL1jBQC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:24:15', '2017-04-15 16:24:15'),
