	(493, 'The 39 Clues In Too Deep', 'Jude Watson', 220, NULL, NULL, NULL, '2016-11-10 12:09:28', '2016-11-10 12:09:28'),
	(494, 'There\'s a Boy in the Girls\' Bathroom', 'Louis Sachar', 224, '1-FFe3Omy1IC', 'The beloved bestseller from Newbery Medalist and National Book Award winner Louis Sachar (Holes), with a brand-new cover! “Give me a dollar or I’ll spit on you.” That’s Bradley Chalkers for you. He’s the oldest kid in the fifth grade. He tells enormous lies. He picks fights with girls, and the teachers say he has serious behavior problems. No one likes him—except Carla, the new school counselor. She thinks Bradley is sensitive and generous, and she even enjoys his far-fetched stories. Carla knows that Bradley could change, if only he weren’t afraid to try. But when you feel like the most hated kid in the whole school, believing in yourself can be the hardest thing in the world. . . .', 'http://books.google.com/books/content?id=1-FFe3Omy1IC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:24:21', '2017-04-15 16:24:21'),
	(495, 'Shadow Scale', 'Rachel Hartman', 608, 'FHpoBAAAQBAJ', 'Seraphina took the literary world by storm with 8 starred reviews and numerous “Best of” lists. At last, her eagerly awaited sequel has arrived—and with it comes an epic battle between humans and dragons. The kingdom of Goredd: a world where humans and dragons share life with an uneasy balance, and those few who are both human and dragon must hide the truth. Seraphina is one of these, part girl, part dragon, who is reluctantly drawn into the politics of her world. When war breaks out between the dragons and humans, she must travel the lands to find those like herself—for she has an inexplicable connection to all of them, and together they will be able to fight the dragons in powerful, magical ways. As Seraphina gathers this motley crew, she is pursued by humans who want to stop her. But the most terrifying is another half dragon, who can creep into people’s minds and take them over. Until now, Seraphina has kept her mind safe from intruders, but that also means she’s held back her own gift. It is time to make a choice: Cling to the safety of her old life, or embrace a powerful new destiny? Praise for Seraphina: A New York Times Bestseller An Indie Bestseller Winner of the William C. Morris Debut Award Winner of the Cybil Award for Teen Fantasy and Science Fiction An Amazon Top 20 Teen Book of the Year A Chicago Public Library Best Book of the Year A Kirkus Reviews Best Teen Book of the Year A School Library Journal Best Book of the Year A Library Journal Best Young Adult Literature for Adults Selection A Booklist Editors’ Choice An ABA New Voices Pick A Publishers Weekly Flying Start Author An ALA-ALSC Notable Children’s Book An ALA-YALSA Top Ten Best Fiction for Young Adults Book Recipient of 8 Starred Reviews “Beautifully written, well-rounded characters, and some of the most interesting dragons I’ve read in fantasy for a long while. An impressive debut novel; I can’t wait to see what Rachel Hartman writes next.” —Christopher Paolini, New York Times bestselling author of Eragon “A novel that will appeal to both fans of Christopher Paolini’s Eragon series and Robin McKinley’s The Hero and the Crown.” —Entertainment Weekly', 'http://books.google.com/books/content?id=FHpoBAAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:24:22', '2017-04-15 16:24:22'),
	(496, 'The Seeing Stone', 'Tony Diterlizzi, Holly Black', 107, NULL, NULL, NULL, '2016-11-15 11:50:25', '2016-11-15 11:50:25'),
	(497, 'Hidden Empire', 'Orson Scott Card', 336, '9wjoyHqwWT8C', 'The war of words between right and left collapsed into a shooting war, and raged between the high-technology weapons on each side, devastating cities and overrunning the countryside. At the close of Empire, political scientist and government adviser Averell Torrent had maneuvered himself into the presidency of the United States. And now that he has complete power at home, he plans to expand American imperial power around the world. Opportunity comes quickly. There\'s a deadly new plague in Africa, and it is devastating the countryside and cities. President Torrent declares American solidarity with the victims, but places all of Africa in quarantine until a vaccine is found or the disease burns itself out. And he sends Captain Bartholomew Coleman, Cole to his friends, to run the relief operations and protect the American scientists working on identifying the virus. If Cole and his team can avoid dying of the plague, or being cut down by the weapons of fearful African nations, they might do some good. Or they might be out of the way for good. At the Publisher\'s request, this title is being sold without Digital Rights Management Software (DRM) applied.', 'http://books.google.com/books/content?id=9wjoyHqwWT8C&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:24:25', '2017-04-15 16:24:25'),
	(498, 'A Year Down Yonder', 'Richard Peck', 144, 'Coz8t4jmURIC', 'A Newbery Medal Winner Richard Peck\'s Newbery Medal-winning sequel to A Long Way from Chicago Mary Alice\'s childhood summers in Grandma Dowdel\'s sleepy Illinois town were packed with enough drama to fill the double bill of any picture show. But now she is fifteen, and faces a whole long year with Grandma, a woman well known for shaking up her neighbors-and everyone else! All Mary Alice can know for certain is this: when trying to predict how life with Grandma might turn out . . . better not. This wry, delightful sequel to the Newbery Honor Book A Long Way from Chicago has already taken its place among the classics of children\'s literature. \"Hilarious and poignant.\" —Publishers Weekly, starred review A Newbery Medal Winner A New York Times Bestseller An ALA Notable Book An ALA Best Book for Young Adults A Booklist Best Book of the Year A School Library Journal Best Book of the Year From the Trade Paperback edition.', 'http://books.google.com/books/content?id=Coz8t4jmURIC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:24:26', '2017-04-15 16:24:26'),
	(499, 'Batman Arkham Vol.4: Killer Croc', 'Chuck Dixon', 296, NULL, NULL, NULL, '2016-11-15 12:02:13', '2016-11-15 12:02:13'),
	(500, 'Nefertiti', 'Michelle Moran', 480, 'ehb3rLJ54UkC', 'Nefertiti and her younger sister, Mutnodjmet, have been raised in a powerful family that has provided wives to the rulers of Egypt for centuries. Ambitious, charismatic, and beautiful, Nefertiti is destined to marry Amunhotep, an unstable young pharaoh. It is hoped by all that her strong personality will temper the young Amunhotep’s heretical desire to forsake Egypt’s ancient gods, overthrow the priests of Amun, and introduce a new sun god for all to worship. From the moment of her arrival in Thebes, Nefertiti is beloved by the people. Her charisma is matched only by her husband’s perceived generosity: Amunhotep showers his subjects with lofty promises. The love of the commoners will not be enough, however, if the royal couple is not able to conceive an heir, and as Nefertiti turns her attention to producing a son, she fails to see that the powerful priests, along with the military, are plotting against her husband’s rule. The only person wise enough to recognize the shift in political winds—and brave enough to tell the queen—is her younger sister, Mutnodjmet. Observant and contemplative, Mutnodjmet has never shared her sister’s desire for power. She yearns for a quiet existence away from family duty and the intrigues of court. Her greatest hope is to share her life with the general who has won her heart. But as Nefertiti learns of the precariousness of her reign, she declares that her sister must remain at court and marry for political gain, not love. To achieve her independence, Mutnodjmet must defy her sister, the most powerful woman in Egypt—while also remaining loyal to the needs of her family. Love, betrayal, political unrest, plague, and religious conflict—Nefertiti brings ancient Egypt to life in vivid detail. Fast-paced and historically accurate, it is the dramatic story of two unforgettable women living through a remarkable period in history. From the Hardcover edition.', 'http://books.google.com/books/content?id=ehb3rLJ54UkC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:24:27', '2017-04-15 16:24:27'),
	(501, 'Cold Blood, Hot Sea', 'Charlene D\'Avanzo', 250, 'hQWrDAAAQBAJ', '\"Charlene D\'Avanzo is a marine ecologist who has written a first crime novel that makes her scientific specialty exciting… The central character, Mara Tusconi, is a Maine oceanographer who thinks there\'s something fishy (pardon the pun) about the death of a colleague on board a research ship.\" —THE TORONTO STAR \"When it comes to research vessels, labs and scientific protocols, [D\'Avanzo] knows her stuff…the action scenes are genuinely thrilling page–turners…the Down East setting is, of course, a plus.\" —PORTLAND PRESS HERALD \"Cold Blood, Hot Sea showcases the effects of climate change on a particular industry, presenting a range of opinions and attitudes, [and conveys] a global problem on a personal level. Cold Blood, Hot Sea will make for great beach reading, but it also has meat on its bones, with rich characterizations and an intriguing mystery at its core.\" —FOREWORD REVIEWS \"An oceanographer fears she was the target of an accident at sea that kills one of her colleagues. Are climate change doubters at work?…[Cold Blood, Hot Sea combines] niche material about Maine life and oceanography.\" —KIRKUS REVIEWS \"[A] whirlwind of plot–driven activity.\" —CRIME FICTION LOVER \"The central premise is a new one, and forms an excellent basis for the mayhem and dramatic situations we demand in our murder mysteries. Five out of five stars.\" —ATLANTIC COASTAL KAYAKER \"Sleuths will have to figure out who done it, but the real crime is the backdrop here: the endless heating of a fragile planet.\" —BILL MCKIBBEN, author of Eaarth \"Cold Blood, Hot Sea is a cli–fi mystery that both entertains and bores deep into the heart of the issues. The author knows her science, too.\" —DAN BLOOM, editor, The Cli–Fi Report \"Artfully mixing scientific detail with her characters\' personal struggles, Charlene D\'Avanzo creates a tense story that makes it clear: When profits are favored over health of the planet, we are all at risk.\" —JOEANN HART, author of Float A thrilling contribution to the new wave of cli-fi hitting the shelves, Cold Blood, Hot Sea pits climate change scientists against big energy conspirators. When a colleague is killed aboard the research vessel Intrepid, oceanographer Mara Tusconi believes it\'s no accident. As she investigates, Mara becomes entangled in a scheme involving powerful energy executives with much to lose if her department colleagues continue their climate change research. Mara\'s career—and life—is on the line, threatened by intrigue as big and dark as the ocean. Marine ecologist and award–winning environmental educator Charlene D\'Avanzo studied the New England coast for forty years. As a scientist, D\'Avanzo sees firsthand the effects of climate change, and as a college professor, she knows the importance of storytelling in bringing ideas to life. Today she uses mysteries to immerse readers in Maine waters\' stunning beauty and grave threats. An avid sea kayaker, D\'Avanzo lives in Yarmouth, Maine. Cold Blood, Hot Sea is her first novel.', 'http://books.google.com/books/content?id=hQWrDAAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:24:28', '2017-04-15 16:24:28'),
	(502, 'The Diabolic', 'S.J Kincaid', 407, NULL, NULL, NULL, '2016-11-15 18:11:45', '2016-11-15 18:11:45'),
	(503, 'Things Not Seen', 'Andrew Clements', 251, 'zee9JX2xckMC', 'When fifteen-year-old Bobby wakes up and finds himself invisible, he and his parents and his new blind friend Alicia try to find out what caused his condition and how to reverse it.', 'http://books.google.com/books/content?id=zee9JX2xckMC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:24:30', '2017-04-15 16:24:30'),
