	(506, 'The Attack on Pearl Harbor', 'Allison Lassieur', 112, 'ccQWDQAAQBAJ', 'Everything in this book happened to real people. And YOU CHOOSE what side you re on and what you do next. The choices you make could lead you to survival or to death. In the You Choose Books set, only YOU can CHOOSE which path you take through history. What will it be? Get ready for an adventure.\"', 'http://books.google.com/books/content?id=ccQWDQAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:24:33', '2017-04-15 16:24:33'),
