	(513, 'Luna', 'Julie Anne Peters', 248, NULL, NULL, NULL, '2016-11-18 14:20:27', '2016-11-18 14:20:27'),
	(514, 'The Five People You in Heaven', 'Mitch Albom', 208, 'dUeZAAAAQBAJ', 'Eddie is a wounded war veteran, an old man who has lived, in his mind, an uninspired life. His job is fixing rides at a seaside amusement park. On his 83rd birthday, a tragic accident kills him, as he tries to save a little girl from a falling cart. He awakes in the afterlife, where he learns that heaven is not a destination. It\'s a place where your life is explained to you by five people, some of whom you knew, others who may have been strangers. One by one, from childhood to soldier to old age, Eddie\'s five people revisit their connections to him on earth, illuminating the mysteries of his \"meaningless\" life, and revealing the haunting secret behind the eternal question: \"Why was I here?\"', 'http://books.google.com/books/content?id=dUeZAAAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:24:41', '2017-04-15 16:24:41'),
	(515, 'How to tell if your cat is plotting to kill you', 'Andrews McMeel', 130, NULL, NULL, NULL, '2016-11-28 09:44:05', '2016-11-28 09:44:05'),
