	(518, 'Dragon ball z vol. 1', 'Akira Toriyama', 149, 'CVHwAQAAQBAJ', 'Son Goku is the greatest hero on Earth. Five years after defeating the demon king Piccolo, he\'s grown up and had a family--he\'s married, and he has a child, Son Gohan. But what is the real reason for Goku\'s incredible strength? A visitor from outer space arrives bearing terrible news--Goku is an alien, and the visitor, Raditz, is Goku\'s brother! When Raditz turns out to be a ruthless killer, Goku must fight his incredibly strong brother to save his family and the entire human race. A surprising alliance may be Earth\'s last hope: Goku will team up with his old enemy Piccolo...archenemies united to save the world! -- VIZ Media', 'http://books.google.com/books/content?id=CVHwAQAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:24:44', '2017-04-15 16:24:44'),
	(519, 'Fairest', 'Marissa Meyer', 272, 'QXfUBQAAQBAJ', '\"Queen Levana is a ruler who uses her \"glamour\" to gain power. But long before she crossed paths with Cinder, Scarlet, and Cress, Levana lived a very different story - a story that has never been told . . . until now\"--', 'http://books.google.com/books/content?id=QXfUBQAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:24:45', '2017-04-15 16:24:45'),
	(520, 'A Monster Calls', 'Patrick Ness', 224, 'hLRIAgAAQBAJ', 'NOW A #1 NEW YORK TIMES BESTSELLER! An unflinching, darkly funny, and deeply moving story of a boy, his seriously ill mother, and an unexpected monstrous visitor. At seven minutes past midnight, thirteen-year-old Conor wakes to find a monster outside his bedroom window. But it isn’t the monster Conor’s been expecting-- he’s been expecting the one from his nightmare, the nightmare he’s had nearly every night since his mother started her treatments. The monster in his backyard is different. It’s ancient. And wild. And it wants something from Conor. Something terrible and dangerous. It wants the truth. From the final idea of award-winning author Siobhan Dowd-- whose premature death from cancer prevented her from writing it herself-- Patrick Ness has spun a haunting and darkly funny novel of mischief, loss, and monsters both real and imagined.', 'http://books.google.com/books/content?id=hLRIAgAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:24:46', '2017-04-15 16:24:46'),
	(521, 'There Is Darkness In Light', 'Rachel', 31, NULL, NULL, NULL, '2016-11-30 09:51:30', '2016-11-30 09:51:30'),
	(522, 'The Golden Compass', 'Philip Pullman', 399, NULL, NULL, NULL, '2016-11-30 09:54:13', '2016-11-30 09:54:13'),
	(523, 'sorry not sorry', 'Naya Rivera', 256, 'RhFvDQAAQBAJ', '\"Navigating through youth and young adulthood isn\'t easy, and in Sorry Not Sorry, Naya Rivera shows us that we\'re not alone in the highs, lows, and in-betweens. Whether it\'s with love and dating, career and ambition, friends, or gossip, Naya inspires us to follow our own destiny and step over-or plod through-all the crap along the way. After her rise and fall from childhood stardom on The Fresh Prince of Bel-Airand Family Matters, barely eking her way through high school, a brief stint as a Hooters waitress, going through thick and thin with her mom/manager, and resurrecting her acting career as Santana Lopez on Glee, Naya emerged from these experiences with some key life lessons- Sorry-All those times I scrawled oI HATE MY MOMo in my journal. Moms and teenage daughters will never get along-we just have to realize it\'s nothing personal on either side. At-home highlights and DIY hair extensions. Some things are best left to the experts, and hair dye is one of them. Falling in love with the idea of a person, instead of the actual person. Not Sorry-That I don\'t always get along with everyone. Having people not like you is a risk you have to take to be real, and I\'ll take that over being fake any day. Boob job. People have a lot of opinions about plastic surgery, but more than 10 years after I got my boobs, they still make me happy when I look in the mirror. It might have been the best $8K I\'ve ever spent. Getting my financial disasters out of the way early-before I was married or had a family-so that the only credit score that I wrecked was my own. Even with a successful career and a family that she loves more than anything else, Naya says, oThere\'s still a thirteen-year-old girl inside of me making detailed lists of how I can improve, who\'s never sure of my own self-worth.o Sorry Not Sorryis for that thirteen-year-old in all of us.\"', 'http://books.google.com/books/content?id=RhFvDQAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:24:49', '2017-04-15 16:24:49'),
	(524, 'The fault in our starts', 'John Green,John, Editorial Editorial World', 106, 'zrjMsgEACAAJ', 'The Fault in Our Stars is a novel by author John Green. The story follows the main character, Hazel Grace Lancaster, as she battles cancer. Not only is Hazel trying to live the normal life of a 16-year-old girl, but she is also struggling with what it will be like for her parents after she dies. While Hazel attends a church support group for cancer survivors, she meets a boy that is one year older than her, Augustus Waters. While Augustus had a type of cancer that causes him to lose his leg and wear a prosthetic, it also has a survival rate that is much higher than Hazel\'s death sentence. From the first day that Hazel meets Augustus, the two are practically inseparable. The basis of their relationship ends up being Hazel\'s favorite book, An Imperial Affliction. She requires Augustus to read it and in turn, he requires her to read the book that is the basis of his favorite video game. Hazel relates to the character in her favorite book, Anna, because Anna has a rare blood cancer. Augustus and Hazel bond over the book because both of them of a burning desire to find out how the story ends because the author stops the book before providing conclusion on what happens to each of the characters. Augustus joins Hazel\'s pursuit of the book\'s author, Peter Van Houten, to provide the answers that they need. Augustus even uses a wish foundation to fly him and Hazel to Amsterdam, where the author lives, to talk with him in person. While Hazel is the one that is doomed to die, Augustus ends up telling Hazel that at his recent scan, the doctors discovered that his entire body is filled with cancer. Hazel spends the last months of Augustus\'s life caring for him and loving him.', 'http://books.google.com/books/content?id=zrjMsgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '2017-04-15 16:24:50', '2017-04-15 16:24:50'),
