	(533, 'Crossover', 'Kwame Alexander', 240, 'rQhKAQAAQBAJ', '2015 Newbery Medal Winner 2015 Coretta Scott King Honor Award Winner New York Times Bestseller \"With a bolt of lightning on my kicks . . .The court is SIZZLING. My sweat is DRIZZLING. Stop all that quivering. Cuz tonight I’m delivering,\" announces dread-locked, 12-year old Josh Bell. He and his twin brother Jordan are awesome on the court. But Josh has more than basketball in his blood, he\'s got mad beats, too, that tell his family\'s story in verse, in this fast and furious middle grade novel of family and brotherhood from Kwame Alexander. Josh and Jordan must come to grips with growing up on and off the court to realize breaking the rules comes at a terrible price, as their story\'s heart-stopping climax proves a game-changer for the entire family.', 'http://books.google.com/books/content?id=rQhKAQAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:24:57', '2017-04-15 16:24:57'),
