	(583, 'The Infinite Sea', 'Rick Yancey', 320, 'eyFiAgAAQBAJ', 'The riveting follow-up to the New York Times bestselling The 5th Wave, hailed by Justin Cronin as “wildly entertaining.” How do you rid the Earth of seven billion humans? Rid the humans of their humanity. Surviving the first four waves was nearly impossible. Now Cassie Sullivan finds herself in a new world, a world in which the fundamental trust that binds us together is gone. As the 5th Wave rolls across the landscape, Cassie, Ben, and Ringer are forced to confront the Others’ ultimate goal: the extermination of the human race. Cassie and her friends haven’t seen the depths to which the Others will sink, nor have the Others seen the heights to which humanity will rise, in the ultimate battle between life and death, hope and despair, love and hate. Praise for The 5th Wave “Just read it.”—Entertainment Weekly “A modern sci-fi masterpiece.”—USA Today “Wildly entertaining . . . I couldn’t turn the pages fast enough.”—Justin Cronin, The New York Times Book Review “Nothing short of amazing.”—Kirkus Reviews (starred review) “Gripping!”—Publishers Weekly (starred review) “Everyone I trust is telling me to read this book.”—The Atlantic Wire', 'http://books.google.com/books/content?id=eyFiAgAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:25:38', '2017-04-15 16:25:38'),
