	(587, 'The Tiger Rising', 'Kate DiCamillo', 128, 'A0VKAgAAQBAJ', 'A National Book Award finalist by Newbery Medalist Kate DiCamillo. Walking through the misty Florida woods one morning, twelve-year-old Rob Horton is stunned to encounter a tiger—a real-life, very large tiger—pacing back and forth in a cage. What’s more, on the same extraordinary day, he meets Sistine Bailey, a girl who shows her feelings as readily as Rob hides his. As they learn to trust each other, and ultimately, to be friends, Rob and Sistine prove that some things—like memories, and heartache, and tigers—can’t be locked up forever. Featuring a new cover illustration by Stephen Walton and an excerpt of Kate DiCamillo\'s newest novel, Raymie Nightingale.', 'http://books.google.com/books/content?id=A0VKAgAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:25:41', '2017-04-15 16:25:41'),
