	(616, 'the secret life of bees', 'Sue Monk Kidd', 317, 'FiIXot_e10sC', 'After her \"stand-in mother,\" a bold black woman named Rosaleen, insults the three biggest racists in town, Lily Owens joins Rosaleen on a journey to Tiburon, South Carolina, where they are taken in by three black, bee-keeping sisters.', 'http://books.google.com/books/content?id=FiIXot_e10sC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:26:07', '2017-04-15 16:26:07'),
