	(622, 'Whiskey & Charlie', 'Annabel Smith', 336, '_y8_BgAAQBAJ', '\"A sharp, perceptive novel about family and forgiveness, Whiskey & Charlie will stay with me for a very long time.\" Christina Baker Kline, #1 New York Times bestselling author of Orphan Train A captivating debut novel of brothers who have drifted apart and the accident that will determine their future, by an unforgettable new voice in fiction. Whiskey and Charlie might have come from the same family, but they\'d tell you two completely different stories about growing up. Whiskey is everything Charlie is not bold, daring, carefree and Charlie blames his twin brother for always stealing the limelight, always getting everything, always pushing Charlie back. By the time the twins reach adulthood, they are barely even speaking to each other. When they were just boys, the secret language they whispered back and forth over their crackly walkie-talkies connected them, in a way. The two-way alphabet (alpha, bravo, charlie, delta) became their code, their lifeline. But as the brothers grew up, they grew apart. When Charlie hears that Whiskey has been in a terrible accident and has slipped into a coma, Charlie can\'t make sense of it. Who is he without Whiskey? As days and weeks slip by and the chances of Whiskey recovering grow ever more slim, Charlie is forced to consider that he may never get to say all the things he wants to say. A compelling and unforgettable novel about rivalry and redemption, Whiskey & Charlie is perfect for anyone whose family has ever been less than picture-perfect. \"A finely crafted novel that keeps us reading because we care about the characters. It\'s a terrific book.\"—Graeme Simsion, New York Times bestselling author of The Rosie Project and The Rosie Effect', 'http://books.google.com/books/content?id=_y8_BgAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:26:13', '2017-04-15 16:26:13'),
	(623, 'Inside out and Back again', 'Thanhha Lai', 276, 'kWjZKdoC1icC', 'Through a series of poems, a young girl chronicles the life-changing year of 1975, when she, her mother, and her brothers leave Vietnam and resettle in Alabama.', 'http://books.google.com/books/content?id=kWjZKdoC1icC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:26:13', '2017-04-15 16:26:13'),
	(624, 'Tangerine', 'Edward Bloor', 312, 'C4BhbzcOIAMC', 'Twelve-year-old Paul, who lives in the shadow of his football hero brother Erik, fights for the right to play soccer despite his near blindness and slowly begins to remember the incident that damaged his eyesight. An ALA Best Book for Young Adults. Reprint. Jr Lib Guild.', 'http://books.google.com/books/content?id=C4BhbzcOIAMC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:26:14', '2017-04-15 16:26:14'),
	(625, 'If I Were You', 'Leslie Margolis', 224, '8O7dBAAAQBAJ', 'Katie\'s reasons why it\'s better to be Melody: -She\'s a boy magnet. I\'m more like a boy repellent. -Her parents never make her do any chores. Meanwhile, I get stuck babysitting almost every day. -Melody\'s parents are still married. Mine are, too . . . to other people. Why Melody thinks Katie has the ideal life: -Her house is fun and lively. My house is empty and lonely. -They have family dinners practically every single night. My dad almost never comes home. -Everyone always talks about how pretty I am, like that\'s the most important thing, like that\'s all I am . . . Twelve-year-old Katie is insanely jealous of her best friend, Melody. Turns out Melody is jealous of Katie, too. When they both wish for the exact same thing at the exact same time, to redo summer as each other, their wishes come true. Katie is Melody and Melody is Katie and neither one has the experience she expected. In this be-careful-what-you-wish-for tale, two best friends learn that the grass is not always greener on the other side', 'http://books.google.com/books/content?id=8O7dBAAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:26:15', '2017-04-15 16:26:15'),
	(626, 'The Last Kids on Earth', 'Max Brallier', 230, NULL, NULL, NULL, '2017-01-24 15:10:36', '2017-01-24 15:10:36'),
	(627, 'American Chinese Born', 'Gene Luen Yang', 240, 't0PgLhXc8rUC', 'Alternates three interrelated stories about the problems of young Chinese Americans trying to participate in the popular culture. Presented in comic book format.', 'http://books.google.com/books/content?id=t0PgLhXc8rUC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:26:18', '2017-04-15 16:26:18'),
