	(630, 'Prisoner B-3087', 'Alan Gratz, Jack Gruener, Ruth Gruener', 272, '88WBbtxTDcsC', '10 concentration camps. 10 different places where you are starved, tortured, and worked mercilessly. It\'s something no one could imagine surviving. But it is what Yanek Gruener has to face. As a Jewish boy in 1930s Poland, Yanek is at the mercy of the Nazis who have taken over. Everything he has, and everyone he loves, have been snatched brutally from him. And then Yanek himself is taken prisoner -- his arm tattooed with the words PRISONER B-3087. He is forced from one nightmarish concentration camp to another, as World War II rages all around him. He encounters evil he could have never imagined, but also sees surprising glimpses of hope amid the horror. He just barely escapes death, only to confront it again seconds later. Can Yanek make it through the terror without losing his hope, his will -- and, most of all, his sense of who he really is inside? Based on an astonishing true story.', 'http://books.google.com/books/content?id=88WBbtxTDcsC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:26:20', '2017-04-15 16:26:20'),
