	(634, 'Time For Andrew: A Ghost Story', 'Mary Downing Hahn', 176, 'pdMEKQ5H9BQC', 'When he goes to spend the summer with his great-aunt in the family\'s old house, eleven-year-old Drew is drawn eighty years into the past to trade places with his great-great-uncle who is dying of diphtheria.', 'http://books.google.com/books/content?id=pdMEKQ5H9BQC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:26:24', '2017-04-15 16:26:24'),
