	(636, 'The Last Kids on Earth: Zombie Parade', 'Max Brallier', 240, 'QuxVCgAAQBAJ', '\"Terrifyingly fun! Delivers big thrills and even bigger laughs.\"--Jeff Kinney, author of the #1 New York Times bestseller Diary of a Wimpy Kid Diary of a Wimpy Kid meets The Walking Dead in this very funny post-apocalyptic graphic novel for middle-grade readers. Ever since the monster apocalypse hit town, average thirteen year old Jack Sullivan has been living in his tree house, which he\'s armed to the teeth with catapults and a moat, not to mention video games and an endless supply of Oreos and Mountain Dew scavenged from abandoned stores. But Jack alone is no match for the hordes of Zombies and Winged Wretches and Vine Thingies, and especially not for the eerily intelligent monster known only as Blarg. So Jack builds a team: his dorky best friend, Quint; the reformed middle school bully, Dirk; Jack\'s loyal pet monster, Rover; and Jack\'s crush, June. With their help, Jack is going to slay Blarg, achieve the ultimate Feat of Apocalyptic Success, and be average no longer! Can he do it? Told in a mixture of text and black-and-white illustration, this is the perfect book for any kid who\'s ever dreamed of starring in his or her own comic book or video game. And then grab the sequel, The Last Kids on Earth and the Zombie Parade, now a New York Times bestseller!', 'http://books.google.com/books/content?id=QuxVCgAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:26:25', '2017-04-15 16:26:25'),
	(637, 'Eleanor Roosevelt The War Years and After', 'Blanche Wiesen Cook', 587, '3WJLAAAAYAAJ', 'A study of the complex and political figure of Eleanor Roosevelt begins with her harrowing childhood, describes the difficulties of her marriage, and explains how she persuaded Franklin to make the reforms that would make him famous.', 'http://books.google.com/books/content?id=3WJLAAAAYAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '2017-04-15 16:26:26', '2017-04-15 16:26:26'),
