	(653, 'Amped', 'Daniel H. Wilson', 352, '8LWiyk_4tJMC', 'Technology makes them superhuman. But mere mortals want them kept in their place. The New York Times bestselling author of Robopocalypse creates a stunning, near-future world where technology and humanity clash in surprising ways. The result? The perfect summer blockbuster. As he did in Robopocalypse, Daniel Wilson masterfully envisions a frightening near-future world. In Amped, people are implanted with a device that makes them capable of superhuman feats. The powerful technology has profound consequences for society, and soon a set of laws is passed that restricts the abilities—and rights—of \"amplified\" humans. On the day that the Supreme Court passes the first of these laws, twenty-nine-year-old Owen Gray joins the ranks of a new persecuted underclass known as \"amps.\" Owen is forced to go on the run, desperate to reach an outpost in Oklahoma where, it is rumored, a group of the most enhanced amps may be about to change the world—or destroy it. Once again, Daniel H. Wilson\'s background as a scientist serves him well in this technologically savvy thriller that delivers first-rate entertainment, as Wilson takes the \"what if\" question in entirely unexpected directions. Fans of Robopocalypse are sure to be delighted, and legions of new fans will want to get \"amped\" this summer.', 'http://books.google.com/books/content?id=8LWiyk_4tJMC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:26:39', '2017-04-15 16:26:39'),
