	(655, 'Who Is Steven Spielberg?', 'Stephanie Spinner', 112, 'mVKSAAAAQBAJ', 'While other kids played sports, Steven Spielberg was writing scripts and figuring out camera angles. He went from entertaining his Boy Scout troop with home movies to amazing audiences around the world with epic blockbusters. He has directed four of the most successful films of all time and has won two Academy Awards for Best Director. From Jaws to Lincoln, young readers and aspiring filmmakers will be fascinated by the life of this famous director.', 'http://books.google.com/books/content?id=mVKSAAAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:26:40', '2017-04-15 16:26:40'),
