	(665, 'Captain Nobody', 'Dean Pitchford', 208, 'KJo2E_kKpzIC', 'When Newt Newman\'s football-star brother, Chris, is knocked into a coma during the biggest game of the season, Newt\'s two best friends keep his mind off of the accident by helping him create the ultimate Halloween costume: Captain Nobody. Newt feels strong and confident in his new getup, so he keeps wearing it after Halloween is over. Soon Newt assumes the role of a hero in a string of exploits that include foiling a robbery and saving a planeload of passengers. But will Captain Nobody be able to save the one person he cares about most?', 'http://books.google.com/books/content?id=KJo2E_kKpzIC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:26:48', '2017-04-15 16:26:48'),
