	(672, 'Golden: Heart of Dread', 'Melissa De La Cruz, Michael Johnston', 288, 'WrKVDgAAQBAJ', 'The action-packed finale to the series Entertainment Weekly calls, \"part epic fantasy and part social commentary . . . addictive.\" Recast the spell. Light the flame. Make the world anew. With the ruins of New Kandy still smoldering around them and Nat\'s bond to her beloved drakon quickly fraying, Nat and Wes are lost amid a sea of destruction--with Wes at death\'s door. Wes tried to save his sister, Eliza, and protect them from her cruelty, only to see firsthand just how dark her power had become. Desperate to escape the dangers lurking in New Kandy, Wes accepts help from a mysterious voice calling out to him from the Blue, leading Nat and his crew into even more perilous surroundings. They quickly realize that their only chance for survival lies with Nat and the quest for a new world to replace their broken one--but at what cost? In this epic conclusion to the Heart of Dread trilogy, Nat and Wes must put their love to the ultimate test in hopes of seeing their world reborn. Praise for the Heart of Dread series \"Ice cold hotness.\" - MTV.com \"Fans of The Hunger Games will no doubt enjoy sinking their teeth into this exciting book.\"--School Library Journal \"De la Cruz and Johnston score a hit. . . . Readers will find themselves completely immersed in the authors\' dangerous world.\"--Kirkus Reviews \"Readers are plunged right in the middle of the action from the first page... an action-packed adventure.\"--Kirkus Reviews \"The concept of overlapping worlds on one planet will intrigue readers and raise philosophical questions about the nature of reality. The cliff-hanger ending assures readers that a finale is in the works.\"--Booklist \"Fans of the first book will no doubt be very happy with where this action-filled trilogy is headed.\"--School Library Journal', 'http://books.google.com/books/content?id=WrKVDgAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:26:58', '2017-04-15 16:26:58'),
