	(680, 'Great Greene: The heist', 'Varian Johnson', 240, 'ootcAgAAQBAJ', 'Saving the school -- one con at a time. \"A political heist page-turner set in middle school? Is that even possible? Varian Johnson shows us how it\'s done.\" - Gordon Korman, author of SWINDLE \"Do yourself a favor and start reading immediately.\" - Rebecca Stead, author of WHEN YOU REACH ME Jackson Greene swears he\'s given up scheming. Then school bully Keith Sinclair announces he\'s running for Student Council president, against Jackson\'s former friend Gaby de la Cruz. Gaby wants Jackson to stay out of it -- but he knows Keith has \"connections\" to the principal, which could win him the presidency no matter the vote count. So Jackson assembles a crack team: Hashemi Larijani, tech genius. Victor Cho, bankroll. Megan Feldman, science goddess. Charlie de la Cruz, reporter. Together they devise a plan that will take down Keith, win Gaby\'s respect, and make sure the election is done right. If they can pull it off, it will be remembered as the school\'s greatest con ever -- one worthy of the name THE GREAT GREENE HEIST. *\"The lively (and racially diverse) cast of characters and the intricate plot will make this a story to read again for the sheer fun of it all\"- Horn Book, starred review', 'http://books.google.com/books/content?id=ootcAgAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:27:07', '2017-04-15 16:27:07'),
