	(683, 'Zelda Majoras Mask', 'Akira Himekawa', 192, 's2CVQAAACAAJ', 'The manga adapation of the legendary video game series, now available in English for the first time! Become part of the Legend – The Legend of Zelda! R to L (Japanese Style). In the mystical land of Hyrule, three spiritual stones hold the key to the Triforce, and whoever holds them will control the world. A boy named Link sets out on a quest to deliver the Emerald, the spiritual stone of the forest, to Zelda, Princess of the land of Hyrule. The journey will be long and perilous, and Link will need all his skill and courage to defeat evil. The battle for Hyrule and the Sacred Realm has begun! Final Volume! A Link to the Past A terrible tragedy befalls Link\'s family and friends when the traitorous Agahnim launches a plot to seize the Triforce and unleash a terrible evil on the world. To bring justice to Agahnim, Link needs the Master Sword and sets off on a quest to find it. Link\'s journey may also help him discover what happened to his parents, and while Agahnim\'s minions and traps are dangerous, this link to the past may be even more challenging!', 'http://books.google.com/books/content?id=s2CVQAAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '2017-04-15 16:27:08', '2017-04-15 16:27:08'),
