	(686, 'Zelda The Minish Cap', 'Akira Himekawa', 192, 'qFxKPgAACAAJ', 'R to L (Japanese Style) In the mystical land of Hyrule, three spiritual stones hold the key to the Triforce, and whoever holds them will control the world. A boy named Link sets out on a quest to deliver the Emerald, the spiritual stone of the forest, to Zelda, Pr The Minish Cap On the day of the Picori Festival, Link and Princess Zelda go to watch the sword-fighting tournament. The winner is a strange man named Vaati, who has come to claim the Light Force which is sealed within the Bound Chest. When the Light Force turns up missing, Vaati turns Princess Zelda to stone! To save his friend, Link needs the power of the Picori Blade, but only a certain master swordsmith can reforge it. Can Link find the pieces of the broken sword before Vaati does? The manga adapation of the legendary video game series, now available in English for the first time! Become part of the Legend – The Legend of Zelda!', 'http://books.google.com/books/content?id=qFxKPgAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '2017-04-15 16:27:10', '2017-04-15 16:27:10'),
