	(696, 'So B. It', 'Sarah Weeks', 288, '6ULzCwAAQBAJ', 'You couldn′t really tell about Mama′s brain just from looking at her, but it was obvious as soon as she spoke. She had a high voice, like a little girl′s, and she only knew 23 words. I know this for a fact, because we kept a list of the things Mama said tacked to the inside of the kitchen cabinet. Most of the words were common ones, like good and more and hot, but there was one word only my mother said: soof. Although she lives an unconventional lifestyle with her mentally disabled mother and their doting neighbour, Bernadette, Heidi has a lucky streak that has a way of pointing her in the right direction. When a mysterious word in her mother′s vocabulary begins to haunt her, Heidi′s thirst for the truth leads her on a cross-country journey in search of the secrets of her past.', 'http://books.google.com/books/content?id=6ULzCwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:27:18', '2017-04-15 16:27:18'),
