	(705, 'The Cellar', 'Natasha Preston', 368, 'GoHfAgAAQBAJ', 'Now a New York Times bestseller! A gripping, ripped-the-headlines thriller from writing sensation Natasha Preston. \"Lily?\" My stomach dropped as a tall, dark-haired man stepped into view. Had he been hiding between the trees? \"No. Sorry.\" Gulping, I took a step back. \"I\'m not Lily.\" He shook his head, a satisfied grin on his face. \"No. You are Lily.\" \"I\'m Summer. You have the wrong person.\" You utter freak! I could hear my pulse crashing in my ears. How stupid to give him my real name. He continued to stare at me, smiling. It made me feel sick. \"You are Lily,\" he repeated. Before I could blink, he threw his arms forward and grabbed me. I tried to shout, but he clasped his hand over my mouth, muffling my screams. My heart raced. I\'m going to die. For months Summer is trapped in a cellar with the man who took her—and three other girls: Rose, Poppy, and Violet. His perfect, pure flowers. His family. But flowers can\'t survive long cut off from the sun, and time is running out...', 'http://books.google.com/books/content?id=GoHfAgAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:27:29', '2017-04-15 16:27:29'),
