	(738, 'TOKYO GHOUL  book 9', 'Sui Ishida', 202, 'khM0CwAAQBAJ', 'Kaneki, Nishio and Touka struggle to work together to rescue their human friend Kimi while Ghoul Investigator deaths skyrocket in wards 9 through 12. It all leads to an increase in CCG agents and an increased risk for Ghouls. As reinforcements are called in on both sides, the stakes are suddenly higher than ever. -- VIZ Media', 'http://books.google.com/books/content?id=khM0CwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:27:58', '2017-04-15 16:27:58'),
