	(770, 'Belly Up', 'Stuart Gibbs', 304, 'KCj6KE_GMGEC', 'Twelve-year-old Theodore \"Teddy\" Roosevelt Fitzroy believes that Henry, the hippopotamus at the brand-new FunJungle, has been murdered. The zoo’s top brass claim the hippo went belly up the natural way, but Teddy and his feisty friend Summer McCraken have other ideas. Could the culprit be FunJungle’s animal-hating head of operations? Or is it FunJungle’s owner—Summer’s dad—a man who is much more concerned about money than animal welfare? The deeper Teddy and Summer dig, the more danger they’re in—because when it comes to hippo homicide, the truth can’t be caged!', 'http://books.google.com/books/content?id=KCj6KE_GMGEC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:28:28', '2017-04-15 16:28:28'),
