	(781, 'the perks of being a wallflower', 'Stephen Chbosky', 240, 'zRvyawoY72MC', 'Shy, introspective, intelligent beyond his years, caught between trying to live his life and trying to run from it, Charlie is attempting to navigate through the uncharted territory of high school. The world of first dates and mixed tapes, family dramas and new friends. The world of sex, drugs, and music - when all one requires to feel infinite is that perfect song on that perfect drive. Standing on the fringes of life Charlie has a unique perspective of the world around him, but there comes a time to stop being a wallflower and see what it looks like from the dance floor. This haunting novel about the dilemma of passivity vs. passion has become a modern classic. Charlie\'s letters are singular and unique, hilarious and devastating and through Charlie, Stephen Chbosky has created a deeply affecting story that will spirit you back to those wild and poignant roller coaster days known as growing up.', 'http://books.google.com/books/content?id=zRvyawoY72MC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:28:39', '2017-04-15 16:28:39'),
