	(790, 'Dangerous Skies', 'Suzanne Fisher Staples', 240, 'SNQYyaYxj4IC', 'A Season of Change Along the Virginia shoreline where their families have lived for generations, Buck and Tunes Smith defy tradition. Raised together like brother and sister, they are bound by surname, but not by skin color. And just as Buck has come to rely on Tunes, Tunes has come to trust that even in a place where race can mean so much, their friendship will remain as dependable as the tides. But then the horrifying events of one spring afternoon tear them apart -- and change their world forever. Desperate to hang on to the thing that he values most, Buck struggles to uphold their friendship -- without realizing that his efforts are pushing Tunes farther and farther away. From a Newbury Honor -- winning author, this is a powerfully moving story of friendship in the face of racism, and betrayal in the name of loyalty.', 'http://books.google.com/books/content?id=SNQYyaYxj4IC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:28:45', '2017-04-15 16:28:45'),
