	(799, 'Captain Under-Pants and the Terrifying Return of  Tippy Tinkle Trousers', 'Dav Pilkey, Nuria Molinero', 290, 'nFBHLgEACAAJ', 'Tra-la-laaa! Captain Underpants is back in an all-new epic adventure that\'s the zaniest, funniest, outrageousest, and time-travelingiest yet! In this ninth epic novel, Dav Pilkey takes readers back in time to the carefree days of kindergarten, when the worst thing George and Harold had to face was NOT evil mad scientists or alien cafeteria ladies but a sixth-grade bully named Kipper Krupp, the nephew of their school principal. And because George and Harold don\'t actually invent Captain Underpants until fourth grade, the two clever kindergartners are on their own -- using their brains to beat the bully. En la novena novela, Dav Pilkey lleva a los lectores a los tiempos en que Jorge y Berto estaban en kindergarten, cuando la mayor preocupación de los chicos era un abusón de sexto grado sobrino del director de la escuela. Y como Jorge y Berto no inventaron al Capitán Calzoncillos hasta cuarto grado, los chicos no tienen quien los ayude. No les queda más remedio que usar la cabeza para vencer al abusón.', 'http://books.google.com/books/content?id=nFBHLgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '2017-04-15 16:28:53', '2017-04-15 16:28:53'),
