	(809, 'I so don\'t do famous', 'Barrie Summy', 304, 'dw0uetF10xcC', 'When thirteen-year-old Sherry Baldwin\'s essay wins a magazine contest, she, her father, and best friend Junie go to Hollywood, where she helps her ghost-detective mother and another ghost investigate a series of burglaries.', 'http://books.google.com/books/content?id=dw0uetF10xcC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:29:01', '2017-04-15 16:29:01'),
