	(813, 'National Geographic: Gender Revolution', 'National Geographic Society (U.S.)', 128, '4g0I9qMfDDoC', 'Presents detailed topographical maps of China and ten of its major cities, providing maps of and information about its geographical features, population, religion, economy, trade, politics, transportation, and more.', 'http://books.google.com/books/content?id=4g0I9qMfDDoC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:29:05', '2017-04-15 16:29:05'),
	(814, 'National Geographic: Real Zombies', 'National Geographic', 146, NULL, NULL, NULL, '2017-04-14 12:10:03', '2017-04-14 12:10:03'),
