	(816, 'Olive\'s Ocean', 'Kevin Henkes', 217, NULL, NULL, NULL, '2017-04-14 13:20:09', '2017-04-14 13:20:09'),
	(817, 'The Night Parade', 'Kathryn Tanquary', 336, 'byJjCgAAQBAJ', '\"I thought you might sleep through it.\" The creature smiled. Saki\'s voice was little more than a whisper. \"Sleep through what?\" It leaned over. She stared into its will-o\'-the-wisp eyes. \"The Night Parade, of course.\" The last thing Saki Yamamoto wants to do for her summer vacation is trade in exciting Tokyo for the antiquated rituals and bad cell reception of her grandmother\'s village. Preparing for the Obon ceremony is boring. Then the local kids take interest in Saki and she sees an opportunity for some fun, even if it means disrespecting her family\'s ancestral shrine on a malicious dare. But as Saki rings the sacred bell, the darkness shifts. A death curse has been invoked...and Saki has three nights to undo it. With the help of three spirit guides and some unexpected friends, Saki must prove her worth-or say goodbye to the world of the living forever...', 'http://books.google.com/books/content?id=byJjCgAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '2017-04-15 16:29:09', '2017-04-15 16:29:09'),
